 (572,'{\"pron\":\"/ˌæp.rɪˈhend/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/app/appre/apprehend.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"hiểu rõ, thấy rõ, cảm thấy rõ\",\"kindId\":4,\"examples\":[{\"content\":\"to apprehend something well\"}]},{\"content\":\"sợ, e sợ\",\"kindId\":4,\"examples\":[{\"content\":\"to apprehend death\"},{\"content\":\"to apprehend that...\"}]},{\"content\":\" to understand something\",\"kindId\":9,\"examples\":[{\"content\":\"They were slow to apprehend the danger.\"}]},{\"content\":\"bắt, tóm, nắm lấy\",\"kindId\":4,\"examples\":[]},{\"content\":\" if the police apprehend a criminal, they catch him or her\",\"kindId\":9,\"examples\":[{\"content\":\"The police have failed to apprehend the culprits.\"}]}],\"description\":\"apprehend\",\"meaningMap\":{},\"timeStamp\":1296033152153}','apprehend','/ˌæp.rɪˈhend/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/app/appre/apprehend.mp3\', this)',1296033152153),
 (573,'{\"pron\":\"/blɜːb/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/b/blu/blurb/blurb.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"lời quảng cáo sách, lời giới thiệu sách (của nhà xuất bản)\",\"kindId\":2,\"examples\":[]},{\"content\":\" a short description giving information about a book, new product etc\",\"kindId\":8,\"examples\":[]}],\"description\":\"blurb\",\"meaningMap\":{},\"timeStamp\":1296033158543}','blurb','/blɜːb/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/b/blu/blurb/blurb.mp3\', this)',1296033158543),
 (574,'{\"pron\":\"/kənˈtɪn.dʒənt .si/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/con/conti/contingency.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" an amount of money that a lawyer in the US will be paid only if the person they are advising wins in court\",\"kindId\":8,\"examples\":[]},{\"content\":\" an event or situation that might happen in the future, especially one that could cause problems\",\"kindId\":8,\"examples\":[{\"content\":\"a contingency plan\"},{\"content\":\"Add up your outgoings, putting on a bit more for contingencies.\"}]},{\"content\":\"món chi tiêu bất ngờ\",\"kindId\":2,\"examples\":[]},{\"content\":\"sự ngẫu nhiên, sự tình cờ; việc bất ngờ\",\"kindId\":2,\"examples\":[{\"content\":\"prepared for all contingencies\"},{\"content\":\"a contingency plan\"},{\"content\":\"should a contingency arise; in case of a contingency\"}]}],\"description\":\"contingency\",\"meaningMap\":{},\"timeStamp\":1296033164790}','contingency','/kənˈtɪn.dʒənt .si/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/con/conti/contingency.mp3\', this)',1296033164790),
 (575,'{\"pron\":\"/diːm/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/d/dee/deem_/deem.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"tưởng rằng, nghĩ rằng, cho rằng, thấy rằng\",\"kindId\":4,\"examples\":[{\"content\":\"to deem it one\\u0027\\u0027s duty\"},{\"content\":\"to deem highly of...\"},{\"content\":\"I deem it necessary to help him\"}]},{\"content\":\"deem that\",\"examples\":[{\"content\":\"They deemed that he was no longer capable of managing the business.\"}],\"type\":\"gram\"},{\"content\":\" to think of something in a particular way or as having a particular quality\",\"kindId\":9,\"examples\":[{\"content\":\"They deemed that he was no longer capable of managing the business.\"},{\"content\":\"They were told to take whatever action they deemed necessary.\"},{\"content\":\"They were deemed to be illegal immigrants.\"},{\"content\":\"UK plans were deemed to infringe EU law.\"}]},{\"content\":\"be deemed to be something\",\"examples\":[{\"content\":\"They were deemed to be illegal immigrants.\"}],\"type\":\"gram\"},{\"content\":\"be deemed to do something\",\"examples\":[{\"content\":\"UK plans were deemed to infringe EU law.\"}],\"type\":\"gram\"},{\"content\":\"deem something necessary/appropriate etc\",\"examples\":[{\"content\":\"They were told to take whatever action they deemed necessary.\"}],\"type\":\"collo\"}],\"description\":\"deem\",\"meaningMap\":{},\"timeStamp\":1296033173734}','deem','/diːm/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/d/dee/deem_/deem.mp3\', this)',1296033173734),
 (576,'{\"pron\":\"/ɪkˈskluː.sɪv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/exc/exclu/exclusive.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"loại trừ\",\"kindId\":1,\"examples\":[]},{\"content\":\"(dùng như phó từ) trừ, không kể, không gồm\",\"kindId\":1,\"examples\":[{\"content\":\"from page one to page ten exclusive\"},{\"content\":\"100,000 people exclusive of women\"}]},{\"content\":\" concerned with only one thing\",\"kindId\":7,\"examples\":[{\"content\":\"The committee\\u0027\\u0027s exclusive focus will be to improve public transportation.\"}]},{\"content\":\" deliberately not allowing someone to do something or be part of a group\",\"kindId\":7,\"examples\":[{\"content\":\"a racially exclusive hiring policy\"}]},{\"content\":\"độc nhất\",\"kindId\":1,\"examples\":[{\"content\":\"one\\u0027\\u0027s exclusive occupation\"}]},{\"content\":\" an important or exciting story that is printed in only one newspaper, because that newspaper was the first to find out about it\",\"kindId\":8,\"examples\":[{\"content\":\"a New York Post exclusive about the Kennedy marriage\"}]},{\"content\":\" available or belonging only to particular people, and not shared\",\"kindId\":7,\"examples\":[{\"content\":\"Our figure skating club has exclusive use of the rink on Mondays.\"},{\"content\":\"This offer is exclusive to readers of The Sun.\"},{\"content\":\"Tune in to our exclusive coverage of Wimbledon.\"}]},{\"examples\":[{\"content\":\"This offer is exclusive to readers of The Sun.\"}],\"type\":\"gram\"},{\"content\":\"exclusive access/rights/use etc\",\"examples\":[{\"content\":\"Our figure skating club has exclusive use of the rink on Mondays.\"}],\"type\":\"collo\"},{\"content\":\" not including something\",\"kindId\":7,\"examples\":[{\"content\":\"Our prices are exclusive of sales tax.\"}]},{\"content\":\" exclusive places, organizations, clothes etc are so expensive that not many people can afford to use or buy them\",\"kindId\":7,\"examples\":[{\"content\":\"Bel Air is an exclusive suburb of Los Angeles.\"},{\"content\":\"an exclusive girls\\u0027\\u0027 school\"}]},{\"content\":\"exclusive report/interview/coverage etc\",\"examples\":[{\"content\":\"Tune in to our exclusive coverage of Wimbledon.\"}],\"type\":\"collo\"},{\"content\":\"riêng biệt, dành riêng (câu lạc bộ, cửa hàng...); độc chiếm, độc quyền\",\"kindId\":1,\"examples\":[{\"content\":\"an exclusive interview\"},{\"content\":\"exclusive right to sell something\"}]},{\"content\":\" if two things are mutually exclusive, you cannot have or do both of them\",\"kindId\":7,\"examples\":[{\"content\":\"Lesbianism and motherhood are not mutually exclusive.\"}]}],\"description\":\"exclusive\",\"meaningMap\":{},\"timeStamp\":1296033185244}','exclusive','/ɪkˈskluː.sɪv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/exc/exclu/exclusive.mp3\', this)',1296033185244),
 (577,'{\"pron\":\"/ˈfluː.ənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/flu/fluen/fluent.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" fluent movements are smooth and gentle, not sudden and sharp\",\"kindId\":7,\"examples\":[{\"content\":\"She rose with the fluent movement of an athlete.\"}]},{\"content\":\"(từ hiếm,nghĩa hiếm) cháy, dễ cháy\",\"kindId\":2,\"examples\":[]},{\"content\":\"lưu loát, trôi chảy, viết lưu loát\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"She was fluent in English, French, and German.\"}],\"type\":\"gram\"},{\"content\":\" able to speak a language very well\",\"kindId\":7,\"examples\":[{\"content\":\"She was fluent in English, French, and German.\"}]},{\"content\":\"uyển chuyển, dễ dàng (cử động)\",\"kindId\":2,\"examples\":[]},{\"content\":\" someone who speaks fluent French etc speaks it like a person from that country\",\"kindId\":7,\"examples\":[{\"content\":\"He spoke in fluent Italian.\"}]},{\"content\":\" fluent speech or writing is smooth and confident, with no mistakes\",\"kindId\":7,\"examples\":[{\"content\":\"He was a fluent and rapid prose writer.\"}]}],\"description\":\"fluent\",\"meaningMap\":{},\"timeStamp\":1296033191295}','fluent','/ˈfluː.ənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/flu/fluen/fluent.mp3\', this)',1296033191295),
 (578,'{\"pron\":\"/gləʊ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/g/glo/glow_/glow.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"ánh sáng rực rỡ\",\"kindId\":2,\"examples\":[{\"content\":\"the red glow of the setting sun\"}]},{\"examples\":[{\"content\":\"The interior of the house glowed with colour, warmth, and life.\"}],\"type\":\"gram\"},{\"content\":\"nét ửng đỏ (vì then, vì ngồi cạnh lửa...); nước da hồng hào, sắc đỏ hây hây (khoẻ mạnh)\",\"kindId\":2,\"examples\":[{\"content\":\"to be in a glow; to be all of a glow\"}]},{\"content\":\" to look very happy because you feel proud etc\",\"kindId\":9,\"examples\":[{\"content\":\"She gazed up at him, glowing with happiness.\"}]},{\"content\":\" to produce or reflect a soft steady light\",\"kindId\":9,\"examples\":[{\"content\":\"The bedside lamp glowed dimly.\"},{\"content\":\"The fireplace was still glowing with the remains of last night\\u0027\\u0027s fire.\"},{\"content\":\"The red tip of his cigarette was glowing in the dark.\"}]},{\"content\":\" if something glows with a quality or colour, it is attractive and has strong colours\",\"kindId\":9,\"examples\":[{\"content\":\"The interior of the house glowed with colour, warmth, and life.\"}]},{\"content\":\"đỏ bừng (mặt vì thẹn), bừng bừng, nóng bừng, rực lên\",\"kindId\":3,\"examples\":[{\"content\":\"face glowed with anger\"}]},{\"content\":\" a soft steady light\",\"kindId\":8,\"examples\":[{\"content\":\"the glow from the dying fire\"},{\"content\":\"the green glow of the computer monitor\"},{\"content\":\"the dim glow of the lightbulb\"},{\"content\":\"the warm glow of the setting sun\"}]},{\"content\":\"(vật lý) sự phát sáng; lớp sáng\",\"kindId\":2,\"examples\":[{\"content\":\"positive glow\"},{\"content\":\"the negative glow\"}]},{\"content\":\"nóng rực\",\"kindId\":3,\"examples\":[]},{\"content\":\"cảm giác âm ấm (khắp mình)\",\"kindId\":2,\"examples\":[{\"content\":\"to be in a nice glow; to feet a nice glow\"}]},{\"content\":\" the pink colour in your face or body that you have when you are healthy, have been doing exercise, or are excited\",\"kindId\":8,\"examples\":[{\"content\":\"She had a healthy glow in her cheeks.\"}]},{\"content\":\"cảm thấy âm ấm (trong mình)\",\"kindId\":3,\"examples\":[]},{\"examples\":[{\"content\":\"the dim glow of the lightbulb\"}],\"type\":\"gram\"},{\"content\":\" a strong feeling of pleasure etc\",\"kindId\":8,\"examples\":[{\"content\":\"Sophie felt a glow of pride.\"}]},{\"content\":\"sức nóng rực\",\"kindId\":2,\"examples\":[{\"content\":\"summer\\u0027\\u0027s scorching glow\"}]},{\"content\":\"(nghĩa bóng) sự hăng hái, sự sôi nổi nhiệt tình\",\"kindId\":2,\"examples\":[{\"content\":\"the glow of youth\"}]},{\"content\":\"rực sáng, bừng sáng\",\"kindId\":3,\"examples\":[]},{\"examples\":[{\"content\":\"She looked exceptionally well, glowing with health.\"}],\"type\":\"gram\"},{\"content\":\"rực rỡ (màu sắc)\",\"kindId\":3,\"examples\":[]},{\"content\":\" if your face or body glows, it is pink or hot because you are healthy, have been doing exercise, or are feeling a strong emotion\",\"kindId\":9,\"examples\":[{\"content\":\"She looked exceptionally well, glowing with health.\"}]},{\"examples\":[{\"content\":\"the glow from the dying fire\"}],\"type\":\"gram\"}],\"description\":\"glow\",\"meaningMap\":{},\"timeStamp\":1296033202133}','glow','/gləʊ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/g/glo/glow_/glow.mp3\', this)',1296033202133),
 (579,'{\"pron\":\"/ˈhæm.pər/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/ham/hampe/hamper.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"cái hòm mây (để đựng thức ăn)\",\"kindId\":2,\"examples\":[]},{\"content\":\"làm vướng (sự cử động của ai...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"(hàng hải) đồ trang bị cồng kềnh\",\"kindId\":2,\"examples\":[]},{\"content\":\"thức (ăn, uống) đựng trong hòm mây\",\"kindId\":2,\"examples\":[]},{\"content\":\" to make it difficult for someone to do something\",\"kindId\":9,\"examples\":[{\"content\":\"She tried to run, but was hampered by her heavy suitcase.\"},{\"content\":\"An attempt to rescue the men has been hampered by bad weather.\"}]},{\"content\":\" a large basket that you put dirty clothes in until they can be washed\",\"kindId\":8,\"examples\":[]},{\"content\":\"(nghĩa bóng) cản trở, ngăn trở\",\"kindId\":4,\"examples\":[]},{\"content\":\" a basket with a lid, which is used for carrying food or sending it to someone as a present\",\"kindId\":8,\"examples\":[{\"content\":\"They sent us a lovely Christmas hamper.\"},{\"content\":\"a picnic hamper\"}]}],\"description\":\"hamper\",\"meaningMap\":{},\"timeStamp\":1296033212921}','hamper','/ˈhæm.pər/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/ham/hampe/hamper.mp3\', this)',1296033212921),
 (580,'{\"pron\":\"/ˌɪn.təˈleɪs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72508.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"bện chéo vào nhau\",\"kindId\":3,\"examples\":[]},{\"content\":\"(nghĩa bóng) kết hợp chặt chẽ với nhau, ràng buộc với nhau\",\"kindId\":4,\"examples\":[]},{\"content\":\"trộn lẫn với nhau\",\"kindId\":4,\"examples\":[]},{\"content\":\"kết lại với nhau, bện lại, xoắn lại, ken lại\",\"kindId\":4,\"examples\":[]}],\"description\":\"interlace\",\"meaningMap\":{},\"timeStamp\":1296033221358}','interlace','/ˌɪn.təˈleɪs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72508.mp3\', this)',1296033221358),
 (581,'{\"pron\":\"/ˈnɪt.ɪŋ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/k/kni/knitt/knitting.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"việc đan len\",\"kindId\":2,\"examples\":[]},{\"content\":\" something that is being knitted\",\"kindId\":8,\"examples\":[]},{\"content\":\" the activity or action of knitting clothes\",\"kindId\":8,\"examples\":[]},{\"content\":\"hàng len, đồ đan; hàng dệt kim\",\"kindId\":2,\"examples\":[]}],\"description\":\"knitting\",\"meaningMap\":{},\"timeStamp\":1296033235031}','knitting','/ˈnɪt.ɪŋ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/k/kni/knitt/knitting.mp3\', this)',1296033235031),
 (582,'{\"pron\":\"/ˈlek.sɪ.kəl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usl/uslev/uslev__011.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(thuộc) từ vựng học\",\"kindId\":1,\"examples\":[]},{\"content\":\" dealing with words, or related to words\",\"kindId\":7,\"examples\":[]}],\"description\":\"lexical\",\"meaningMap\":{},\"timeStamp\":1296033241109}','lexical','/ˈlek.sɪ.kəl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usl/uslev/uslev__011.mp3\', this)',1296033241109),
 (583,'{\"pron\":\"/muːd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/moo/mood_/mood.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(ngôn ngữ học) lối, thức\",\"kindId\":2,\"examples\":[{\"content\":\"subjunctive mood\"},{\"content\":\"imperatives mood\"}]},{\"content\":\"tâm trạng; tính khí, tâm tính, tính tình\",\"kindId\":2,\"examples\":[{\"content\":\"to be in a merry mood\"},{\"content\":\"a man of moods\"}]},{\"content\":\" to feel unhappy, impatient, or angry and to refuse to speak normally to other people\",\"kindId\":8,\"examples\":[{\"content\":\"He\\u0027\\u0027s been in a real mood all day.\"},{\"content\":\"Don\\u0027\\u0027t talk to her. She\\u0027\\u0027s in one of her moods (\\u003dused about someone who is often unhappy, angry etc).\"}]},{\"content\":\" to feel that you would like to do something\",\"kindId\":8,\"examples\":[{\"content\":\"I don\\u0027\\u0027t want to talk about it now. I\\u0027\\u0027m not in the mood.\"},{\"content\":\"We really felt in the mood for a party.\"}]},{\"content\":\"[countable] the way you feel at a particular time\",\"kindId\":8,\"examples\":[{\"content\":\"the general mood of depression in the office\"},{\"content\":\"The manager was in a foul mood and was shouting at everyone.\"},{\"content\":\"The good weather put him in an excellent mood for breakfast.\"},{\"content\":\"You\\u0027\\u0027re in a good mood this morning!\"},{\"content\":\"The players are all in a confident mood.\"},{\"content\":\"the growing mood of confidence in East-West relations\"},{\"content\":\"Why had her mood changed so dramatically?\"},{\"content\":\"The weather did little to lighten their mood.\"},{\"content\":\"The mood of the crowd was unpredictable.\"},{\"content\":\"a mental disorder characterized by severe mood swings\"},{\"content\":\"The movie accurately reflects the mood of the time .\"},{\"content\":\"What kind of mood is she in today?\"},{\"content\":\"It usually takes me a couple of days to get into the holiday mood.\"}]},{\"content\":\" to not want to do something, or be determined not to do something\",\"kindId\":8,\"examples\":[{\"content\":\"I was in no mood for a joke.\"},{\"content\":\"George was in no mood to be sociable.\"}]},{\"content\":\"[countable] one of the sets of verb forms in grammar: the indicative (\\u003dexpressing a fact or action), the imperative (\\u003dexpressing a command), the interrogative (\\u003dexpressing a question) or the subjunctive (\\u003dexpressing a doubt or wish)\",\"kindId\":8,\"examples\":[]},{\"content\":\"(âm nhạc) điệu\",\"kindId\":2,\"examples\":[]},{\"content\":\"[singular] the way that a place, event, book, film etc seems or makes you feel\",\"kindId\":8,\"examples\":[{\"content\":\"The opening shot of dark, rainy streets sets the mood for the whole film.\"}]}],\"description\":\"mood\",\"meaningMap\":{},\"timeStamp\":1296033247414}','mood','/muːd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/moo/mood_/mood.mp3\', this)',1296033247414),
 (584,'{\"pron\":\"/ˈnəʊ.tə.bl ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73261.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"notable feature/example\",\"examples\":[{\"content\":\"A notable feature of the church is its unusual bell tower.\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"The town is notable for its busy open-air market.\"}],\"type\":\"gram\"},{\"content\":\"(từ cổ,nghĩa cổ) tần tảo\",\"kindId\":1,\"examples\":[]},{\"content\":\"có tiếng, trứ danh\",\"kindId\":1,\"examples\":[]},{\"content\":\"đáng kể, đáng chú ý\",\"kindId\":1,\"examples\":[]},{\"content\":\"notable achievement/success/victory\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"người có danh vọng, người có địa vị uy quyền\",\"kindId\":2,\"examples\":[]},{\"content\":\" important, interesting, excellent, or unusual enough to be noticed or mentioned\",\"kindId\":7,\"examples\":[{\"content\":\"The town is notable for its busy open-air market.\"},{\"content\":\"A notable feature of the church is its unusual bell tower.\"},{\"content\":\"Every country in the world signed the treaty, with one notable exception - the United States.\"}]},{\"content\":\"thân hào, nhân sĩ\",\"kindId\":2,\"examples\":[]}],\"description\":\"notable\",\"meaningMap\":{},\"timeStamp\":1296033254577}','notable','/ˈnəʊ.tə.bl ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73261.mp3\', this)',1296033254577),
 (585,'{\"pron\":\"/əʊ ˈmɪʃ.ən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75202.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"điều bỏ sót, điều bỏ quên, điều bỏ đi\",\"kindId\":2,\"examples\":[]},{\"content\":\"a glaring omission\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"[uncountable] when you do not include or do not do something\",\"kindId\":8,\"examples\":[{\"content\":\"The omission of her name was not a deliberate act.\"},{\"content\":\"his omission from the team\"}]},{\"content\":\"sự không làm tròn, sự chểnh mảng\",\"kindId\":2,\"examples\":[]},{\"content\":\"serious/notable/major omission\",\"examples\":[{\"content\":\"Your failing to note her mistakes is a serious omission.\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"his omission from the team\"}],\"type\":\"gram\"},{\"content\":\"[countable] something that has been omitted\",\"kindId\":8,\"examples\":[{\"content\":\"Copies of the lists were posted so that omissions could be corrected.\"},{\"content\":\"Your failing to note her mistakes is a serious omission.\"}]},{\"content\":\"sự bỏ sót, sự bỏ quên, sự bỏ đi\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"The omission of her name was not a deliberate act.\"}],\"type\":\"gram\"}],\"description\":\"omission\",\"meaningMap\":{},\"timeStamp\":1296033260409}','omission','/əʊ ˈmɪʃ.ən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75202.mp3\', this)',1296033260409),
 (586,'{\"pron\":\"/ˈpær.ə.daɪm/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/p/par/parad/paradigm.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(ngôn ngữ học) hệ biến hoá\",\"kindId\":2,\"examples\":[]},{\"content\":\"mẫu\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"the basic paradigm of the family tree\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"Pius XII remained the paradigm of what a pope should be.\"}],\"type\":\"gram\"},{\"content\":\" a very clear or typical example of something\",\"kindId\":8,\"examples\":[{\"content\":\"Pius XII remained the paradigm of what a pope should be.\"}]},{\"content\":\" a model or example that shows how something works or is produced\",\"kindId\":8,\"examples\":[{\"content\":\"the basic paradigm of the family tree\"}]}],\"description\":\"paradigm\",\"meaningMap\":{},\"timeStamp\":1296033266391}','paradigm','/ˈpær.ə.daɪm/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/p/par/parad/paradigm.mp3\', this)',1296033266391),
 (587,'{\"pron\":\"/kwɔːˈtet/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/q/qua/quart/quartet.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"nhóm bốn (người, vật)\",\"kindId\":2,\"examples\":[]},{\"content\":\" four singers or musicians who sing or play together\",\"kindId\":8,\"examples\":[{\"content\":\"a string quartet (\\u003dfour people playing musical instruments with strings, such as violins)\"}]},{\"content\":\"(âm nhạc) bộ tư bản nhạc cho bộ tư\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"a quartet of short films set in the 1920s\"}],\"type\":\"gram\"},{\"content\":\" four people or things of the same type\",\"kindId\":8,\"examples\":[{\"content\":\"a quartet of short films set in the 1920s\"}]},{\"content\":\" a piece of music written for four performers\",\"kindId\":8,\"examples\":[]}],\"description\":\"quartet\",\"meaningMap\":{},\"timeStamp\":1296033273611}','quartet','/kwɔːˈtet/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/q/qua/quart/quartet.mp3\', this)',1296033273611),
 (588,'{\"pron\":\"/ˌrem.ɪˈnɪs.ənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/rem/remin/reminiscent.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" thinking about the past\",\"kindId\":7,\"examples\":[{\"content\":\"Her face wore a reminiscent smile.\"}]},{\"content\":\" reminding you of something\",\"kindId\":7,\"examples\":[{\"content\":\"a style strongly reminiscent of Virginia Woolf\\u0027\\u0027s novels\"}]},{\"content\":\"nhớ lại; làm nhớ lại, gợi lại\",\"kindId\":1,\"examples\":[{\"content\":\"to be reminiscent of something\"}]}],\"description\":\"reminiscent\",\"meaningMap\":{},\"timeStamp\":1296033279431}','reminiscent','/ˌrem.ɪˈnɪs.ənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/rem/remin/reminiscent.mp3\', this)',1296033279431),
 (589,'{\"pron\":\"/stɑːk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/s/sta/stark/stark.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" not wearing any clothes at all\",\"kindId\":6,\"examples\":[{\"content\":\"Ben was standing there stark naked.\"}]},{\"content\":\"cứng đờ\",\"kindId\":1,\"examples\":[{\"content\":\"to lie stark in death\"}]},{\"content\":\"(thơ ca) mạnh mẽ, quả quyết\",\"kindId\":1,\"examples\":[]},{\"content\":\"hoàn toàn\",\"kindId\":1,\"examples\":[{\"content\":\"stark madness\"}]},{\"content\":\" unpleasantly clear and impossible to avoid\",\"kindId\":7,\"examples\":[{\"content\":\"a stark reminder of life under communist rule\"},{\"content\":\"The extreme poverty of the local people is in stark contrast to the wealth of the tourists.\"},{\"content\":\"We are faced with a stark choice.\"},{\"content\":\"The movie shows the stark realities of life in the ghetto.\"}]},{\"content\":\"hoàn toàn\",\"kindId\":5,\"examples\":[{\"content\":\"stark crazy\"},{\"content\":\"stark naked\"}]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) lộ rõ hẳn ra, nổi bật ra\",\"kindId\":1,\"examples\":[{\"content\":\"a tree stark in the snow\"}]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) trần như nhộng\",\"kindId\":1,\"examples\":[]},{\"content\":\" very plain in appearance, with little or no colour or decoration\",\"kindId\":7,\"examples\":[{\"content\":\"the stark beauty of New Mexico\"},{\"content\":\"In the cold dawn light, the castle looked stark and forbidding.\"}]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) hoang vu, lạnh lẽo\",\"kindId\":1,\"examples\":[]},{\"content\":\" completely crazy\",\"kindId\":6,\"examples\":[{\"content\":\"He\\u0027\\u0027s gone stark raving mad.\"}]}],\"description\":\"stark\",\"meaningMap\":{},\"timeStamp\":1296033291321}','stark','/stɑːk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/s/sta/stark/stark.mp3\', this)',1296033291321),
 (590,'{\"pron\":\"/θɔːn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/tho/thorn/thorn.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" someone or something that annoys you or causes problems for a long period of time\",\"kindId\":8,\"examples\":[{\"content\":\"He\\u0027\\u0027s been a thorn in the side of the party leadership for years.\"}]},{\"content\":\"bụi gai; cây có gai\",\"kindId\":2,\"examples\":[]},{\"content\":\"gai\",\"kindId\":2,\"examples\":[]},{\"content\":\"(nghĩa bóng) sự khó khăn\",\"kindId\":2,\"examples\":[]},{\"content\":\"[uncountable and countable] a bush or tree that has thorns\",\"kindId\":8,\"examples\":[{\"content\":\"a long, low hedge of thorns\"}]},{\"content\":\"[countable] a sharp point that grows on the stem of a plant such as a rose\",\"kindId\":8,\"examples\":[]}],\"description\":\"thorn\",\"meaningMap\":{},\"timeStamp\":1296033297355}','thorn','/θɔːn/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/tho/thorn/thorn.mp3\', this)',1296033297355),
 (591,'{\"pron\":\"/juːˈbɪk.wɪ.təs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/ust/ustwi/ustwick023.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"ở đâu cũng có; đồng thời ở khắp nơi\",\"kindId\":1,\"examples\":[]},{\"content\":\" seeming to be everywhere - sometimes used humorously\",\"kindId\":7,\"examples\":[{\"content\":\"Coffee shops are ubiquitous these days.\"},{\"content\":\"a French film, starring the ubiquitous Gérard Depardieu\"}]}],\"description\":\"ubiquitous\",\"meaningMap\":{},\"timeStamp\":1296033303983}','ubiquitous','/juːˈbɪk.wɪ.təs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/ust/ustwi/ustwick023.mp3\', this)',1296033303983),
