 (593,'{\"pron\":\"/wedʒ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/w/wed/wedge/wedge.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(từ hiếm,nghĩa hiếm) bửa bằng nêm, chẻ bằng nêm\",\"kindId\":4,\"examples\":[]},{\"content\":\" to force something firmly into a narrow space\",\"kindId\":9,\"examples\":[{\"content\":\"Victoria wedged herself into the passenger seat.\"},{\"content\":\"The phone was wedged under his chin.\"}]},{\"content\":\" to make the relationship between two people or groups worse\",\"kindId\":8,\"examples\":[{\"content\":\"Their divorce has driven a wedge between the two families.\"}]},{\"content\":\"(quân sự) mũi nhọn\",\"kindId\":2,\"examples\":[{\"content\":\"to drive a wedge into\"}]},{\"content\":\"vật hình nêm\",\"kindId\":2,\"examples\":[]},{\"content\":\"(nghĩa bóng) chen vào, dấn vào\",\"kindId\":4,\"examples\":[]},{\"content\":\"cái nêm\",\"kindId\":2,\"examples\":[]},{\"content\":\" a piece of wood, metal etc that has one thick edge and one pointed edge and is used especially for keeping a door open or for splitting wood\",\"kindId\":8,\"examples\":[]},{\"content\":\" a piece of food shaped like a wedge\",\"kindId\":8,\"examples\":[{\"content\":\"Garnish with lemon wedges.\"},{\"content\":\"a wedge of cheese\"}]},{\"examples\":[{\"content\":\"a wedge of cheese\"}],\"type\":\"gram\"},{\"content\":\" to put something under a door, window etc to make it stay open or shut\",\"kindId\":9,\"examples\":[]},{\"content\":\"nêm, chêm\",\"kindId\":4,\"examples\":[]}],\"description\":\"wedge\",\"meaningMap\":{},\"timeStamp\":1296033323306}','wedge','/wedʒ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/w/wed/wedge/wedge.mp3\', this)',1296033323306),
 (594,'{\"pron\":\"/əˈdɔːn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/ado/adorn/adorn.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to decorate something\",\"kindId\":9,\"examples\":[{\"content\":\"church walls adorned with religious paintings\"}]},{\"content\":\"adorn something with something\",\"examples\":[{\"content\":\"church walls adorned with religious paintings\"}],\"type\":\"gram\"},{\"content\":\"tô điểm, trang điểm; trang trí, trang hoàng\",\"kindId\":4,\"examples\":[{\"content\":\"to adorn a room with flowers\"},{\"content\":\"to adorn oneself with jewels\"}]}],\"description\":\"adorn\",\"meaningMap\":{},\"timeStamp\":1296033329147}','adorn','/əˈdɔːn/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/ado/adorn/adorn.mp3\', this)',1296033329147),
 (595,'{\"pron\":\"/blɒb/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/b/blo/blob_/blob.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"viên tròn\",\"kindId\":2,\"examples\":[]},{\"content\":\"(thể dục,thể thao) điểm không (crikê)\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"a blob of honey\"}],\"type\":\"gram\"},{\"content\":\" something that cannot be clearly seen, especially because it is far away\",\"kindId\":8,\"examples\":[{\"content\":\"Without a telescope, the comet will look like a fuzzy blob.\"}]},{\"content\":\"giọt nước\",\"kindId\":2,\"examples\":[]},{\"content\":\" a very small round mass of a liquid or sticky substance\",\"kindId\":8,\"examples\":[{\"content\":\"a blob of honey\"}]},{\"content\":\"đốm màu\",\"kindId\":2,\"examples\":[]}],\"description\":\"blob\",\"meaningMap\":{},\"timeStamp\":1296033336840}','blob','/blɒb/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/b/blo/blob_/blob.mp3\', this)',1296033336840),
 (596,'{\"pron\":\"/kənˈsəʊl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/con/conso/console_01_00.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to make someone feel better when they are feeling sad or disappointed\",\"kindId\":9,\"examples\":[{\"content\":\"He consoled himself that he would see Kate again soon.\"},{\"content\":\"No one could console her when Peter died.\"},{\"content\":\"She consoled herself with the fact that no one else had done well in the exam either.\"}]},{\"content\":\"console yourself with something\",\"examples\":[{\"content\":\"She consoled herself with the fact that no one else had done well in the exam either.\"}],\"type\":\"gram\"},{\"content\":\"console yourself that\",\"examples\":[{\"content\":\"He consoled himself that he would see Kate again soon.\"}],\"type\":\"gram\"},{\"content\":\" a special cupboard for a television, computer etc\",\"kindId\":8,\"examples\":[]},{\"content\":\"(kiến trúc) rầm chìa\",\"kindId\":2,\"examples\":[]},{\"content\":\"an ủi, giải khuây\",\"kindId\":4,\"examples\":[]},{\"content\":\" a flat board that contains the controls for a machine, piece of electrical equipment, computer etc\",\"kindId\":8,\"examples\":[]}],\"description\":\"console\",\"meaningMap\":{},\"timeStamp\":1296033347489}','console','/kənˈsəʊl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/con/conso/console_01_00.mp3\', this)',1296033347489),
 (597,'{\"pron\":\"/dɔːnt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/d/dau/daunt/daunt.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to make someone feel afraid or less confident about something\",\"kindId\":9,\"examples\":[{\"content\":\"Don\\u0027\\u0027t be daunted by all the technology.\"},{\"content\":\"He felt utterly daunted by the prospect of moving to another country.\"}]},{\"content\":\"ấn (cá mòi) vào thùng\",\"kindId\":4,\"examples\":[]},{\"content\":\"đe doạ, doạ nạt, doạ dẫm; làm thoái chí, làm nản lòng; khuất phục\",\"kindId\":4,\"examples\":[{\"content\":\"torture can never daunt his spirit\"}]},{\"content\":\" used to say that someone continues or starts to do something in spite of difficulties\",\"kindId\":9,\"examples\":[{\"content\":\"It was steep but, nothing daunted, he started climbing.\"}]}],\"description\":\"daunt\",\"meaningMap\":{},\"timeStamp\":1296033353843}','daunt','/dɔːnt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/d/dau/daunt/daunt.mp3\', this)',1296033353843),
 (598,'{\"pron\":\"/ˈel.ɪ.gənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/ele/elega/elegant.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"người thanh lịch, người tao nhã\",\"kindId\":2,\"examples\":[]},{\"content\":\" an idea or a plan that is elegant is very intelligent yet simple\",\"kindId\":7,\"examples\":[{\"content\":\"an elegant solution to the problem\"}]},{\"content\":\"cùi lách hạng nhất, chiến, cừ\",\"kindId\":1,\"examples\":[]},{\"content\":\"thanh lịch, tao nhã (người, cách ăn mặc...); nhã (văn)\",\"kindId\":1,\"examples\":[]},{\"content\":\" beautiful, attractive, or graceful\",\"kindId\":7,\"examples\":[{\"content\":\"You can dine in elegant surroundings.\"},{\"content\":\"a tall, elegant young woman\"}]}],\"description\":\"elegant\",\"meaningMap\":{},\"timeStamp\":1296033359884}','elegant','/ˈel.ɪ.gənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/ele/elega/elegant.mp3\', this)',1296033359884),
 (599,'{\"pron\":\"/fɪˈdel.ə.ti/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71812.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"sự đúng đắn, sự chính xác\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"the movie\\u0027\\u0027s fidelity to the original book\"}],\"type\":\"gram\"},{\"content\":\"(kỹ thuật) độ tin; độ trung thực\",\"kindId\":2,\"examples\":[]},{\"content\":\"lòng trung thành; tính trung thực\",\"kindId\":2,\"examples\":[]},{\"content\":\" how much a film, a piece of written work etc remains unchanged from an earlier piece of work, or the facts that are known\",\"kindId\":8,\"examples\":[{\"content\":\"the movie\\u0027\\u0027s fidelity to the original book\"}]},{\"content\":\" when you are loyal to your husband, girlfriend etc, by not having sex with anyone else\",\"kindId\":8,\"examples\":[{\"content\":\"the importance of marital fidelity (\\u003din marriage)\"}]},{\"content\":\" when you are loyal to a person, an organization, or something that you believe in\",\"kindId\":8,\"examples\":[{\"content\":\"his fidelity to the company over 25 years\"}]},{\"examples\":[{\"content\":\"his fidelity to the company over 25 years\"}],\"type\":\"gram\"}],\"description\":\"fidelity\",\"meaningMap\":{},\"timeStamp\":1296033367590}','fidelity','/fɪˈdel.ə.ti/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71812.mp3\', this)',1296033367590),
 (600,'{\"pron\":\"/ˌhɒs.pɪˈtæl.ə.ti/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72258.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"lòng mến khách\",\"kindId\":2,\"examples\":[]},{\"content\":\" friendly behaviour towards visitors\",\"kindId\":8,\"examples\":[{\"content\":\"Thanks for your hospitality over the past few weeks.\"}]},{\"content\":\" services such as food and drink that an organization provides for guests at a special event\",\"kindId\":8,\"examples\":[{\"content\":\"the use of a yacht for corporate hospitality\"},{\"content\":\"There was a reception in the hospitality suite before the game.\"}]}],\"description\":\"hospitality\",\"meaningMap\":{},\"timeStamp\":1296033373723}','hospitality','/ˌhɒs.pɪˈtæl.ə.ti/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72258.mp3\', this)',1296033373723),
 (601,'{\"pron\":\"/ˈdʒʌŋk.ʃən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/j/jun/junct/junction.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(ngành đường sắt) ga đầu mối (nơi các đường xe lửa gặp nhau)\",\"kindId\":2,\"examples\":[]},{\"content\":\" a place where one road, track etc joins another\",\"kindId\":8,\"examples\":[{\"content\":\"the junction of Abbot Road and Mill Street\"},{\"content\":\"Junction 5 on the M40\"}]},{\"content\":\"mối nối, chỗ nối; chỗ gặp nhau (của các con đường...)\",\"kindId\":2,\"examples\":[]},{\"content\":\"sự nối liền, sự gặp nhau\",\"kindId\":2,\"examples\":[]}],\"description\":\"junction\",\"meaningMap\":{},\"timeStamp\":1296033379840}','junction','/ˈdʒʌŋk.ʃən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/j/jun/junct/junction.mp3\', this)',1296033379840),
 (602,'{\"pron\":\"/kiːn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/k/kee/keen_/keen.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"keen on doing something\",\"examples\":[{\"content\":\"I wasn\\u0027\\u0027t keen on going there on my own.\"}],\"type\":\"gram\"},{\"content\":\" to like someone or something\",\"kindId\":7,\"examples\":[{\"content\":\"My flatmates want to have a party, but I\\u0027\\u0027m not keen on the idea.\"},{\"content\":\"She likes Biology, but she\\u0027\\u0027s not too keen on Physics.\"},{\"content\":\"I\\u0027\\u0027m not keen on cabbage.\"}]},{\"examples\":[{\"content\":\"Daniel\\u0027\\u0027s very keen on tennis.\"}],\"type\":\"gram\"},{\"content\":\"rét buốt, buốt thấu xương\",\"kindId\":1,\"examples\":[{\"content\":\"keen wind\"}]},{\"content\":\"not too/not very/not that keen on something\",\"examples\":[{\"content\":\"She likes Biology, but she\\u0027\\u0027s not too keen on Physics.\"}],\"type\":\"collo\"},{\"content\":\" someone who is keen on something is very interested in it or enjoys doing it very much\",\"kindId\":7,\"examples\":[{\"content\":\"a keen photographer\"},{\"content\":\"Daniel\\u0027\\u0027s very keen on tennis.\"},{\"content\":\"I was mad keen on dinosaurs when I was little.\"},{\"content\":\"She takes a keen interest in politics and current affairs.\"},{\"content\":\"keen golfers\"}]},{\"content\":\" a keen sense of smell or keen sight or hearing is an extremely good ability to smell etc\",\"kindId\":7,\"examples\":[{\"content\":\"Dogs have a very keen sense of smell.\"},{\"content\":\"She has a keen eye for (\\u003dis good at noticing) talent.\"}]},{\"content\":\"hát bài hát tang\",\"kindId\":3,\"examples\":[]},{\"content\":\"than van ai oán, than khóc thảm thiết\",\"kindId\":3,\"examples\":[]},{\"content\":\"keen for something to happen\",\"examples\":[{\"content\":\"The government is keen for peace talks to start again.\"}],\"type\":\"gram\"},{\"conten