 a keen knife or blade is extremely sharp\",\"kindId\":7,\"examples\":[]},{\"content\":\" to be sexually attracted to someone\",\"kindId\":7,\"examples\":[]},{\"content\":\"(từ Mỹ,nghĩa Mỹ),  (từ lóng) tuyệt diệu, cừ khôi, xuất sắc\",\"kindId\":1,\"examples\":[]},{\"content\":\"buốt, nhói, dữ dội, thấm thía\",\"kindId\":1,\"examples\":[{\"content\":\"keen hunger\"},{\"content\":\"keen sorrow\"}]},{\"content\":\"trong và cao (tiếng...)\",\"kindId\":1,\"examples\":[]},{\"content\":\" used to describe a situation in which people compete strongly\",\"kindId\":7,\"examples\":[{\"content\":\"We won the contest in the face of keen competition.\"}]},{\"content\":\"mãnh liệt, thiết tha, kịch liệt; hăng hái, sôi nổi, nhiệt tình\",\"kindId\":1,\"examples\":[{\"content\":\"keen desire\"},{\"content\":\"a keen debate\"},{\"content\":\"a keen sportsman\"}]},{\"content\":\"hát bài hát tang mà than khóc (ai)\",\"kindId\":4,\"examples\":[]},{\"content\":\"sắc, bén (dao); nhọn (kim)\",\"kindId\":1,\"examples\":[]},{\"content\":\"bài hát tang (kèm theo tiếng than khóc ở Ai-len)\",\"kindId\":2,\"examples\":[]},{\"content\":\"ham mê, say mê, ham thích\",\"kindId\":1,\"examples\":[{\"content\":\"to be keen about\"},{\"content\":\"to be [dead] keen on something\"},{\"content\":\"to be [dead] keen on somebody\"}]},{\"content\":\" a keen wind is cold and strong\",\"kindId\":7,\"examples\":[]}],\"description\":\"keen\",\"meaningMap\":{},\"timeStamp\":1296033391673}','keen','/kiːn/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/k/kee/keen_/keen.mp3\', this)',1296033391673),
