 (607,'{\"pron\":\"/ˈpɒn.dər/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/p/pon/ponde/ponder.mp3\\u0027, this)\",\"meanings\":[{\"examples\":[{\"content\":\"The university board is still pondering over the matter.\"}],\"type\":\"gram\"},{\"content\":\"ponder how/what/whether\",\"examples\":[{\"content\":\"Jay stood still for a moment, pondering whether to go or not.\"}],\"type\":\"gram\"},{\"content\":\" to spend time thinking carefully and seriously about a problem, a difficult question, or something that has happened\",\"kindId\":9,\"examples\":[{\"content\":\"The university board is still pondering over the matter.\"},{\"content\":\"Jay stood still for a moment, pondering whether to go or not.\"},{\"content\":\"He continued to ponder the problem as he walked home.\"}]},{\"content\":\"((thường) + on,  upon,  over) suy nghĩ; cân nhắc\",\"kindId\":0,\"examples\":[{\"content\":\"to ponder [on] a question\"}]}],\"description\":\"ponder\",\"meaningMap\":{},\"timeStamp\":1296033423238}','ponder','/ˈpɒn.dər/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/p/pon/ponde/ponder.mp3\', this)',1296033423238),
 (608,'{\"pron\":\"/ˌkwɪn.tɪˈsent .ʃəl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usz/uszzz/uszzzzd098.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" being a perfect example of a particular type of person or thing\",\"kindId\":7,\"examples\":[{\"content\":\"\\u0027\\u0027Guys and Dolls\\u0027\\u0027 is the quintessential American musical.\"}]},{\"content\":\"(thuộc) phần tinh chất, (thuộc) phần tinh tuý, (thuộc) phần tinh hoa\",\"kindId\":1,\"examples\":[]},{\"content\":\"(triết học) (thuộc) nguyên tố thứ năm\",\"kindId\":1,\"examples\":[]}],\"description\":\"quintessential\",\"meaningMap\":{},\"timeStamp\":1296033429270}','quintessential','/ˌkwɪn.tɪˈsent .ʃəl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usz/uszzz/uszzzzd098.mp3\', this)',1296033429270),
 (609,'{\"pron\":\"/rɪˈzɔːt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/res/resor/resort.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"dùng đến, cầu đến, nhớ vào\",\"kindId\":3,\"examples\":[{\"content\":\"to resort to revolutionary violence\"}]},{\"content\":\" a place where a lot of people go for holidays\",\"kindId\":8,\"examples\":[{\"content\":\"Lagoon Reef is one of the best resort hotels.\"},{\"content\":\"Aspen, a ski resort in Colorado\"}]},{\"content\":\"nơi có đông người lui tới\",\"kindId\":2,\"examples\":[{\"content\":\"seaside resort\"}]},{\"content\":\" to do something bad, extreme, or difficult because you cannot think of any other way to deal with a problem\",\"kindId\":9,\"examples\":[{\"content\":\"Officials fear that extremists may resort to violence.\"},{\"content\":\"Vets have had to resort to killing the animals.\"}]},{\"content\":\"seaside/beach/ski etc resort\",\"examples\":[{\"content\":\"Aspen, a ski resort in Colorado\"}],\"type\":\"collo\"},{\"content\":\"in the last resort\",\"examples\":[{\"content\":\"Economic sanctions will be used only in the last resort.\"}],\"type\":\"gram\"},{\"content\":\"resort to doing something\",\"examples\":[{\"content\":\"Vets have had to resort to killing the animals.\"}],\"type\":\"gram\"},{\"content\":\"cái dùng đến, phương kế, phương sách\",\"kindId\":2,\"examples\":[{\"content\":\"this is to be done without resort to force\"},{\"content\":\"in the last resort\"}]},{\"content\":\" what you will do if everything else fails\",\"kindId\":8,\"examples\":[{\"content\":\"Drug treatment should only be used as a last resort.\"},{\"content\":\"Economic sanctions will be used only in the last resort.\"},{\"content\":\"a weapon of last resort\"}]},{\"content\":\"without resort to something\",\"examples\":[{\"content\":\"We hope they will be able to resolve the situation without resort to force.\"}],\"type\":\"gram\"},{\"content\":\"thường xuyên lui tới (nơi nào)\",\"kindId\":3,\"examples\":[{\"content\":\"to resort to the nountain\"}]},{\"content\":\"as a last resort\",\"examples\":[{\"content\":\"Drug treatment should only be used as a last resort.\"}],\"type\":\"gram\"},{\"content\":\"of last resort\",\"examples\":[{\"content\":\"a weapon of last resort\"}],\"type\":\"gram\"},{\"content\":\" what you will do first before you try other things\",\"kindId\":8,\"examples\":[{\"content\":\"In the past, your family was the first resort when looking for a job.\"}]},{\"content\":\" when you must use or depend on something because nothing better is available\",\"kindId\":8,\"examples\":[{\"content\":\"We hope they will be able to resolve the situation without resort to force.\"}]}],\"description\":\"resort\",\"meaningMap\":{},\"timeStamp\":1296033441443}','resort','/rɪˈzɔːt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/res/resor/resort.mp3\', this)',1296033441443),
