 (611,'{\"pron\":\"/ˈtæn.dʒə.bl ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/tan/tangi/tangible.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" property such as buildings, equipment etc\",\"kindId\":7,\"examples\":[]},{\"content\":\"có thể sờ mó được, hữu hình\",\"kindId\":1,\"examples\":[{\"content\":\"tangible world\"}]},{\"content\":\"đích xác, xác thực, hiển nhiên, rõ ràng, không thể nghi ngờ được\",\"kindId\":1,\"examples\":[{\"content\":\"tangible proofs\"}]},{\"content\":\"tangible evidence/proof\",\"examples\":[{\"content\":\"He has no tangible evidence of John\\u0027\\u0027s guilt.\"}],\"type\":\"collo\"},{\"content\":\" clear enough or definite enough to be easily seen or noticed\",\"kindId\":7,\"examples\":[{\"content\":\"The scheme must have tangible benefits for the unemployed.\"},{\"content\":\"He has no tangible evidence of John\\u0027\\u0027s guilt.\"}]},{\"content\":\" if something is tangible, you can touch or feel it\",\"kindId\":7,\"examples\":[{\"content\":\"The silence of the countryside was almost tangible.\"}]}],\"description\":\"tangible\",\"meaningMap\":{},\"timeStamp\":1296033455183}','tangible','/ˈtæn.dʒə.bl ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/tan/tangi/tangible.mp3\', this)',1296033455183),
 (612,'{\"pron\":\"/ˈvæn.ɪʃ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/van/vanis/vanish.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"biến mất, lẩn mất, biến dần, tiêu tan ((nghĩa đen) \\u0026amp; (nghĩa bóng))\",\"kindId\":3,\"examples\":[{\"content\":\"to vanish from sight\"},{\"content\":\"to vanish in the crowd\"},{\"content\":\"hopes vanished like a bubble\"}]},{\"examples\":[{\"content\":\"By the 1930s, the wolf had vanished from the American West.\"}],\"type\":\"gram\"},{\"content\":\"(toán học) triệt tiêu; biến mất\",\"kindId\":3,\"examples\":[]},{\"content\":\"vanish without (a) trace/vanish off the face of the earth\",\"examples\":[{\"content\":\"The youngster vanished without a trace one day and has never been found.\"}],\"type\":\"collo\"},{\"content\":\" to disappear suddenly, especially in a way that cannot be easily explained\",\"kindId\":9,\"examples\":[{\"content\":\"The bird vanished from sight.\"},{\"content\":\"She seemed to have just vanished into thin air. (\\u003dsuddenly disappeared in a very mysterious way)\"},{\"content\":\"The youngster vanished without a trace one day and has never been found.\"},{\"content\":\"My keys were here a minute ago but now they\\u0027\\u0027ve vanished.\"}]},{\"content\":\"(ngôn ngữ học) âm lướt\",\"kindId\":2,\"examples\":[]},{\"content\":\" to suddenly stop existing\",\"kindId\":9,\"examples\":[{\"content\":\"Public support for the Prime Minister has now vanished.\"},{\"content\":\"By the 1930s, the wolf had vanished from the American West.\"}]}],\"description\":\"vanish\",\"meaningMap\":{},\"timeStamp\":1296033471604}','vanish','/ˈvæn.ɪʃ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/van/vanis/vanish.mp3\', this)',1296033471604),
