 (615,'{\"pron\":\"/bɪˈset/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/b/bes/beset/beset.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[usually passive] to make someone experience serious problems or dangers\",\"kindId\":9,\"examples\":[{\"content\":\"The business has been beset with financial problems.\"},{\"content\":\"the injuries which have beset the team all season\"}]},{\"content\":\" a particular bad feature or habit - often used humorously\",\"kindId\":9,\"examples\":[]},{\"content\":\"choán, ngáng (đường đi)\",\"examples\":[{\"content\":\"a path beset with obstacles\"}]},{\"content\":\"bao vây, vây quanh (nghĩa đen) \\u0026amp; (nghĩa bóng)\",\"examples\":[{\"content\":\"to be beset with foes on every side\"},{\"content\":\"to be beset with cares\"}]},{\"content\":\"beset somebody with/by something\",\"examples\":[{\"content\":\"The business has been beset with financial problems.\"}],\"type\":\"gram\"}],\"description\":\"beset\",\"meaningMap\":{},\"timeStamp\":1296033492822}','beset','/bɪˈset/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/b/bes/beset/beset.mp3\', this)',1296033492822),
 (616,'{\"pron\":\"/kəmˈplaɪ.ənt s/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/com/compl/compliance.mp3\\u0027, this)\",\"meanings\":[{\"examples\":[{\"content\":\"Patients should have a history of good compliance with treatment.\"}],\"type\":\"gram\"},{\"content\":\"ensure/secure/enforce compliance\",\"examples\":[{\"content\":\"The staff involved should be monitored to ensure compliance with the policy.\"}],\"type\":\"collo\"},{\"content\":\"sự phục tùng đê tiện, sự khúm núm\",\"kindId\":2,\"examples\":[]},{\"content\":\"sự bằng lòng, sự ưng thuận, sự chiều theo, sự làm đúng theo (một yêu cầu, một lệnh...)\",\"kindId\":2,\"examples\":[{\"content\":\"it was done in compliance with your wish\"}]},{\"content\":\" when someone obeys a rule, agreement, or demand\",\"kindId\":8,\"examples\":[{\"content\":\"Patients should have a history of good compliance with treatment.\"},{\"content\":\"The staff involved should be monitored to ensure compliance with the policy.\"},{\"content\":\"He changed his name to Lee in 1815 in compliance with his uncle\\u0027\\u0027s will.\"}]},{\"content\":\"in compliance with something\",\"examples\":[{\"content\":\"He changed his name to Lee in 1815 in compliance with his uncle\\u0027\\u0027s will.\"}],\"type\":\"gram\"}],\"description\":\"compliance\",\"meaningMap\":{},\"timeStamp\":1296033499014}','compliance','/kəmˈplaɪ.ənt s/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/com/compl/compliance.mp3\', this)',1296033499014),
 (617,'{\"pron\":\"/dɪˈnɒm.ɪ.neɪ.tər /\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75576.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(toán học) mẫu số; mẫu thức\",\"kindId\":2,\"examples\":[]},{\"content\":\" the number below the line in a fraction\",\"kindId\":8,\"examples\":[]}],\"description\":\"denominator\",\"meaningMap\":{},\"timeStamp\":1296033507543}','denominator','/dɪˈnɒm.ɪ.neɪ.tər /','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75576.mp3\', this)',1296033507543),
 (618,'{\"pron\":\"/ɪkˈstæt.ɪk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71432.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a review (\\u003dan opinion about a film, play etc that appears in a newspaper or magazine), praise etc that say that something is very good\",\"kindId\":7,\"examples\":[{\"content\":\"The exhibition attracted thousands of visitors and ecstatic reviews.\"}]},{\"content\":\"ở trạng thái mê ly; làm mê ly; dễ bị làm mê ly\",\"kindId\":1,\"examples\":[]},{\"content\":\"ngây ngất\",\"kindId\":1,\"examples\":[]},{\"content\":\"người dễ bị làm mê ly\",\"kindId\":2,\"examples\":[]},{\"content\":\"người xuất thần, người nhập định\",\"kindId\":2,\"examples\":[]},{\"content\":\"xuất thần, nhập định; dễ xuất thần\",\"kindId\":1,\"examples\":[]},{\"content\":\" feeling extremely happy and excited\",\"kindId\":7,\"examples\":[{\"content\":\"an ecstatic welcome from the thousands who lined the streets\"}]}],\"description\":\"ecstatic\",\"meaningMap\":{},\"timeStamp\":1296033513333}','ecstatic','/ɪkˈstæt.ɪk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71432.mp3\', this)',1296033513333);
INSERT INTO `word` (`wordId`,`content`,`description`,`pron`,`soundSource`,`timestamp`) VALUES 
 (619,'{\"pron\":\"/ˈfem.ɪ.nɪn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fem/femin/feminine.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(ngôn ngữ học) (thuộc) giống cái\",\"kindId\":1,\"examples\":[{\"content\":\"a feminine noun\"}]},{\"content\":\"(thuộc) đàn bà, như đàn bà; yểu điệu dịu dàng (như đàn bà)\",\"kindId\":1,\"examples\":[]},{\"content\":\" having qualities that are considered to be typical of women, especially by being gentle, delicate, and pretty\",\"kindId\":7,\"examples\":[{\"content\":\"Dianne loved pretty feminine things.\"}]},{\"content\":\" relating to being female\",\"kindId\":7,\"examples\":[{\"content\":\"Amelia\\u0027\\u0027s report describes the experience from a feminine point of view.\"},{\"content\":\"traditional feminine roles\"}]},{\"content\":\" a feminine noun, pronoun etc belongs to a class of words that have different inflections from masculine or neuter words\",\"kindId\":7,\"examples\":[]},{\"content\":\"(từ hiếm,nghĩa hiếm) cái, mái\",\"kindId\":1,\"examples\":[]}],\"description\":\"feminine\",\"meaningMap\":{},\"timeStamp\":1296033520271}','feminine','/ˈfem.ɪ.nɪn/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fem/femin/feminine.mp3\', this)',1296033520271),
 (620,'{\"pron\":\"/hʌnt ʃ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/hun/hunch/hunch.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" if you have a hunch that something is true or will happen, you feel that it is true or will happen\",\"kindId\":8,\"examples\":[{\"content\":\"I had a hunch that something like this would happen.\"},{\"content\":\"My hunch is that she\\u0027\\u0027s his mother.\"}]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) linh cảm\",\"kindId\":2,\"examples\":[{\"content\":\"to have a hunch that\"}]},{\"content\":\"miếng to, khúc to, khoanh to (bánh mì, bánh ngọt)\",\"kindId\":2,\"examples\":[]},{\"content\":\"have a hunch (that)\",\"examples\":[{\"content\":\"I had a hunch that something like this would happen.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"He had to hunch over the steering wheel to see anything.\"}],\"type\":\"gram\"},{\"content\":\"[intransitive always + adverb/preposition] to bend down and forwards so that your back forms a curve\",\"kindId\":9,\"examples\":[{\"content\":\"He had to hunch over the steering wheel to see anything.\"}]},{\"content\":\"khom xuống, gập cong, uốn cong\",\"kindId\":4,\"examples\":[]},{\"content\":\"somebody\\u0027\\u0027\\u0027\\u0027s hunch\",\"examples\":[{\"content\":\"My hunch is that she\\u0027\\u0027s his mother.\"}],\"type\":\"gram\"},{\"content\":\" to raise your shoulders into a rounded shape because you are cold, anxious etc\",\"kindId\":9,\"examples\":[]},{\"content\":\"cái bướu\",\"kindId\":2,\"examples\":[]}],\"description\":\"hunch\",\"meaningMap\":{},\"timeStamp\":1296033533148}','hunch','/hʌnt ʃ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/hun/hunch/hunch.mp3\', this)',1296033533148),
 (621,'{\"pron\":\"/ˈɪn.ə.sənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/i/inn/innoc/innocent.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" not guilty of a crime\",\"kindId\":7,\"examples\":[{\"content\":\"The court found him innocent and he was released.\"},{\"content\":\"Nobody would believe that I was innocent.\"},{\"content\":\"He\\u0027\\u0027s innocent of murder.\"}]},{\"content\":\"vô tội; không có tội\",\"kindId\":1,\"examples\":[]},{\"content\":\"đứa bé ngây thơ\",\"kindId\":2,\"examples\":[]},{\"content\":\"ngây thơ\",\"kindId\":1,\"examples\":[]},{\"content\":\"không có hại, không hại\",\"kindId\":1,\"examples\":[]},{\"content\":\" people who get hurt or killed in a war or crime although they are not directly involved in it\",\"kindId\":7,\"examples\":[{\"content\":\"Many innocent civilians are among the casualties.\"}]},{\"examples\":[{\"content\":\"He\\u0027\\u0027s innocent of murder.\"}],\"type\":\"gram\"},{\"content\":\"thằng ngốc, thằng bé ngớ ngẩn\",\"kindId\":2,\"examples\":[]},{\"content\":\" done or said without intending to harm or offend anyone\",\"kindId\":7,\"examples\":[{\"content\":\"He was startled by their angry reaction to his innocent remark.\"}]},{\"content\":\" not having much experience of the bad things in the world, so that you are easily deceived\",\"kindId\":7,\"examples\":[{\"content\":\"I was thirteen years old and very innocent.\"}]},{\"content\":\" someone who does not have much experience of the bad things in life\",\"kindId\":8,\"examples\":[]},{\"content\":\"người vô tội; người không có tội\",\"kindId\":2,\"examples\":[]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) còn trong trắng; còn trinh\",\"kindId\":1,\"examples\":[]}],\"description\":\"innocent\",\"meaningMap\":{},\"timeStamp\":1296033544268}','innocent','/ˈɪn.ə.sənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/i/inn/innoc/innocent.mp3\', this)',1296033544268),
 (622,'{\"pron\":\"/ˈdʒʊə.ri/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/j/jur/jury_/jury.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a group of people chosen to judge a competition\",\"kindId\":8,\"examples\":[]},{\"content\":\"(pháp lý) ban hội thẩm, ban bồi thẩm\",\"kindId\":2,\"examples\":[{\"content\":\"to sit (serve) on a jury\"}]},{\"content\":\" a group of 12 ordinary people who listen to the details of a case in court and decide whether someone is guilty or not\",\"kindId\":8,\"examples\":[{\"content\":\"The jury found him not guilty.\"},{\"content\":\"the right to trial by jury\"},{\"content\":\"the members of the jury\"}]},{\"content\":\" used to say that something has not been finally decided\",\"kindId\":8,\"examples\":[{\"content\":\"Is it good value? The jury is still out on that.\"}]},{\"content\":\"sit/serve on a jury\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"ban giám khảo\",\"kindId\":2,\"examples\":[]}],\"description\":\"jury\",\"meaningMap\":{},\"timeStamp\":1296033551347}','jury','/ˈdʒʊə.ri/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/j/jur/jury_/jury.mp3\', this)',1296033551347),
 (623,'{\"pron\":\"/ˈket.l ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72674.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a large pot, used for making soup\",\"kindId\":8,\"examples\":[]},{\"content\":\"ấm đun nước\",\"kindId\":2,\"examples\":[]},{\"content\":\" a container with a lid, a handle, and a spout, used for boiling and pouring water\",\"kindId\":8,\"examples\":[{\"content\":\"She filled the kettle and switched it on.\"},{\"content\":\"The kettle\\u0027\\u0027s boiling (\\u003dthe water in it is boiling).\"},{\"content\":\"Put the kettle on (\\u003dstart boiling water in a kettle) will you?\"}]},{\"content\":\" used to say that a situation is very different from one that you have just mentioned\",\"kindId\":8,\"examples\":[{\"content\":\"She enjoys public speaking but being on TV is a different kettle of fish.\"}]}],\"description\":\"kettle\",\"meaningMap\":{},\"timeStamp\":1296033559393}','kettle','/ˈket.l ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72674.mp3\', this)',1296033559393),
 (624,'{\"pron\":\"/liːtʃ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lee/leech/leech.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"cạnh buồm, mép buồm\",\"kindId\":2,\"examples\":[]},{\"content\":\"cho đỉa hút máu\",\"kindId\":4,\"examples\":[]},{\"content\":\"(từ cổ,nghĩa cổ) thầy thuốc, thầy lang\",\"kindId\":2,\"examples\":[]},{\"content\":\" a small soft creature that fixes itself to the skin of animals in order to drink their blood\",\"kindId\":8,\"examples\":[]},{\"content\":\"con đỉa\",\"kindId\":2,\"examples\":[{\"content\":\"to stick like a leech\"}]},{\"content\":\"(nghĩa bóng) kẻ bóc lột, kẻ hút máu\",\"kindId\":2,\"examples\":[]},{\"content\":\" someone who takes advantage of other people by taking their money, food etc\",\"kindId\":8,\"examples\":[{\"content\":\"The family began to see him as a leech.\"}]}],\"description\":\"leech\",\"meaningMap\":{},\"timeStamp\":1296033566060}','leech','/liːtʃ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lee/leech/leech.mp3\', this)',1296033566060),
 (625,'{\"pron\":\"/ˈmɪt.ɪ.geɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/mit/mitig/mitigate.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"giảm nhẹ, làm dịu bớt, làm cho đỡ\",\"kindId\":4,\"examples\":[{\"content\":\"to mitigate one\\u0027\\u0027s anger\"},{\"content\":\"to mitigate a punishment\"}]},{\"content\":\" to make a situation or the effects of something less unpleasant, harmful, or serious\",\"kindId\":9,\"examples\":[{\"content\":\"Measures need to be taken to mitigate the environmental effects of burning more coal.\"}]}],\"description\":\"mitigate\",\"meaningMap\":{},\"timeStamp\":1296033571988}','mitigate','/ˈmɪt.ɪ.geɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/mit/mitig/mitigate.mp3\', this)',1296033571988),
 (626,'{\"pron\":\"/nəˈreɪ.tər/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73160.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"người chuyện kể, người tường thuật\",\"kindId\":2,\"examples\":[]},{\"content\":\" the person who tells the story in a book or a play\",\"kindId\":8,\"examples\":[]},{\"content\":\" the person who describes or explains what is happening in a film or television programme but who is not seen\",\"kindId\":8,\"examples\":[]}],\"description\":\"narrator\",\"meaningMap\":{},\"timeStamp\":1296033577975}','narrator','/nəˈreɪ.tər/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73160.mp3\', this)',1296033577975),
 (627,'{\"pron\":\"/əbˈstrʌk.tɪv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/uso/usobs/usobser012.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" relating to a blocked tube, passage etc in the body\",\"kindId\":7,\"examples\":[{\"content\":\"obstructive symptoms\"}]},{\"content\":\" trying to prevent someone from doing something, by deliberately making it difficult for them\",\"kindId\":7,\"examples\":[{\"content\":\"an obstructive official\"},{\"content\":\"obstructive tactics\"}]},{\"content\":\"(như) obstructionist\",\"kindId\":2,\"examples\":[]},{\"content\":\"người gây bế tắc, người cản trở\",\"kindId\":2,\"examples\":[]},{\"content\":\"làm tắc, làm bế tắc, làm nghẽn\",\"kindId\":1,\"examples\":[]},{\"content\":\"cản trở, gây trở ngại\",\"kindId\":1,\"examples\":[]}],\"description\":\"obstructive\",\"meaningMap\":{},\"timeStamp\":1296033585393}','obstructive','/əbˈstrʌk.tɪv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/uso/usobs/usobser012.mp3\', this)',1296033585393),
 (628,'{\"pron\":\"/ˌprɒd.ʌkˈtɪv.ɪ.ti/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73728.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" the rate at which goods are produced, and the amount produced, especially in relation to the work, time, and money needed to produce them\",\"kindId\":8,\"examples\":[{\"content\":\"It cost the country $4 million in lost productivity.\"},{\"content\":\"high productivity levels in manufacturing\"},{\"content\":\"ways of increasing productivity\"}]},{\"content\":\"sức sản xuất; năng suất, hiệu suất\",\"kindId\":2,\"examples\":[{\"content\":\"labour productiveness\"}]},{\"content\":\"increase/improve/raise productivity\",\"examples\":[{\"content\":\"ways of increasing productivity\"}],\"type\":\"collo\"}],\"description\":\"productivity\",\"meaningMap\":{},\"timeStamp\":1296033592352}','productivity','/ˌprɒd.ʌkˈtɪv.ɪ.ti/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73728.mp3\', this)',1296033592352),
 (629,'{\"pron\":\"/ˈrɪg.ər.əs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/rig/rigor/rigorous.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"khắc khổ (đời sống)\",\"kindId\":1,\"examples\":[]},{\"content\":\" careful, thorough, and exact\",\"kindId\":7,\"examples\":[{\"content\":\"a rigorous analysis of defence needs\"},{\"content\":\"the rigorous standards required by the college\"}]},{\"content\":\"chính xác\",\"kindId\":1,\"examples\":[{\"content\":\"rigorous scientific method\"}]},{\"content\":\" very severe or strict\",\"kindId\":7,\"examples\":[{\"content\":\"rigorous army training\"}]},{\"content\":\"nghiêm khắc, khắt khe, chặt chẽ, nghiêm ngặt\",\"kindId\":1,\"examples\":[]},{\"content\":\"khắc nghiệt (thời tiết, khí hậu)\",\"kindId\":1,\"examples\":[{\"content\":\"rigorous climate\"}]}],\"description\":\"rigorous\",\"meaningMap\":{},\"timeStamp\":1296033599366}','rigorous','/ˈrɪg.ər.əs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/rig/rigor/rigorous.mp3\', this)',1296033599366),
 (630,'{\"pron\":\"/straɪv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/s/str/striv/strive.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"đấu tranh\",\"kindId\":3,\"examples\":[{\"content\":\"to strive with (against) something\"},{\"content\":\"to strive together; to strive with each other\"}]},{\"content\":\" to make a great effort to achieve something\",\"kindId\":9,\"examples\":[{\"content\":\"I was still striving to be successful.\"},{\"content\":\"We must continue to strive for greater efficiency.\"}]},{\"content\":\"cố gắng, phấn đấu\",\"kindId\":3,\"examples\":[{\"content\":\"to strive for (after) something\"}]},{\"content\":\"strive to do something\",\"examples\":[{\"content\":\"I was still striving to be successful.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"We must continue to strive for greater efficiency.\"}],\"type\":\"gram\"}],\"description\":\"strive\",\"meaningMap\":{},\"timeStamp\":1296033605194}','strive','/straɪv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/s/str/striv/strive.mp3\', this)',1296033605194),
 (631,'{\"pron\":\"/ˈtemp.tɪŋ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/tem/tempt/tempting.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"be tempting to do something\",\"examples\":[{\"content\":\"It\\u0027\\u0027s tempting to believe her story.\"}],\"type\":\"gram\"},{\"content\":\"xúi giục\",\"kindId\":1,\"examples\":[]},{\"content\":\"cám dỗ, lôi cuốn, khêu gợi, gây thèm\",\"kindId\":1,\"examples\":[]},{\"content\":\" something that is tempting seems very good and you would like to have it or do it\",\"kindId\":7,\"examples\":[{\"content\":\"a tempting job offer\"},{\"content\":\"That pie looks tempting.\"},{\"content\":\"It\\u0027\\u0027s tempting to believe her story.\"}]}],\"description\":\"tempting\",\"meaningMap\":{},\"timeStamp\":1296033611375}','tempting','/ˈtemp.tɪŋ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/tem/tempt/tempting.mp3\', this)',1296033611375),
 (632,'{\"pron\":\"/ˈvɒl.ə.taɪl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74891.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a volatile liquid or substance changes easily into a gas\",\"kindId\":7,\"examples\":[]},{\"content\":\" a volatile situation is likely to change suddenly and without warning\",\"kindId\":7,\"examples\":[{\"content\":\"an increasingly volatile political situation\"},{\"content\":\"the highly volatile stock and bond markets\"}]},{\"content\":\"(hoá học) dễ bay hơi\",\"kindId\":1,\"examples\":[{\"content\":\"volatile substance\"}]},{\"content\":\"không kiên định, hay thay đổi; nhẹ dạ\",\"kindId\":1,\"examples\":[{\"content\":\"of a volatile character\"}]},{\"content\":\" someone who is volatile can suddenly become angry or violent\",\"kindId\":7,\"examples\":[]},{\"content\":\"vui vẻ, hoạt bát\",\"kindId\":1,\"examples\":[]}],\"description\":\"volatile\",\"meaningMap\":{},\"timeStamp\":1296033627159}','volatile','/ˈvɒl.ə.taɪl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74891.mp3\', this)',1296033627159),
 (633,'{\"pron\":\"/ˈwɒn.tən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/w/wan/wanto/wanton.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(thông tục) lố lăng, loạn\",\"kindId\":1,\"examples\":[{\"content\":\"wanton dress\"}]},{\"content\":\"tốt tươi, sum sê, um tùm\",\"kindId\":1,\"examples\":[{\"content\":\"wanton vegetation\"}]},{\"content\":\" uncontrolled\",\"kindId\":7,\"examples\":[{\"content\":\"wanton growth\"}]},{\"content\":\" a wanton woman is considered immoral because she has sex with a lot of men\",\"kindId\":7,\"examples\":[]},{\"content\":\"lung tung, bậy bạ, bừa bãi; vô cớ, không mục đích\",\"kindId\":1,\"examples\":[{\"content\":\"wanton slaughter\"},{\"content\":\"wanton insult\"}]},{\"content\":\"phóng đãng, dâm đãng, dâm ô, bất chính\",\"kindId\":1,\"examples\":[{\"content\":\"wanton thoughts\"},{\"content\":\"a wanton woman\"},{\"content\":\"wanton love\"}]},{\"content\":\"nô đùa, đùa giỡn\",\"kindId\":3,\"examples\":[{\"content\":\"the wind is wantoning with the leaves\"}]},{\"content\":\" deliberately harming someone or damaging something for no reason\",\"kindId\":7,\"examples\":[{\"content\":\"an act of wanton aggression\"},{\"content\":\"a wanton disregard for life\"}]},{\"content\":\"tinh nghịch, nghịch gợm; đùa giỡn\",\"kindId\":1,\"examples\":[{\"content\":\"a wanton child\"},{\"content\":\"wanton breeze\"}]},{\"content\":\"người đàn bà dâm đãng\",\"kindId\":2,\"examples\":[]}],\"description\":\"wanton\",\"meaningMap\":{},\"timeStamp\":1296033634268}','wanton','/ˈwɒn.tən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/w/wan/wanto/wanton.mp3\', this)',1296033634268),
 (634,'{\"pron\":\"/əˈmɔː.fəs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/amo/amorp/amorphous.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(khoáng chất) không kết tinh\",\"kindId\":1,\"examples\":[]},{\"content\":\" having no definite shape or features\",\"kindId\":7,\"examples\":[{\"content\":\"an amorphous mass of twisted metal\"}]},{\"content\":\"tính không có hình dạng nhất định, tính vô định hình\",\"kindId\":1,\"examples\":[]}],\"description\":\"amorphous\",\"meaningMap\":{},\"timeStamp\":1296033640744}','amorphous','/əˈmɔː.fəs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/amo/amorp/amorphous.mp3\', this)',1296033640744),
 (635,'{\"pron\":\"/ˈkrɪs.ən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/chr/chris/christen.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to use something for the first time\",\"kindId\":9,\"examples\":[{\"content\":\"We haven\\u0027\\u0027t christened the new garden chairs yet.\"}]},{\"content\":\" to give something or someone a name\",\"kindId\":9,\"examples\":[{\"content\":\"The new plane has been christened the Hawk.\"},{\"content\":\"His fans christened him the king of rock.\"}]},{\"content\":\"đặt tên thánh (trong lễ rửa tội)\",\"kindId\":4,\"examples\":[{\"content\":\"the child was christened Mary\"}]},{\"content\":\" to officially give a child its name at a Christian religious ceremony\",\"kindId\":9,\"examples\":[{\"content\":\"She was christened Sarah.\"}]},{\"content\":\"rửa tội; làm lễ rửa tội\",\"kindId\":4,\"examples\":[]}],\"description\":\"christen\",\"meaningMap\":{},\"timeStamp\":1296033656760}','christen','/ˈkrɪs.ən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/chr/chris/christen.mp3\', this)',1296033656760),
 (636,'{\"pron\":\"/ɪˈlæb.ər.ət/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/ela/elabo/elaborate_01_00.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"nói thêm, cho thêm chi tiết\",\"kindId\":3,\"examples\":[{\"content\":\"to on a problem\"}]},{\"content\":\"trở thành tỉ mỉ; trở thành tinh vi\",\"kindId\":3,\"examples\":[]},{\"content\":\"thảo tỉ mỉ, thảo kỹ lưỡng, sửa soạn công phu; làm công phu, trau chuốt (văn); dựng lên\",\"kindId\":4,\"examples\":[{\"content\":\"to elaborate a theory\"}]},{\"content\":\"[intransitive and transitive] to give more details or new information about something\",\"kindId\":9,\"examples\":[{\"content\":\"He said he had new evidence, but refused to elaborate any further.\"},{\"content\":\"McDonald refused to elaborate on his reasons for resigning.\"}]},{\"content\":\"(sinh vật học) chế tạo ra, sản ra\",\"kindId\":4,\"examples\":[]},{\"content\":\" having a lot of small parts or details put together in a complicated way\",\"kindId\":7,\"examples\":[{\"content\":\"pure silks embroidered with elaborate patterns\"}]},{\"examples\":[{\"content\":\"McDonald refused to elaborate on his reasons for resigning.\"}],\"type\":\"gram\"},{\"content\":\"tỉ mỉ, kỹ lưỡng, công phu; trau chuốt, tinh vi\",\"kindId\":1,\"examples\":[{\"content\":\"elaborate style\"},{\"content\":\"an elaborate investigation\"},{\"content\":\"an elaborate work of art\"}]},{\"content\":\" carefully planned and organized in great detail\",\"kindId\":7,\"examples\":[{\"content\":\"a very elaborate telecommunications network\"}]},{\"content\":\"phức tạp\",\"kindId\":1,\"examples\":[{\"content\":\"an elaborate machine-tool\"}]}],\"description\":\"elaborate\",\"meaningMap\":{},\"timeStamp\":1296033668725}','elaborate','/ɪˈlæb.ər.ət/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/ela/elabo/elaborate_01_00.mp3\', this)',1296033668725),
 (637,'{\"pron\":\"/ˈfɪd.l ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fid/fiddl/fiddle.mp3\\u0027, this)\",\"meanings\":[{\"examples\":[{\"content\":\"She was at her desk in the living room, fiddling with a deck of cards.\"}],\"type\":\"gram\"},{\"content\":\"(thông tục); buồm) khoan moan (hàng hải) cái chèn, cái chốt, cái chặn\",\"kindId\":2,\"examples\":[]},{\"content\":\" to move or touch something that does not belong to you, in an annoying way\",\"kindId\":9,\"examples\":[{\"content\":\"Don\\u0027\\u0027t let him fiddle with my bag.\"}]},{\"content\":\" a dishonest way of getting money\",\"kindId\":8,\"examples\":[{\"content\":\"They suspected he was on the fiddle (\\u003dgetting money dishonestly or illegally) all along.\"},{\"content\":\"an insurance fiddle\"}]},{\"content\":\"(từ lóng) lừa bịp\",\"kindId\":3,\"examples\":[]},{\"content\":\" to move the parts of a machine in order to try to make it work or repair it\",\"kindId\":9,\"examples\":[{\"content\":\"I\\u0027\\u0027ve been fiddling around with this old car for months but I still can\\u0027\\u0027t get it to work.\"}]},{\"content\":\" to be difficult to do and involve complicated movements of your hands\",\"kindId\":8,\"examples\":[{\"content\":\"This blouse is a bit of a fiddle to do up.\"}]},{\"content\":\"fiddle the books\",\"examples\":[],\"type\":\"collo\"},{\"content\":\" to make small unnecessary changes to something - used to show disapproval\",\"kindId\":9,\"examples\":[{\"content\":\"Why did you let her fiddle about with the remote control?\"},{\"content\":\"The bus company is always fiddling around with the schedules.\"}]},{\"content\":\" to waste time doing unimportant things\",\"kindId\":9,\"examples\":[]},{\"content\":\"[intransitive] to play a violin\",\"kindId\":9,\"examples\":[]},{\"content\":\"on the fiddle\",\"examples\":[],\"type\":\"gram\"},{\"content\":\"chơi viôlông; ((đùa cợt); guội gãi viôlông; cò cử viôlông\",\"kindId\":3,\"examples\":[]},{\"content\":\"(+ away) lãng phí, tiêu phí\",\"kindId\":4,\"examples\":[{\"content\":\"to fiddle away one\\u0027\\u0027s time\"}]},{\"content\":\"[transitive] to give false information about something, in order to avoid paying money or to get extra money\",\"kindId\":9,\"examples\":[{\"content\":\"Bert had been fiddling his income tax for years.\"}]},{\"content\":\"((thường) + about,  at,  with...) nghịch vớ vẩn, làm trò vớ vẩn\",\"kindId\":3,\"examples\":[{\"content\":\"to fiddle with a piece of string\"},{\"content\":\"to fiddle about\"}]},{\"content\":\" to move part of a machine in order to make it work, without knowing exactly what you should do\",\"kindId\":9,\"examples\":[{\"content\":\"After fiddling with the tuning I finally got JFM.\"}]},{\"content\":\"(từ lóng) ngón lừa bịp; vố lừa bịp\",\"kindId\":2,\"examples\":[]},{\"content\":\" a violin\",\"kindId\":8,\"examples\":[]},{\"content\":\"vớ vẩn!\",\"examples\":[]},{\"content\":\"[intransitive] to keep moving and touching something, especially because you are bored or nervous\",\"kindId\":9,\"examples\":[{\"content\":\"She was at her desk in the living room, fiddling with a deck of cards.\"},{\"content\":\"Stop fiddling, will you!\"},{\"content\":\"I sat and fiddled at the computer for a while.\"}]},{\"content\":\"kéo viôlông (bài gì)\",\"kindId\":4,\"examples\":[]}],\"description\":\"fiddle\",\"meaningMap\":{},\"timeStamp\":1296033682135}','fiddle','/ˈfɪd.l ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fid/fiddl/fiddle.mp3\', this)',1296033682135),
 (638,'{\"meanings\":[{\"content\":\"tính chất như hột\",\"kindId\":2,\"examples\":[]},{\"content\":\"tính chất có hột\",\"kindId\":2,\"examples\":[]}],\"description\":\"granularity\",\"meaningMap\":{},\"timeStamp\":1296033690347}','granularity',NULL,NULL,1296033690347),
 (639,'{\"pron\":\"/ɪnˈtent s/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/i/int/inten/intense.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"mãnh liệt, dữ dội\",\"kindId\":1,\"examples\":[]},{\"content\":\" intense activity is very serious, uses a lot of effort, and often involves doing a great deal in a very short time\",\"kindId\":7,\"examples\":[{\"content\":\"At least 3000 people were killed in a week of intense fighting.\"},{\"content\":\"The job demands intense concentration.\"}]},{\"content\":\" having a very strong effect or felt very strongly\",\"kindId\":7,\"examples\":[{\"content\":\"Young people today are under intense pressure to succeed.\"},{\"content\":\"The pain was so intense I couldn\\u0027\\u0027t sleep.\"},{\"content\":\"the intense heat of the desert\"},{\"content\":\"He took an intense interest in all religious matters.\"},{\"content\":\"a look of intense dislike\"}]},{\"content\":\"đầy nhiệt huyết; dễ xúc cảm mạnh mẽ (người)\",\"kindId\":1,\"examples\":[]},{\"content\":\"nồng nhiệt, sôi nổi (tình cảm, hành động...)\",\"kindId\":1,\"examples\":[]},{\"content\":\"mạnh, có cường độ lớn\",\"kindId\":1,\"examples\":[{\"content\":\"intense pain\"},{\"content\":\"intense heart\"},{\"content\":\"intense light\"}]},{\"content\":\" someone who is intense is serious and has very strong feelings or opinions - used to show disapproval\",\"kindId\":7,\"examples\":[{\"content\":\"She\\u0027\\u0027s a little too intense for me.\"}]}],\"description\":\"intense\",\"meaningMap\":{},\"timeStamp\":1296033696179}','intense','/ɪnˈtent s/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/i/int/inten/intense.mp3\', this)',1296033696179),
 (640,'{\"pron\":\"/ˈluː.mɪ.nəs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lum/lumin/luminous.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" very brightly coloured, especially in green, pink, or yellow\",\"kindId\":7,\"examples\":[{\"content\":\"luminous green socks\"}]},{\"content\":\"sáng, sáng chói, chói lọi, rực rỡ\",\"kindId\":1,\"examples\":[]},{\"content\":\" shining in the dark\",\"kindId\":7,\"examples\":[{\"content\":\"Her large dark eyes were almost luminous.\"},{\"content\":\"luminous paint\"}]},{\"content\":\"rõ ràng, minh xác, quang minh\",\"kindId\":1,\"examples\":[]},{\"content\":\"soi sáng vấn đề (nhà văn...)\",\"kindId\":1,\"examples\":[]}],\"description\":\"luminous\",\"meaningMap\":{},\"timeStamp\":1296033702442}','luminous','/ˈluː.mɪ.nəs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lum/lumin/luminous.mp3\', this)',1296033702442),
 (641,'{\"pron\":\"/maʊnd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/mou/mound/mound.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"gò; đống; đồi; núi nhỏ\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"The waiter appeared with a huge mound of spaghetti.\"},{\"content\":\"There\\u0027\\u0027s a mound of papers on my desk.\"}],\"type\":\"gram\"},{\"content\":\"ụ (đất, đá), mô (đất, đá)\",\"kindId\":2,\"examples\":[]},{\"content\":\" a large pile of something\",\"kindId\":8,\"examples\":[{\"content\":\"There\\u0027\\u0027s a mound of papers on my desk.\"},{\"content\":\"The waiter appeared with a huge mound of spaghetti.\"}]},{\"examples\":[{\"content\":\"a small mound of dirt\"}],\"type\":\"gram\"},{\"content\":\" the small hill that the pitcher stands on in the game of baseball\",\"kindId\":8,\"examples\":[]},{\"content\":\" a pile of earth or stones that looks like a small hill\",\"kindId\":8,\"examples\":[{\"content\":\"a small mound of dirt\"},{\"content\":\"an ancient burial mound\"}]}],\"description\":\"mound\",\"meaningMap\":{},\"timeStamp\":1296033710065}','mound','/maʊnd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/mou/mound/mound.mp3\', this)',1296033710065),
 (642,'{\"meanings\":[{\"content\":\"nay đây mai đó; du cư\",\"kindId\":1,\"examples\":[{\"content\":\"nomadic stage\"}]},{\"content\":\" if someone leads a nomadic life, they travel from place to place and do not live in any one place for very long\",\"kindId\":7,\"examples\":[{\"content\":\"The son of an airforce pilot, he had a somewhat nomadic childhood.\"}]},{\"content\":\" nomadic people are nomads\",\"kindId\":7,\"examples\":[{\"content\":\"nomadic herdsmen\"}]}],\"description\":\"nomadic\",\"meaningMap\":{},\"timeStamp\":1296033717386}','nomadic',NULL,NULL,1296033717386),
 (643,'{\"pron\":\"/ˈpɒz.ə.tɪv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73656.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" good or useful\",\"kindId\":7,\"examples\":[{\"content\":\"Women should be portrayed in a more positive light.\"},{\"content\":\"TV can be a positive influence.\"},{\"content\":\"It\\u0027\\u0027s been a difficult time but, on the positive side, I feel physically fine.\"},{\"content\":\"Write down all the positive things about your life.\"},{\"content\":\"It\\u0027\\u0027s been a very positive experience for her.\"},{\"content\":\"At least something positive has come out of the situation.\"},{\"content\":\"the positive contribution to the community made by many older people\"},{\"content\":\"The rural environment was having a positive effect on the children\\u0027\\u0027s health.\"}]},{\"content\":\"đặt ra, do người đặt ra\",\"kindId\":1,\"examples\":[{\"content\":\"positive laws\"}]},{\"content\":\"(ngôn ngữ học) ở cấp nguyên (chưa so sánh...) (tĩnh từ, phó từ)\",\"kindId\":1,\"examples\":[]},{\"content\":\" a positive number is more than zero\",\"kindId\":7,\"examples\":[]},{\"content\":\"(vật lý); (toán học); (nhiếp ảnh) dương\",\"kindId\":1,\"examples\":[{\"content\":\"positive pole\"}]},{\"content\":\"[not before noun] very sure, with no doubt at all that something is right or true\",\"kindId\":7,\"examples\":[{\"content\":\"\\u0027\\u0027Are you sure about that?\\u0027\\u0027 \\u0027\\u0027Positive.\\u0027\\u0027\"},{\"content\":\"Are you absolutely positive you locked the door?\"}]},{\"content\":\" proof etc that shows that there is no doubt that something is true\",\"kindId\":7,\"examples\":[{\"content\":\"The witness made a positive identification.\"}]},{\"content\":\"positive (that)\",\"examples\":[{\"content\":\"Are you absolutely positive you locked the door?\"}],\"type\":\"gram\"},{\"content\":\" showing signs of the medical condition or chemical that is being looked for\",\"kindId\":7,\"examples\":[{\"content\":\"athletes who had tested positive for banned substances\"},{\"content\":\"children who are HIV positive\"},{\"content\":\"The test results came back positive.\"}]},{\"content\":\"tuyệt đối; (thông tục) hoàn toàn, hết sức\",\"kindId\":1,\"examples\":[{\"content\":\"he is a positive nuisance\"}]},{\"content\":\"quả quyết, khẳng định, chắc chắn\",\"kindId\":1,\"examples\":[{\"content\":\"to be positive about something\"},{\"content\":\"a positive answer\"}]},{\"content\":\"(nhiếp ảnh) bản dương\",\"kindId\":2,\"examples\":[]},{\"content\":\" a quality or feature that is good or useful\",\"kindId\":8,\"examples\":[{\"content\":\"Always emphasise the positive.\"},{\"content\":\"You can find positives in any situation.\"}]},{\"content\":\" if you are positive about things, you are hopeful and confident, and think about what is good in a situation rather than what is bad\",\"kindId\":7,\"examples\":[{\"content\":\"\\u0027\\u0027 Think positive!\\u0027\\u0027 she advised herself.\"},{\"content\":\"She\\u0027\\u0027s got a really positive attitude to life.\"},{\"content\":\"the power of positive thinking\"},{\"content\":\"You\\u0027\\u0027ve got to be more positive about your work.\"}]},{\"content\":\"tích cực\",\"kindId\":1,\"examples\":[{\"content\":\"a positive factor\"}]},{\"content\":\"xác thực, rõ ràng\",\"kindId\":1,\"examples\":[{\"content\":\"a positive proof\"}]},{\"examples\":[{\"content\":\"Most people have been very positive about the show.\"}],\"type\":\"gram\"},{\"content\":\"[only before noun] used to emphasize how good or bad something is\",\"kindId\":7,\"examples\":[{\"content\":\"The journey was a positive nightmare.\"}]},{\"content\":\"điều xác thực, điều có thực\",\"kindId\":2,\"examples\":[]},{\"content\":\" showing that something is likely to succeed or improve\",\"kindId\":7,\"examples\":[{\"content\":\"The fact that he\\u0027\\u0027s breathing on his own again is a positive sign.\"}]},{\"examples\":[{\"content\":\"You\\u0027\\u0027ve got to be more positive about your work.\"}],\"type\":\"gram\"},{\"content\":\"(ngôn ngữ học) cấp nguyên (của tĩnh từ, phó từ); tính từ ở cấp nguyên, phó từ ở cấp nguyên (chưa so sánh)\",\"kindId\":2,\"examples\":[]},{\"content\":\"(thực vật học) chứng\",\"kindId\":1,\"examples\":[{\"content\":\"positive philosophy\"}]},{\"content\":\"positive response/reaction\",\"examples\":[{\"content\":\"The response we\\u0027\\u0027ve had from the public has been very positive.\"}],\"type\":\"collo\"},{\"content\":\" if you take positive action, you do something definite in order to try and achieve something\",\"kindId\":7,\"examples\":[{\"content\":\"We need to take positive steps to improve the situation of families in poverty.\"},{\"content\":\"Positive action was required.\"},{\"content\":\"It\\u0027\\u0027s a relief to know that something positive is being done.\"}]},{\"content\":\"positive attitude/approach/outlook etc\",\"examples\":[{\"content\":\"She\\u0027\\u0027s got a really positive attitude to life.\"}],\"type\":\"collo\"},{\"content\":\" having the type of electrical charge that is carried by protons\",\"kindId\":7,\"examples\":[{\"content\":\"a positive charge\"}]},{\"content\":\" expressing support, agreement, or approval\",\"kindId\":7,\"examples\":[{\"content\":\"Most people have been very positive about the show.\"},{\"content\":\"We\\u0027\\u0027ve had a lot of positive feedback from the people of this city.\"},{\"content\":\"The response we\\u0027\\u0027ve had from the public has been very positive.\"}]}],\"description\":\"positive\",\"meaningMap\":{},\"timeStamp\":1296033737100}','positive','/ˈpɒz.ə.tɪv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73656.mp3\', this)',1296033737100),
