 (648,'{\"pron\":\"/ˈvɜː.tjuː/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/vir/virtu/virtue.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"đức tính, tính tốt\",\"kindId\":2,\"examples\":[{\"content\":\"patience is a virtue\"}]},{\"content\":\" to get an advantage out of doing something that you have to do\",\"kindId\":8,\"examples\":[]},{\"content\":\"[uncountable] moral goodness of character and behaviour\",\"kindId\":8,\"examples\":[{\"content\":\"Women have often been used as symbols of virtue.\"}]},{\"content\":\"công dụng; tác dụng, hiệu quả, hiệu lực\",\"kindId\":2,\"examples\":[{\"content\":\"a remedy of great virtue\"}]},{\"examples\":[{\"content\":\"Adam Smith believed in the virtues of free trade.\"}],\"type\":\"gram\"},{\"content\":\"đức, đức hạnh\",\"kindId\":2,\"examples\":[{\"content\":\"to follow virtue\"}]},{\"content\":\"[countable] a particular good quality in someone\\u0027\\u0027s character\",\"kindId\":8,\"examples\":[{\"content\":\"Among her many virtues are loyalty, courage, and truthfulness.\"}]},{\"content\":\"[uncountable and countable] an advantage that makes something better or more useful than something else\",\"kindId\":8,\"examples\":[{\"content\":\"Wilkins is now extolling (\\u003dpraising very much) the virtues of organic farming.\"},{\"content\":\"Adam Smith believed in the virtues of free trade.\"}]},{\"content\":\" by means of, or as a result of something\",\"kindId\":8,\"examples\":[{\"content\":\"She became a British resident by virtue of her marriage.\"}]},{\"content\":\"trinh tiết, tiết nghĩa\",\"kindId\":2,\"examples\":[{\"content\":\"a woman of easy virtue\"},{\"content\":\"a woman of virtue\"}]}],\"description\":\"virtue\",\"meaningMap\":{},\"timeStamp\":1296033774781}','virtue','/ˈvɜː.tjuː/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/vir/virtu/virtue.mp3\', this)',1296033774781),
