 (655,'{\"pron\":\"/fraʊn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fro/frown/frown.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to make an angry, unhappy, or confused expression, moving your eyebrows together\",\"kindId\":9,\"examples\":[{\"content\":\"She frowned as she read the letter.\"},{\"content\":\"Mattie frowned at him disapprovingly.\"}]},{\"content\":\"with a frown\",\"examples\":[{\"content\":\"He looked at her with a puzzled frown.\"}],\"type\":\"gram\"},{\"content\":\"vẻ khó chịu; vẻ không tán thành\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"Mattie frowned at him disapprovingly.\"}],\"type\":\"gram\"},{\"content\":\"sự khắc nghiệt\",\"kindId\":2,\"examples\":[{\"content\":\"the frowns of fortune\"}]},{\"content\":\"có vẻ buồn thảm (sự vật)\",\"kindId\":3,\"examples\":[]},{\"content\":\"cau mày, nhăn mặt\",\"kindId\":3,\"examples\":[{\"content\":\"to frown at somebody\"}]},{\"content\":\"cau mày\",\"kindId\":4,\"examples\":[{\"content\":\"to frown defiance\"},{\"content\":\"to frown somebody [down] into silence\"}]},{\"content\":\" to disapprove of someone or something, especially someone\\u0027\\u0027s behaviour\",\"kindId\":9,\"examples\":[{\"content\":\"Even though divorce is legal, it is still frowned upon.\"}]},{\"content\":\" the expression on your face when you move your eyebrows together because you are angry, unhappy, or confused\",\"kindId\":8,\"examples\":[{\"content\":\"He looked at her with a puzzled frown.\"}]},{\"content\":\"sự cau mày, nét cau mày\",\"kindId\":2,\"examples\":[]},{\"content\":\"vẻ nghiêm nghị; vẻ tư lự\",\"kindId\":2,\"examples\":[]},{\"content\":\"không bằng lòng, không đồng ý, không tán thành\",\"kindId\":3,\"examples\":[{\"content\":\"to frown at (on, upon) something\"}]}],\"description\":\"frown\",\"meaningMap\":{},\"timeStamp\":1296033831680}','frown','/fraʊn/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fro/frown/frown.mp3\', this)',1296033831680),
 (656,'{\"pron\":\"/greɪn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/g/gra/grain/grain.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"along the grain\",\"examples\":[{\"content\":\"Cut along the grain of the wood.\"}],\"type\":\"gram\"},{\"content\":\"thớ (gỗ)\",\"examples\":[{\"content\":\"wood of fine grain\"},{\"content\":\"with the grain\"},{\"content\":\"against the grain\"}]},{\"content\":\"nhuộm màu bền\",\"kindId\":4,\"examples\":[]},{\"content\":\"một chút, mảy may\",\"examples\":[{\"content\":\"without a grain of love\"}]},{\"content\":\"[singular] the natural lines you can see in a substance such as wood, which are the result of its structure\",\"kindId\":8,\"examples\":[{\"content\":\"Cut along the grain of the wood.\"}]},{\"content\":\"across the grain\",\"examples\":[],\"type\":\"gram\"},{\"content\":\" a very small amount of something\",\"kindId\":8,\"examples\":[{\"content\":\"There is a grain of truth in all folklore and legend.\"},{\"content\":\"The story wouldn\\u0027\\u0027t have fooled anyone with a grain of sense.\"}]},{\"content\":\"cạo sạch lông (da để thuộc)\",\"kindId\":4,\"examples\":[]},{\"content\":\"tính chất, bản chất; tính tình, khuynh hướng\",\"examples\":[{\"content\":\"a rogue in grain\"},{\"content\":\"in grain\"},{\"content\":\"man of coarse grain\"}]},{\"content\":\"(số nhiều) bã rượu\",\"examples\":[]},{\"content\":\"[countable] the smallest unit for measuring weight, equal to about 0.06 grams. It is used for weighing medicines\",\"kindId\":8,\"examples\":[]},{\"examples\":[{\"content\":\"a grain of sand\"},{\"content\":\"There were crumbs and grains of sugar on the table.\"}],\"type\":\"gram\"},{\"content\":\"sơn già vân (như vân gỗ, vân đá)\",\"kindId\":4,\"examples\":[]},{\"content\":\"phẩm yên chi (để nhuộm); (thơ ca) màu nhuộm\",\"examples\":[]},{\"content\":\" if something goes against the grain, it is not what you would naturally or normally do\",\"kindId\":8,\"