 (657,'{\"pron\":\"/heɪst/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/has/haste/haste.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" used to say that it is better to do something slowly, because if you do it too quickly you will make mistakes\",\"kindId\":8,\"examples\":[]},{\"content\":\" to hurry or do something quickly\",\"kindId\":8,\"examples\":[]},{\"content\":\"hấp tấp\",\"kindId\":3,\"examples\":[]},{\"content\":\" great speed in doing something, especially because you do not have enough time\",\"kindId\":8,\"examples\":[{\"content\":\"I soon regretted my haste.\"},{\"content\":\"In his haste to leave, he forgot his briefcase.\"}]},{\"content\":\"in your haste to do something\",\"examples\":[{\"content\":\"In his haste to leave, he forgot his briefcase.\"}],\"type\":\"gram\"},{\"content\":\"vội, vội vàng, vội vã\",\"kindId\":3,\"examples\":[]},{\"content\":\"sự hấp tấp\",\"kindId\":2,\"examples\":[]},{\"content\":\" quickly or in a hurry\",\"kindId\":8,\"examples\":[{\"content\":\"They left in haste, without even saying goodbye.\"}]},{\"content\":\"sự vội vàng, sự vội vã, sự gấp rút\",\"kindId\":2,\"examples\":[{\"content\":\"make haste!\"}]}],\"description\":\"haste\",\"meaningMap\":{},\"timeStamp\":1296033846583}','haste','/heɪst/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/has/haste/haste.mp3\', this)',1296033846583),
