 (659,'{\"pron\":\"/kɪn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/k/kin/kin__/kin.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" your family\",\"kindId\":8,\"examples\":[]},{\"content\":\"bà con thân thiết, họ hàng\",\"kindId\":2,\"examples\":[{\"content\":\"to be near of kin\"}]},{\"content\":\"có họ là bà con thân thích\",\"examples\":[{\"content\":\"to be kin to someone\"},{\"content\":\"we are kin\"}]},{\"content\":\" your most closely related family\",\"kindId\":8,\"examples\":[{\"content\":\"We\\u0027\\u0027ll have to notify the next of kin of his death.\"}]},{\"content\":\"dòng dõi, dòng họ, gia đình\",\"kindId\":2,\"examples\":[{\"content\":\"to come of good kin\"}]}],\"description\":\"kin\",\"meaningMap\":{},\"timeStamp\":1296033861169}','kin','/kɪn/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/k/kin/kin__/kin.mp3\', this)',1296033861169),
 (660,'{\"pron\":\"/lʌst/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lus/lust_/lust.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to be strongly sexually attracted to someone, and think about having sex with them\",\"kindId\":9,\"examples\":[{\"content\":\"She had secretely lusted after him for years.\"}]},{\"content\":\"(+ for,  after) tham muốn, thèm khát\",\"kindId\":3,\"examples\":[{\"content\":\"to lust for blood\"}]},{\"content\":\"[uncountable and countable] very strong sexual desire, especially when it does not include love\",\"kindId\":8,\"examples\":[{\"content\":\"My feelings for Lauren were pure lust.\"}]},{\"examples\":[{\"content\":\"Hitler\\u0027\\u0027s lust for power\"}],\"type\":\"gram\"},{\"content\":\" to want something very much, especially something that you do not really need\",\"kindId\":9,\"examples\":[{\"content\":\"This is a car to lust after.\"}]},{\"content\":\"[singular, uncountable] a very strong desire to have something, usually power or money -used to show disapproval\",\"kindId\":8,\"examples\":[{\"content\":\"Hitler\\u0027\\u0027s lust for power\"}]},{\"content\":\" a strong determination to enjoy life as much as possible - used to show approval\",\"kindId\":8,\"examples\":[{\"content\":\"the happy-go-lucky lust for life so typical of southern Italy\"}]}],\"description\":\"lust\",\"meaningMap\":{},\"timeStamp\":1296033874791}','lust','/lʌst/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lus/lust_/lust.mp3\', this)',1296033874791),
 (661,'{\"pron\":\"/əˈfent .sɪv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75170.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a planned set of actions intended to influence a lot of people\",\"kindId\":8,\"examples\":[]},{\"content\":\" a planned military attack involving large forces over a long period\",\"kindId\":8,\"examples\":[{\"content\":\"a military offensive\"},{\"content\":\"A major offensive was launched on August 22.\"}]},{\"content\":\" to start attacking or criticizing someone before they start attacking or criticizing you\",\"kindId\":8,\"examples\":[{\"content\":\"Republicans went on the offensive over soaring gasoline prices.\"},{\"content\":\"The international coalition was ready to take the offensive.\"}]},{\"content\":\" very unpleasant\",\"kindId\":7,\"examples\":[{\"content\":\"an offensive smell\"}]},{\"content\":\"chướng tai gai mắt, khó chịu; hôi hám; gớm guốc, tởm\",\"kindId\":1,\"examples\":[{\"content\":\"an offensive smell\"}]},{\"content\":\"[only before noun] for attacking\",\"kindId\":7,\"examples\":[{\"content\":\"The troops took up offensive positions.\"},{\"content\":\"Jan was convicted of possessing an offensive weapon.\"}]},{\"content\":\"xúc phạm, làm mất lòng; làm nhục, sỉ nhục\",\"kindId\":1,\"examples\":[{\"content\":\"offensive language\"}]},{\"examples\":[{\"content\":\"crude jokes that are offensive to women\"}],\"type\":\"gram\"},{\"content\":\" relating to getting points and winning a game, rather than stopping the other team from getting points\",\"kindId\":7,\"examples\":[{\"content\":\"the Jets\\u0027\\u0027 offensive strategy\"}]},{\"content\":\"tấn công, công kích\",\"kindId\":1,\"examples\":[{\"content\":\"an offensive compaign\"}]},{\"content\":\"sự tấn công; cuộc tấn công; thế tấn công\",\"kindId\":2,\"examples\":[{\"content\":\"to hold the offensive\"},{\"content\":\"to take the offensive\"}]},{\"content\":\" very rude or insulting and likely to upset people\",\"kindId\":7,\"examples\":[{\"content\":\"crude jokes that are offensive to women\"},{\"content\":\"offensive behaviour\"},{\"content\":\"I found her remarks deeply offensive.\"}]}],\"description\":\"offensive\",\"meaningMap\":{},\"timeStamp\":1296033886880}','offensive','/əˈfent .sɪv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75170.mp3\', this)',1296033886880),
 (662,'{\"pron\":\"/ˈpɒl.ən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/p/pol/polle/pollen.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a fine powder produced by flowers, which is carried by the wind or by insects to other flowers of the same type, making them produce seeds\",\"kindId\":8,\"examples\":[]},{\"content\":\"(thực vật học) phấn hoa\",\"kindId\":2,\"examples\":[]},{\"content\":\"(thực vật học) cho thụ phấn, rắc phấn hoa\",\"kindId\":4,\"examples\":[]}],\"description\":\"pollen\",\"meaningMap\":{},\"timeStamp\":1296033897521}','pollen','/ˈpɒl.ən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/p/pol/polle/pollen.mp3\', this)',1296033897521),
 (663,'{\"pron\":\"/rɪˈliːv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/rel/relie/relieve.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to help someone by taking something from them, especially a job they do not want to do or something heavy that they are carrying\",\"kindId\":9,\"examples\":[{\"content\":\"He rose and relieved her of her bags.\"},{\"content\":\"A secretary was hired to relieve her of some of the administrative work.\"}]},{\"content\":\"làm nhẹ bớt, giảm bớt (gánh nặng, lo âu, phiền muộn...)\",\"kindId\":4,\"examples\":[{\"content\":\"to relieve someone of his cash (purse)\"},{\"content\":\"to relieve someone\\u0027\\u0027s anxiety\"},{\"content\":\"to relieve someone\\u0027\\u0027s of his position\"},{\"content\":\"to relieve one\\u0027\\u0027s feelings\"},{\"content\":\"to relieve someone of his load\"}]},{\"content\":\" to reduce someone\\u0027\\u0027s pain or unpleasant feelings\",\"kindId\":9,\"examples\":[{\"content\":\"Drugs helped to relieve the pain.\"},{\"content\":\"Some people eat for comfort, to relieve their anxieties.\"}]},{\"content\":\" a polite expression meaning to urinate - often used humorously\",\"kindId\":9,\"examples\":[]},{\"content\":\"làm an tâm, làm yên lòng, làm dịu, làm khuây khoả, an ủi\",\"kindId\":4,\"examples\":[{\"content\":\"to feel relieved\"},{\"content\":\"to relieve someone\\u0027\\u0027s mind\"}]},{\"content\":\"giúp đỡ, cứu giúp, cứu trợ\",\"kindId\":4,\"examples\":[]},{\"content\":\"đắp (khắc, chạm) nổi\",\"kindId\":4,\"examples\":[]},{\"content\":\"nêu bật lên, làm nổi bật lên (trên một cái nền nào đó...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"làm cho vui lên, làm cho đỡ đều đều tử nhạt, làm cho đỡ căng thẳng\",\"kindId\":4,\"examples\":[]},{\"content\":\"relieve tension/pressure/stress etc\",\"examples\":[{\"content\":\"Some people eat for comfort, to relieve their anxieties.\"}],\"type\":\"collo\"},{\"content\":\"(kỹ thuật) khai thông\",\"kindId\":4,\"examples\":[]},{\"content\":\"đổi (gác)\",\"kindId\":4,\"examples\":[]},{\"content\":\"relieve the boredom/monotony\",\"examples\":[{\"content\":\"The books helped relieve the boredom of waiting.\"}],\"type\":\"collo\"},{\"content\":\" to steal something from someone - used humorously\",\"kindId\":9,\"examples\":[{\"content\":\"A couple of guys relieved him of his wallet.\"}]},{\"content\":\" to take away someone\\u0027\\u0027s job because they have done something wrong\",\"kindId\":9,\"examples\":[{\"content\":\"After the defeat General Meyer was relieved of his command.\"}]},{\"content\":\" to make a problem less difficult or serious\",\"kindId\":9,\"examples\":[{\"content\":\"programs aimed at relieving unemployment\"}]},{\"content\":\" to free a town which an enemy has surrounded\",\"kindId\":9,\"examples\":[]},{\"content\":\" to make something less dull and boring\",\"kindId\":9,\"examples\":[{\"content\":\"a plain wall relieved by flecks of blue and yellow\"},{\"content\":\"The books helped relieve the boredom of waiting.\"}]},{\"content\":\" to replace someone when they have completed their duty or when they need a rest\",\"kindId\":9,\"examples\":[{\"content\":\"The guard will be relieved at midnight.\"}]},{\"content\":\"giải vây\",\"kindId\":4,\"examples\":[{\"content\":\"the town was relieved\"}]}],\"description\":\"relieve\",\"meaningMap\":{},\"timeStamp\":1296033905967}','relieve','/rɪˈliːv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/rel/relie/relieve.mp3\', this)',1296033905967),
 (664,'{\"pron\":\"/skrʌb/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/s/scr/scrub/scrub.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[intransitive and transitive] to rub something hard, especially with a stiff brush, in order to clean it\",\"kindId\":9,\"examples\":[{\"content\":\"She was on her hands and knees scrubbing the floor.\"},{\"content\":\"She scrubbed at her face with a tissue.\"},{\"content\":\"The table needs to be scrubbed clean.\"},{\"content\":\"He scrubbed the dirt off his boots.\"}]},{\"content\":\"[transitive] to decide not to do something that you had planned\",\"kindId\":9,\"examples\":[{\"content\":\"We scrubbed the idea in the end.\"}]},{\"content\":\" to wash your hands and arms before doing a medical operation\",\"kindId\":9,\"examples\":[]},{\"content\":\"bàn chải mòn, có ria ngắn\",\"kindId\":2,\"examples\":[]},{\"content\":\"người còi, con vật còi, cây còi; người tầm thường, vật vô giá trị\",\"kindId\":2,\"examples\":[]},{\"content\":\" to clean the inside of a place thoroughly\",\"kindId\":9,\"examples\":[{\"content\":\"The rooms are all scrubbed out once a week.\"}]},{\"content\":\"lau, chùi, cọ\",\"kindId\":0,\"examples\":[]},{\"content\":\"(từ lóng) bỏ đi, huỷ bỏ\",\"kindId\":0,\"examples\":[]},{\"content\":\"bụi cây, bụi rậm; nơi có bụi cây, nơi có bụi rậm\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"She scrubbed at her face with a tissue.\"}],\"type\":\"gram\"},{\"content\":\"lọc hơi đốt\",\"kindId\":0,\"examples\":[]},{\"content\":\"[singular] if you give something a scrub, you clean it by rubbing it hard\",\"kindId\":8,\"examples\":[{\"content\":\"I gave the floor a good scrub.\"}]},{\"content\":\"(thể dục,thể thao) đấu thủ loại kém, đấu thủ không được vào chính thức; (số nhiều) đội gồm toàn đấu thủ loại kém; đội gồm toàn đấu thủ tạp nham\",\"kindId\":2,\"examples\":[]},{\"content\":\"[uncountable] low bushes and trees that grow in very dry soil\",\"kindId\":8,\"examples\":[]}],\"description\":\"scrub\",\"meaningMap\":{},\"timeStamp\":1296033918774}','scrub','/skrʌb/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/s/scr/scrub/scrub.mp3\', this)',1296033918774);
