 (665,'{\"pron\":\"/juːˈnæn.ɪ.məs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/una/unani/unanimous.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"nhất trí\",\"kindId\":1,\"examples\":[]},{\"content\":\" agreeing completely about something\",\"kindId\":7,\"examples\":[{\"content\":\"The banks were unanimous in welcoming the news.\"}]},{\"content\":\"unanimous in (doing) something\",\"examples\":[{\"content\":\"The banks were unanimous in welcoming the news.\"}],\"type\":\"gram\"},{\"content\":\" a unanimous decision, vote, agreement etc is one in which all the people involved agree\",\"kindId\":7,\"examples\":[{\"content\":\"The decision to appoint Matt was almost unanimous.\"},{\"content\":\"It was decided by a unanimous vote that the school should close.\"}]},{\"content\":\"almost/virtually unanimous\",\"examples\":[{\"content\":\"The decision to appoint Matt was almost unanimous.\"}],\"type\":\"collo\"}],\"description\":\"unanimous\",\"meaningMap\":{},\"timeStamp\":1296033925260}','unanimous','/juːˈnæn.ɪ.məs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/una/unani/unanimous.mp3\', this)',1296033925260),
 (666,'{\"pron\":\"/ˈvɜː.tju.ə.li/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/vir/virtu/virtually.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"hầu như, gần như\",\"kindId\":5,\"examples\":[]},{\"content\":\" on a computer, rather than in the real world\",\"kindId\":6,\"examples\":[]},{\"content\":\"thực sự, thực tế\",\"kindId\":5,\"examples\":[]},{\"content\":\" almost\",\"kindId\":6,\"examples\":[{\"content\":\"Virtually all the children come to school by bus.\"},{\"content\":\"He was virtually unknown before running for office.\"}]}],\"description\":\"virtually\",\"meaningMap\":{},\"timeStamp\":1296033931709}','virtually','/ˈvɜː.tju.ə.li/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/vir/virtu/virtually.mp3\', this)',1296033931709),
 (667,'{\"pron\":\"/ˈwɒr.ənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74931.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(tài chính) lệnh (trả tiền)\",\"kindId\":2,\"examples\":[]},{\"content\":\"sự bảo đảm (cho việc gì)\",\"kindId\":2,\"examples\":[]},{\"content\":\" used to tell someone that you are sure about something\",\"kindId\":9,\"examples\":[{\"content\":\"I\\u0027\\u0027ll warrant we won\\u0027\\u0027t see him again.\"}]},{\"content\":\"đảm bảo, chứng thực\",\"kindId\":4,\"examples\":[]},{\"content\":\"warrant that\",\"examples\":[{\"content\":\"The Author hereby warrants that the Publisher is the owner of the copyright.\"}],\"type\":\"gram\"},{\"content\":\" to promise that something is true\",\"kindId\":9,\"examples\":[{\"content\":\"The Author hereby warrants that the Publisher is the owner of the copyright.\"}]},{\"content\":\"biện hộ cho\",\"kindId\":4,\"examples\":[]},{\"content\":\"(thương nghiệp) giấy chứng nhận\",\"kindId\":2,\"examples\":[{\"content\":\"warehouse (dock) warrant\"}]},{\"content\":\"[countable] a legal document that is signed by a judge, allowing the police to take a particular action\",\"kindId\":8,\"examples\":[{\"content\":\"The magistrate issued a warrant for his arrest.\"}]},{\"content\":\"lý do, lý do xác đáng (của việc làm, báo cáo...)\",\"kindId\":2,\"examples\":[]},{\"content\":\"warrant (that)\",\"examples\":[{\"content\":\"I\\u0027\\u0027ll warrant we won\\u0027\\u0027t see him again.\"}],\"type\":\"gram\"},{\"content\":\"warrant attention/consideration etc\",\"examples\":[{\"content\":\"Another area that warrants attention is that of funding for universities.\"}],\"type\":\"collo\"},{\"content\":\"cho quyền\",\"kindId\":4,\"examples\":[]},{\"content\":\" no good reason for doing something\",\"kindId\":8,\"examples\":[{\"content\":\"There is no warrant for copying other people\\u0027\\u0027s work.\"}]},{\"content\":\"[countable] an official document giving someone the right to do something, for example buy shares in a company\",\"kindId\":8,\"examples\":[{\"content\":\"The company issued warrants for 300,000 shares.\"}]},{\"content\":\"(quân sự) bằng phong chuẩn uý\",\"kindId\":2,\"examples\":[]},{\"content\":\"lệnh, trát\",\"kindId\":2,\"examples\":[{\"content\":\"warrant of arrest\"},{\"content\":\"a warrant is out against someone\"}]},{\"content\":\"sự cho phép; giấy phép\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"The magistrate issued a warrant for his arrest.\"}],\"type\":\"gram\"},{\"content\":\" to need or deserve\",\"kindId\":9,\"examples\":[{\"content\":\"This tiny crowd does not warrant such a large police presence.\"},{\"content\":\"Another area that warrants attention is that of funding for universities.\"}]}],\"description\":\"warrant\",\"meaningMap\":{},\"timeStamp\":1296033943834}','warrant','/ˈwɒr.ənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74931.mp3\', this)',1296033943834),
 (668,'{\"pron\":\"/əˈsen.dənt .si/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usa/usart/usartle008.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"in the ascendency\",\"examples\":[{\"content\":\"a teaching method that is currently in the ascendancy\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"the ascendancy of nationalist forces\"}],\"type\":\"gram\"},{\"content\":\"uy thế, uy lực\",\"kindId\":2,\"examples\":[{\"content\":\"to exercise an ascendancy over someone\"}]},{\"content\":\" a position of power, influence, or control\",\"kindId\":8,\"examples\":[{\"content\":\"moral ascendancy\"},{\"content\":\"a teaching method that is currently in the ascendancy\"},{\"content\":\"the ascendancy of nationalist forces\"},{\"content\":\"Butler established ascendancy over his critics.\"},{\"content\":\"He slowly gained ascendancy in the group.\"}]},{\"examples\":[{\"content\":\"Butler established ascendancy over his critics.\"}],\"type\":\"gram\"}],\"description\":\"ascendancy\",\"meaningMap\":{},\"timeStamp\":1296033950688}','ascendancy','/əˈsen.dənt .si/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usa/usart/usartle008.mp3\', this)',1296033950688),
 (669,'{\"pron\":\"/ˈbæb.l ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/b/bab/babbl/babble.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"tiếng rì rào, tiếng róc rách (suối)\",\"examples\":[]},{\"content\":\" a sound like water moving over stones\",\"kindId\":8,\"examples\":[]},{\"content\":\" the confused sound of many people talking at the same time\",\"kindId\":8,\"examples\":[{\"content\":\"the babble of a crowded party\"}]},{\"content\":\"[intransitive] to make a sound like water moving over stones\",\"kindId\":9,\"examples\":[]},{\"content\":\"sự nói lảm nhảm, sự\",\"examples\":[]},{\"content\":\"rì rào, róc rách (suối)\",\"kindId\":0,\"examples\":[]},{\"content\":\"sự tiết lộ (bí mật)\",\"examples\":[]},{\"content\":\"nói nhiều, nói lảm nhảm, bép xép\",\"kindId\":0,\"examples\":[]},{\"content\":\"tiếng bập bẹ, tiếng bi bô (trẻ con)\",\"examples\":[]},{\"content\":\"bập bẹ, bi bô (trẻ con)\",\"kindId\":0,\"examples\":[]},{\"content\":\"[intransitive and transitive] to speak quickly in a way that is difficult to understand or sounds silly\",\"kindId\":9,\"examples\":[{\"content\":\"I have no idea what he was babbling on about.\"}]},{\"content\":\"tiết lộ (bí mật)\",\"kindId\":0,\"examples\":[]}],\"description\":\"babble\",\"meaningMap\":{},\"timeStamp\":1296033962462}','babble','/ˈbæb.l ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/b/bab/babbl/babble.mp3\', this)',1296033962462),
 (670,'{\"pron\":\"/dəʊs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/d/dos/dose_/dose.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" very quickly and easily\",\"kindId\":8,\"examples\":[{\"content\":\"The cleaners went through the house like a dose of salts.\"}]},{\"content\":\"trộn lẫn (rượu vang với rượu mạnh...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"liều lượng, liều thuốc\",\"kindId\":2,\"examples\":[{\"content\":\"a dose of the stick\"},{\"content\":\"a dose of quinine\"},{\"content\":\"lethal dose\"}]},{\"content\":\"a bad/mild dose of flu\",\"examples\":[{\"content\":\"Dave had a bad dose of flu.\"}],\"type\":\"collo\"},{\"content\":\"lethal/fatal dose (of something)\",\"examples\":[{\"content\":\"a lethal dose of radiation\"}],\"type\":\"collo\"},{\"content\":\" the amount of a medicine or a drug that you should take\",\"kindId\":8,\"examples\":[{\"content\":\"Never exceed the recommended dose of painkillers.\"},{\"content\":\"Start with a low dose and increase it.\"}]},{\"content\":\"dose somebody/yourself with something\",\"examples\":[{\"content\":\"Sumi dosed herself up with aspirin and went to bed.\"}],\"type\":\"gram\"},{\"content\":\" to give someone medicine or a drug\",\"kindId\":9,\"examples\":[{\"content\":\"Sumi dosed herself up with aspirin and went to bed.\"}]},{\"content\":\" an amount of something that you do or experience at one time, especially something unpleasant\",\"kindId\":8,\"examples\":[{\"content\":\"Dave had a bad dose of flu.\"},{\"content\":\"I quite like Jamie in small doses (\\u003din limited amounts but not a lot or often).\"},{\"content\":\"a lethal dose of radiation\"}]},{\"content\":\"high/low dose\",\"examples\":[{\"content\":\"Start with a low dose and increase it.\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"Never exceed the recommended dose of painkillers.\"}],\"type\":\"gram\"},{\"content\":\"cho uống thuốc theo liều lượng\",\"kindId\":4,\"examples\":[]}],\"description\":\"dose\",\"meaningMap\":{},\"timeStamp\":1296033974285}','dose','/dəʊs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/d/dos/dose_/dose.mp3\', this)',1296033974285),
 (671,'{\"pron\":\"/ɪˈnjuː.mə.reɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/enu/enume/enumerate.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"đếm; kê; liệt kê\",\"kindId\":4,\"examples\":[]},{\"content\":\" to name a list of things one by one\",\"kindId\":9,\"examples\":[]}],\"description\":\"enumerate\",\"meaningMap\":{},\"timeStamp\":1296033980260}','enumerate','/ɪˈnjuː.mə.reɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/enu/enume/enumerate.mp3\', this)',1296033980260),
 (672,'{\"pron\":\"/fɪkˈtɪʃ.əs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fic/ficti/fictitious.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" not true, or not real\",\"kindId\":7,\"examples\":[{\"content\":\"a fictitious address\"},{\"content\":\"fictitious characters\"}]},{\"content\":\"giả\",\"kindId\":1,\"examples\":[{\"content\":\"a fictitious name\"}]},{\"content\":\"hư cấu, tưởng tượng, không có thực\",\"kindId\":1,\"examples\":[]}],\"description\":\"fictitious\",\"meaningMap\":{},\"timeStamp\":1296033986215}','fictitious','/fɪkˈtɪʃ.əs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fic/ficti/fictitious.mp3\', this)',1296033986215),
 (673,'{\"meanings\":[{\"content\":\" in a way that is very clear and easy to notice\",\"kindId\":6,\"examples\":[{\"content\":\"Some of the clues were glaringly obvious.\"}]},{\"content\":\"sáng chói, chói loà\",\"kindId\":5,\"examples\":[]},{\"content\":\"rõ ràng, rành rành, hiển nhiên\",\"kindId\":5,\"examples\":[]}],\"description\":\"glaringly\",\"meaningMap\":{},\"timeStamp\":1296033993639}','glaringly',NULL,NULL,1296033993639),
 (674,'{\"pron\":\"/ˈhɪə.seɪ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/hea/hears/hearsay.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"dựa vào tin đồn, do nghe đồn\",\"examples\":[{\"content\":\"hearsay evidence\"}]},{\"content\":\" something that you have heard about from other people but do not know to be definitely true or correct\",\"kindId\":8,\"examples\":[{\"content\":\"I wouldn\\u0027\\u0027t take any notice of it - it\\u0027\\u0027s just hearsay.\"}]},{\"content\":\"tin đồn, lời đồn\",\"kindId\":2,\"examples\":[{\"content\":\"to have something by hearsay\"}]}],\"description\":\"hearsay\",\"meaningMap\":{},\"timeStamp\":1296033999972}','hearsay','/ˈhɪə.seɪ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/hea/hears/hearsay.mp3\', this)',1296033999972),
 (675,'{\"pron\":\"/ɪnˈtruː.sɪv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usi/usint/usintre012.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" affecting someone\\u0027\\u0027s private life or interrupting them in an unwanted and annoying way\",\"kindId\":7,\"examples\":[{\"content\":\"They found the television cameras too intrusive.\"}]},{\"content\":\"bắt người khác phải chịu đựng mình\",\"kindId\":1,\"examples\":[]},{\"content\":\"(địa lý,ddịa chất) xâm nhập\",\"kindId\":1,\"examples\":[]},{\"content\":\"xâm phạm, xâm nhập\",\"kindId\":1,\"examples\":[]},{\"content\":\"ấn bừa, tống bừa, đưa bừa, vào bừa\",\"kindId\":1,\"examples\":[]}],\"description\":\"intrusive\",\"meaningMap\":{},\"timeStamp\":1296034006064}','intrusive','/ɪnˈtruː.sɪv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usi/usint/usintre012.mp3\', this)',1296034006064),
 (676,'{\"pron\":\"/luːs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/loo/loose/loose.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"xốp, mềm, dễ cày, dễ làm tơi (đất)\",\"kindId\":1,\"examples\":[]},{\"content\":\" parts of something that have not been completed or correctly done\",\"kindId\":7,\"examples\":[{\"content\":\"We\\u0027\\u0027ve nearly finished, but there are still a few loose ends to be tied up (\\u003ddealt with or completed).\"}]},{\"content\":\" to make something loose or to untie someone or something, especially an animal\",\"kindId\":9,\"examples\":[]},{\"content\":\"loose federation/alliance/group etc\",\"examples\":[{\"content\":\"a loose federation of political groups\"}],\"type\":\"collo\"},{\"content\":\" not pressed tightly together in a solid mass\",\"kindId\":7,\"examples\":[]},{\"content\":\" if your hair is loose, it hangs freely rather than being tied back\",\"kindId\":7,\"examples\":[{\"content\":\"Her hair fell loose around her shoulders.\"}]},{\"content\":\" to allow something dangerous or harmful to begin to affect a situation or other people\",\"kindId\":9,\"examples\":[{\"content\":\"the evils loosed upon humanity in World War II\"}]},{\"content\":\" to free yourself from someone or something, or their influence\",\"kindId\":7,\"examples\":[{\"content\":\"He cut himself loose from the constraints of family life.\"},{\"content\":\"I\\u0027\\u0027m ready to cut loose and enjoy the weekend.\"}]},{\"content\":\"thả lỏng, buông lỏng, thả ra, cởi ra, tháo ra, buông ra, nới ra, làm rời ra, gỡ ra\",\"kindId\":4,\"examples\":[]},{\"content\":\" to allow someone to deal with something in the way they want to, when you think they will make mistakes or do something wrong\",\"kindId\":7,\"examples\":[{\"content\":\"Whatever you do, don\\u0027\\u0027t let Derek loose on the garden.\"}]},{\"content\":\"sự buông lỏng, sự trút, sự tuôn ra\",\"kindId\":2,\"examples\":[{\"content\":\"to give a loose to one\\u0027\\u0027s feelings\"},{\"content\":\"to be on the loose\"}]},{\"content\":\"lỏng, không chặt, chùng, không căng, không khít, rời ra, lung lay, long ra, lòng thòng\",\"kindId\":1,\"examples\":[{\"content\":\"with a loose rein\"},{\"content\":\"loose sheets\"},{\"content\":\"loose hair\"},{\"content\":\"a loose screw\"},{\"content\":\"a loose tooth\"}]},{\"content\":\"rộng lùng thùng, lùng nhùng (quần áo)\",\"kindId\":1,\"examples\":[]},{\"content\":\" if a criminal or dangerous animal is on the loose, they have escaped from prison or from their cage\",\"kindId\":8,\"examples\":[]},{\"content\":\" someone who cannot be trusted because they say or do things you do not want them to\",\"kindId\":7,\"examples\":[]},{\"content\":\"(+ at) bắn ra, phóng ra (viên đạn, mũi tên...)\",\"kindId\":4,\"examples\":[]},{\"content\":\" to fire an arrow, a bullet from a gun etc\",\"kindId\":9,\"examples\":[]},{\"content\":\"turn/let/set something loose\",\"examples\":[{\"content\":\"Don\\u0027\\u0027t let your dog loose on the beach.\"}],\"type\":\"collo\"},{\"content\":\"lẻ, nhỏ (tiền)\",\"kindId\":1,\"examples\":[{\"content\":\"loose cash\"}]},{\"content\":\"mơ hồ, không rõ ràng, không chính xác; không chặt chẽ, phóng (lý luận, dịch, viết văn...)\",\"kindId\":1,\"examples\":[{\"content\":\"a loose translation\"},{\"content\":\"loose argument\"}]},{\"content\":\" loose clothes are big and do not fit your body tightly\",\"kindId\":7,\"examples\":[{\"content\":\"a loose sweatshirt\"}]},{\"content\":\" to speak or behave in an uncontrolled way\",\"kindId\":7,\"examples\":[{\"content\":\"She let loose a string of four-letter words.\"}]},{\"content\":\" coins that you have in your bag or pocket\",\"kindId\":7,\"examples\":[]},{\"content\":\"break/get loose\",\"examples\":[{\"content\":\"A 34-year old inmate broke loose from the sheriff\\u0027\\u0027s office yesterday.\"}],\"type\":\"collo\"},{\"content\":\" not under the control of either team in a game of football, rugby etc\",\"kindId\":7,\"examples\":[{\"content\":\"Sheringham was the first player to reach the loose ball.\"}]},{\"content\":\" behaving in a way that is considered to be sexually immoral\",\"kindId\":7,\"examples\":[{\"content\":\"loose morals\"},{\"content\":\"a loose woman\"}]},{\"content\":\" to have nothing to do\",\"kindId\":7,\"examples\":[{\"content\":\"I was at a loose end so I decided to go see an old movie.\"}]},{\"content\":\" free from being controlled or held in a cage, prison, or institution\",\"kindId\":7,\"examples\":[{\"content\":\"A 34-year old inmate broke loose from the sheriff\\u0027\\u0027s office yesterday.\"},{\"content\":\"Don\\u0027\\u0027t let your dog loose on the beach.\"}]},{\"content\":\" not strictly controlled or organized\",\"kindId\":7,\"examples\":[{\"content\":\"loose arrangement (\\u003dan arrangement that can easily be changed)\"},{\"content\":\"a loose federation of political groups\"}]},{\"content\":\" to make something unpleasant begin\",\"kindId\":9,\"examples\":[{\"content\":\"And now the anger Maggie had feared was loosed.\"}]},{\"content\":\"loose soil/earth\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"[usually before noun] not exact or thoroughly done\",\"kindId\":7,\"examples\":[{\"content\":\"a loose interpretation of the law\"},{\"content\":\"a loose translation\"}]},{\"content\":\"(y học) yếu, hay ỉa chảy (ruột)\",\"kindId\":1,\"examples\":[]},{\"content\":\" not tied or fastened very tightly\",\"kindId\":7,\"examples\":[{\"content\":\"a loose knot\"}]},{\"content\":\" not firmly fastened in place\",\"kindId\":7,\"examples\":[{\"content\":\"The screw has come loose (\\u003dbecome loose).\"},{\"content\":\"This tooth feels very loose.\"},{\"content\":\"a loose floorboard\"}]},{\"content\":\"cut yourself loose (from something)\",\"examples\":[{\"content\":\"He cut himself loose from the constraints of family life.\"}],\"type\":\"gram\"},{\"content\":\"(hàng hải) thả (dây buộc, buồm)\",\"kindId\":4,\"examp