 (689,'{\"pron\":\"/da ɪˈrek.tɪv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75606.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"chỉ thị, lời hướng dẫn\",\"kindId\":2,\"examples\":[]},{\"content\":\"chỉ huy, chi phối; chỉ dẫn, hướng dẫn\",\"kindId\":1,\"examples\":[]},{\"content\":\" giving instructions\",\"kindId\":7,\"examples\":[{\"content\":\"The team leader will have a less directive role.\"}]},{\"content\":\" an official order or instruction\",\"kindId\":8,\"examples\":[{\"content\":\"proposals for implementing the EU directive on paternity leave\"}]},{\"examples\":[{\"content\":\"proposals for implementing the EU directive on paternity leave\"}],\"type\":\"gram\"}],\"description\":\"directive\",\"meaningMap\":{},\"timeStamp\":1296034121005}','directive','/da ɪˈrek.tɪv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75606.mp3\', this)',1296034121005),
 (690,'{\"pron\":\"/flɔː/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71843.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"serious/major/basic/minor etc flaw\",\"examples\":[{\"content\":\"a slight flaw in the glass\"}],\"type\":\"collo\"},{\"content\":\"cơn gió mạnh\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"Beautiful scenery does not make up for the flaws of this film.\"}],\"type\":\"gram\"},{\"content\":\"(pháp lý) sự thiếu sót về thủ tục\",\"kindId\":2,\"examples\":[]},{\"content\":\"cơn bâo ngắn\",\"kindId\":2,\"examples\":[]},{\"content\":\" a mistake, mark, or weakness that makes something imperfect\",\"kindId\":8,\"examples\":[{\"content\":\"A design flaw (\\u003da mistake or weakness in the way something was made) caused the engine to explode.\"},{\"content\":\"a flaw in the software\"},{\"content\":\"a slight flaw in the glass\"}]},{\"content\":\" a fault in someone\\u0027\\u0027s character\",\"kindId\":8,\"examples\":[{\"content\":\"Jealousy is Othello\\u0027\\u0027s major flaw.\"},{\"content\":\"the President\\u0027\\u0027s character flaws\"}]},{\"content\":\"fatal flaw\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"vết nhơ, thói xấu\",\"kindId\":2,\"examples\":[{\"content\":\"a flaw in someone\\u0027\\u0027s reputation\"}]},{\"examples\":[{\"content\":\"a flaw in the software\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"There is a fundamental flaw in Walton\\u0027\\u0027s argument.\"}],\"type\":\"gram\"},{\"content\":\"chỗ hỏng (hàng hoá...)\",\"kindId\":2,\"examples\":[]},{\"content\":\" a mistake or problem in an argument, plan, set of ideas etc\",\"kindId\":8,\"examples\":[{\"content\":\"Beautiful scenery does not make up for the flaws of this film.\"},{\"content\":\"There is a fundamental flaw in Walton\\u0027\\u0027s argument.\"}]},{\"content\":\"thiếu sót, sai lầm\",\"kindId\":2,\"examples\":[{\"content\":\"a flaw in a document\"},{\"content\":\"a flaw in someone\\u0027\\u0027s reasoning\"}]},{\"content\":\"vết nứt, chỗ rạn (thuỷ tinh, đồ sứ); vết (đá quý, kim loại...), khe hở (gỗ)\",\"kindId\":2,\"examples\":[]}],\"description\":\"flaw\",\"meaningMap\":{},\"timeStamp\":1296034137568}','flaw','/flɔː/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71843.mp3\', this)',1296034137568),
 (691,'{\"pron\":\"/gʌt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/g/gut/gut__/gut.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"phá huỷ bên trong\",\"kindId\":4,\"examples\":[{\"content\":\"a house gutted by fire\"}]},{\"content\":\"(số nhiều) (thông tục) cái bụng, cái thùng chứa (tượng trưng cho sự tham ăn, tham uống)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[usually passive] to completely destroy the inside of a building, especially by fire\",\"kindId\":9,\"examples\":[{\"content\":\"The building was completely gutted by fire.\"}]},{\"content\":\"(số nhiều) (thông tục) nội dung chính, phần có giá trị (của cái gì)\",\"kindId\":2,\"examples\":[{\"content\":\"guts of a speech\"}]},{\"content\":\" to change something by removing some of the most important or central parts\",\"kindId\":9,\"examples\":[]},{\"content\":\"rút ruột, rút gan; rút hết tinh tuý (một cuốn sách)\",\"kindId\":4,\"examples\":[]},{\"examples\":[{\"content\":\"the guts of the problem\"}],\"type\":\"gram\"},{\"content\":\" a reaction or feeling that you are sure is right, although you cannot give a reason for it\",\"kindId\":8,\"examples\":[{\"content\":\"He had a gut feeling that Sarah was lying.\"}]},{\"content\":\"have the guts (to do something)\",\"examples\":[{\"content\":\"No-one had the guts to tell Paul what a mistake he was making.\"}],\"type\":\"gram\"},{\"content\":\"moi ruột (một con vật)\",\"kindId\":4,\"examples\":[{\"content\":\"to gut a fish\"}]},{\"content\":\"ruột\",\"kindId\":2,\"examples\":[{\"content\":\"small gut\"},{\"content\":\"blind gut\"}]},{\"content\":\"(số nhiều) ruột, lòng (thú vật)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[plural] the most important or basic parts of something\",\"kindId\":8,\"examples\":[{\"content\":\"the guts of the problem\"}]},{\"content\":\"dây ruột mèo (dùng cho đàn viôlông); dây cước (để câu cá); chỉ khâu vết mổ\",\"kindId\":2,\"examples\":[]},{\"content\":\"đường hẻm nhỏ; cửa hẹp (sông, biển)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[plural] the parts inside a machine or piece of equipment\",\"kindId\":8,\"examples\":[]},{\"content\":\" if you know something at gut level, you feel sure about it, though you could not give a reason for it\",\"kindId\":8,\"examples\":[{\"content\":\"She knew at gut level that he was guilty.\"}]},{\"content\":\" to remove the organs from inside a fish or animal in order to prepare it for cooking\",\"kindId\":9,\"examples\":[]},{\"content\":\"[plural] all the organs in someone\\u0027\\u0027s body, especially when they have come out of their body\",\"kindId\":8,\"examples\":[{\"content\":\"There were blood and guts all over the place.\"},{\"content\":\"It can take 72 hours for food to pass through the gut.\"}]},{\"content\":\"sự can đảm, sự quyết tâm; (số nhiều) (thực vật học) sự gan góc, sự gan dạ, khí phách, tinh thần chịu đựng\",\"kindId\":2,\"examples\":[{\"content\":\"a fellow full of gut\"}]},{\"content\":\"tọng, nốc cho đầy\",\"kindId\":3,\"examples\":[]},{\"content\":\" used to say that you would like to punish someone severely for something they have done\",\"kindId\":8,\"examples\":[]},{\"content\":\"[plural] the courage and determination you need to do something difficult or unpleasant\",\"kindId\":8,\"examples\":[{\"content\":\"It takes guts to start a new business on your own.\"},{\"content\":\"No-one had the guts to tell Paul what a mistake he was making.\"}]},{\"content\":\"[uncountable] a type of strong string made from the intestine of an animal, and used for musical instruments such as violins\",\"kindId\":8,\"examples\":[]},{\"content\":\"[countable] someone\\u0027\\u0027s stomach, especially when it is large\",\"kindId\":8,\"examples\":[{\"content\":\"He felt as if someone had just kicked him in the gut.\"},{\"content\":\"Phil has a huge beer gut (\\u003dunattractive fat stomach caused by drinking too much beer).\"}]}],\"description\":\"gut\",\"meaningMap\":{},\"timeStamp\":1296034152870}','gut','/gʌt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/g/gut/gut__/gut.mp3\', this)',1296034152870),
 (692,'{\"pron\":\"/ˈhæb.ɪ.tæt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/hab/habit/habitat.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"môi trường sống, nơi sống (của cây cối động vật)\",\"kindId\":2,\"examples\":[]},{\"content\":\" the natural home of a plant or animal\",\"kindId\":8,\"examples\":[{\"content\":\"The grassland is an important habitat for many wild flowers.\"},{\"content\":\"watching monkeys in their natural habitat\"}]},{\"content\":\"nhà, chỗ ở (người)\",\"kindId\":2,\"examples\":[]}],\"description\":\"habitat\",\"meaningMap\":{},\"timeStamp\":1296034169100}','habitat','/ˈhæb.ɪ.tæt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/hab/habit/habitat.mp3\', this)',1296034169100),
