 (694,'{\"pron\":\"/ˌmæn.ɪ.fesˈteɪ.ʃən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/man/manif/manifestation.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"sự biểu lộ, sự biểu thị\",\"kindId\":2,\"examples\":[]},{\"content\":\"sự hiện hình (hồn ma)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[countable] a very clear sign that a particular situation or feeling exists\",\"kindId\":8,\"examples\":[{\"content\":\"These latest riots are a clear manifestation of growing discontent.\"}]},{\"content\":\"[uncountable and countable] the act of appearing or becoming clear\",\"kindId\":8,\"examples\":[{\"content\":\"Manifestation of the disease often doesn\\u0027\\u0027t occur until middle age.\"}]},{\"examples\":[{\"content\":\"Manifestation of the disease often doesn\\u0027\\u0027t occur until middle age.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"These latest riots are a clear manifestation of growing discontent.\"}],\"type\":\"gram\"},{\"content\":\"cuộc biểu tình, cuộc thị uy\",\"kindId\":2,\"examples\":[]}],\"description\":\"manifestation\",\"meaningMap\":{},\"timeStamp\":1296034187435}','manifestation','/ˌmæn.ɪ.fesˈteɪ.ʃən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/man/manif/manifestation.mp3\', this)',1296034187435),
