 (697,'{\"meanings\":[{\"content\":\"sự phật ý, sự bực bội\",\"kindId\":2,\"examples\":[]},{\"content\":\"feel/harbour/bear resentment\",\"examples\":[{\"content\":\"He felt considerable resentment towards Sheila for making him work late.\"}],\"type\":\"collo\"},{\"content\":\"sự phẫn uất, sự oán giận\",\"kindId\":2,\"examples\":[{\"content\":\"to bear (habour) resentment agaisnt someone for having done something\"}]},{\"content\":\" a feeling of anger because something has happened that you think is unfair\",\"kindId\":8,\"examples\":[{\"content\":\"She was filled with deep resentment at being passed over for promotion.\"},{\"content\":\"He felt considerable resentment towards Sheila for making him work late.\"}]},{\"examples\":[{\"content\":\"She was filled with deep resentment at being passed over for promotion.\"}],\"type\":\"gram\"}],\"description\":\"resentment\",\"meaningMap\":{},\"timeStamp\":1296034215322}','resentment',NULL,NULL,1296034215322),
