 (700,'{\"pron\":\"/ˈvæk.ju.əs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/vac/vacuo/vacuous.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"rỗi, vô công rồi nghề\",\"kindId\":1,\"examples\":[{\"content\":\"a selfish and vacuous life\"}]},{\"content\":\"trống rỗng; ngớ ngẩn; ngây dại\",\"kindId\":1,\"examples\":[{\"content\":\"a vacuous look\"},{\"content\":\"vacuous remark\"},{\"content\":\"a vacuous laugh\"}]},{\"content\":\"rỗng, trống rỗng\",\"kindId\":1,\"examples\":[{\"content\":\"a vacuous space\"}]},{\"content\":\" showing no intelligence or having no useful purpose\",\"kindId\":7,\"examples\":[{\"content\":\"a vacuous expression\"},{\"content\":\"a vacuous romantic novel\"}]}],\"description\":\"vacuous\",\"meaningMap\":{},\"timeStamp\":1296034240544}','vacuous','/ˈvæk.ju.əs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/vac/vacuo/vacuous.mp3\', this)',1296034240544),
 (701,'{\"pron\":\"/ˈwɔː.tər.i/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/w/wat/water/watery.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" if someone has a watery grave, they drown (\\u003ddie by breathing in water)\",\"kindId\":7,\"examples\":[]},{\"content\":\" full of water or relating to water\",\"kindId\":7,\"examples\":[{\"content\":\"Her eyes were red and watery from crying.\"},{\"content\":\"Snakes lay eggs in a watery environment.\"}]},{\"content\":\"nhạt nhẽo, vô vị\",\"kindId\":1,\"examples\":[{\"content\":\"watery style\"},{\"content\":\"watery talk\"}]},{\"content\":\" watery food or drink contains too much water and has little taste\",\"kindId\":7,\"examples\":[{\"content\":\"a bowl of watery stew\"}]},{\"content\":\"ướt, đẫm nước, sũng nước\",\"kindId\":1,\"examples\":[{\"content\":\"watery eyes\"},{\"content\":\"watery weather\"},{\"content\":\"watery clouds\"}]},{\"content\":\"bạc thếch (màu)\",\"kindId\":1,\"examples\":[{\"content\":\"watery colour\"}]},{\"content\":\"loãng, lỏng, nhạt\",\"kindId\":1,\"examples\":[{\"content\":\"watery soup\"}]},{\"content\":\" very weak or pale\",\"kindId\":7,\"examples\":[{\"content\":\"She gave him a watery smile.\"},{\"content\":\"a watery sun\"}]}],\"description\":\"watery\",\"meaningMap\":{},\"timeStamp\":1296034252026}','watery','/ˈwɔː.tər.i/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/w/wat/water/watery.mp3\', this)',1296034252026),
 (702,'{\"pron\":\"/əˈfeər /\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/aff/affai/affair.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a secret sexual relationship between two people, when at least one of them is married to someone else\",\"kindId\":8,\"examples\":[{\"content\":\"He had an affair with his boss that lasted six years.\"}]},{\"content\":\"(thông tục) cái, thứ, vật, đồ, món, chuyện\",\"kindId\":2,\"examples\":[{\"content\":\"this motor-cycle is a very complicated affair\"}]},{\"content\":\"việc buôn bán; việc giao thiệp\",\"kindId\":2,\"examples\":[{\"content\":\"to have an affair with somebody\"},{\"content\":\"a profitable affair\"}]},{\"content\":\"[plural] public or political events and activities\",\"kindId\":8,\"examples\":[{\"content\":\"I am not prepared to discuss my financial affairs with the press.\"},{\"content\":\"world affairs\"},{\"content\":\"the exclusion of women from public affairs\"},{\"content\":\"They were accused of interfering in China\\u0027\\u0027s internal affairs.\"},{\"content\":\"a foreign affairs correspondent for CNN\"}]},{\"content\":\"chuyện tình, chuyện yêu đương\",\"kindId\":2,\"examples\":[]},{\"content\":\"chuyện vấn đề\",\"kindId\":2,\"examples\":[{\"content\":\"affair of honour\"}]},{\"content\":\" used when describing an object, machine etc\",\"kindId\":8,\"examples\":[{\"content\":\"The computer was one of those little portable affairs.\"}]},{\"content\":\" if something is your affair, it only concerns you and you do not want anyone else to get involved in it\",\"kindId\":8,\"examples\":[{\"content\":\"What I do in my free time is my affair.\"}]},{\"content\":\"(số nhiều) công việc, việc làm, sự vụ\",\"kindId\":2,\"examples\":[{\"content\":\"Department of Home affair\"},{\"content\":\"Department of Foreign affairs\"},{\"content\":\"internal affair of a country\"}]},{\"content\":\" an event or set of related events, especially one that is impressive or shocking\",\"kindId\":8,\"examples\":[{\"content\":\"The party was a very grand affair.\"},{\"content\":\"The whole affair was a disaster.\"},{\"content\":\"the Watergate affair\"}]},{\"content\":\"việc\",\"kindId\":2,\"examples\":[{\"content\":\"mind your own affair\"},{\"content\":\"it\\u0027\\u0027s my affair\"}]},{\"content\":\"(quân sự) trận đánh nhỏ\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"He had an affair with his boss that lasted six years.\"}],\"type\":\"gram\"}],\"description\":\"affair\",\"meaningMap\":{},\"timeStamp\":1296034261922}','affair','/əˈfeər /','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/aff/affai/affair.mp3\', this)',1296034261922),
 (703,'{\"pron\":\"/dɪˈspjuːt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/d/dis/dispu/dispute.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"cãi nhau, đấu khẩu; bất hoà\",\"kindId\":3,\"examples\":[]},{\"content\":\"[intransitive and transitive] to argue or disagree with someone\",\"kindId\":9,\"examples\":[{\"content\":\"Hazlitt, though much younger, was soon disputing with Wordsworth on equal terms.\"},{\"content\":\"What happened next is hotly disputed.\"}]},{\"content\":\"cuộc cãi cọ; sự bất hoà, sự bất đồng ý kiến\",\"kindId\":2,\"examples\":[{\"content\":\"to settle a dispute\"}]},{\"content\":\"[transitive] to say that something such as a fact or idea is not correct or true\",\"kindId\":9,\"examples\":[{\"content\":\"Few would dispute that travel broadens the mind.\"},{\"content\":\"The main facts of the book have never been disputed.\"}]},{\"examples\":[{\"content\":\"the bitter border dispute between the countries\"}],\"type\":\"gram\"},{\"content\":\"chống lại, kháng cự lại\",\"kindId\":4,\"examples\":[{\"content\":\"to dispute the advance of the enemy\"},{\"content\":\"to dispute a landing\"}]},{\"content\":\"dispute that\",\"examples\":[{\"content\":\"Few would dispute that travel broadens the mind.\"}],\"type\":\"gram\"},{\"content\":\"tranh chấp\",\"kindId\":4,\"examples\":[{\"content\":\"to dispute every inch of ground\"}]},{\"examples\":[{\"content\":\"The firm is involved in a legal dispute with a rival company.\"}],\"type\":\"gram\"},{\"content\":\"[transitive] to try to get control of something or win something\",\"kindId\":9,\"examples\":[{\"content\":\"Soviet forces disputed every inch of ground.\"}]},{\"content\":\" if something is open to dispute, it is not completely certain and not everyone agrees about it\",\"kindId\":8,\"examples\":[{\"content\":\"His interpretation of the poem is open to dispute.\"}]},{\"content\":\"cuộc bàn cãi, cuộc tranh luận\",\"kindId\":2,\"examples\":[{\"content\":\"the matter is in dispute\"},{\"content\":\"to hold a dispute on\"},{\"content\":\"beyond (past, without) dispute\"}]},{\"content\":\"bàn cãi, tranh luận\",\"kindId\":3,\"examples\":[{\"content\":\"to dispute with (against) someone\"},{\"content\":\"to dispute on (about) a subject\"}]},{\"examples\":[{\"content\":\"He got into a dispute over a taxi fare.\"}],\"type\":\"gram\"},{\"content\":\"bàn cãi, tranh luận (một vấn đề)\",\"kindId\":4,\"examples\":[]},{\"content\":\" a serious argument or disagreement\",\"kindId\":8,\"examples\":[{\"content\":\"The police don\\u0027\\u0027t usually like to intervene in domestic disputes.\"},{\"content\":\"A dispute arose over who was to be the next king.\"},{\"content\":\"The coal industry was plagued by industrial disputes.\"},{\"content\":\"Every effort was made to settle the dispute, but without success.\"},{\"content\":\"The miners were in dispute with their employers over pay.\"},{\"content\":\"He got into a dispute over a taxi fare.\"},{\"content\":\"the bitter border dispute between the countries\"},{\"content\":\"A long-running pay dispute is disrupting rail services.\"},{\"content\":\"The firm is involved in a legal dispute with a rival company.\"}]},{\"content\":\" if something is beyond dispute, everyone agrees that it is true or that it really happened\",\"kindId\":8,\"examples\":[{\"content\":\"It is beyond dispute that advances in medicine have enabled people to live longer.\"}]},{\"content\":\"dispute (something) with somebody\",\"examples\":[{\"content\":\"Hazlitt, though much younger, was soon disputing with Wordsworth on equal terms.\"}],\"type\":\"gram\"},{\"content\":\"cuộc tranh chấp (giữa hai người...)\",\"kindId\":2,\"examples\":[]},{\"content\":\" if something is in dispute, people are arguing about it\",\"kindId\":8,\"examples\":[{\"content\":\"The facts of the case are still in dispute.\"}]}],\"description\":\"dispute\",\"meaningMap\":{},\"timeStamp\":1296034281318}','dispute','/dɪˈspjuːt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/d/dis/dispu/dispute.mp3\', this)',1296034281318),
 (704,'{\"pron\":\"/ɪˈræd.ɪ.keɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/era/eradi/eradicate.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"eradicate something from something\",\"examples\":[{\"content\":\"We can eradicate this disease from the world.\"}],\"type\":\"gram\"},{\"content\":\"trừ tiệt\",\"kindId\":4,\"examples\":[]},{\"content\":\"nhổ rễ\",\"kindId\":4,\"examples\":[]},{\"content\":\" to completely get rid of something such as a disease or a social problem\",\"kindId\":9,\"examples\":[{\"content\":\"an attempt to eradicate inflation\"},{\"content\":\"We can eradicate this disease from the world.\"},{\"content\":\"This problem has now been completely eradicated.\"}]}],\"description\":\"eradicate\",\"meaningMap\":{},\"timeStamp\":1296034289202}','eradicate','/ɪˈræd.ɪ.keɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/era/eradi/eradicate.mp3\', this)',1296034289202),
 (705,'{\"pron\":\"/fɔːˈgəʊ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/for/forgo/forgo.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to not do or have something pleasant or enjoyable\",\"kindId\":9,\"examples\":[{\"content\":\"I had to forgo lunch.\"}]},{\"content\":\"thôi, bỏ; kiêng\",\"kindId\":4,\"examples\":[{\"content\":\"to forgo wine\"}]}],\"description\":\"forgo\",\"meaningMap\":{},\"timeStamp\":1296034295185}','forgo','/fɔːˈgəʊ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/for/forgo/forgo.mp3\', this)',1296034295185),
 (706,'{\"pron\":\"/ˈgræt.ɪ.tjuːd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/g/gra/grati/gratitude.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"lòng biết ơn, sự nhớ ơn\",\"kindId\":2,\"examples\":[{\"content\":\"to express one\\u0027\\u0027s deep gratitude to somebody\"}]},{\"content\":\"with gratitude\",\"examples\":[{\"content\":\"She accepted his offer with gratitude.\"}],\"type\":\"gram\"},{\"content\":\"in gratitude for something\",\"examples\":[{\"content\":\"Will you let me take you out to dinner tomorrow in gratitude for what you\\u0027\\u0027ve done?\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"The committee expressed its gratitude for the contribution he had made.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"She had a deep gratitude towards David, but she did not love him.\"}],\"type\":\"gram\"},{\"content\":\" the feeling of being grateful\",\"kindId\":8,\"examples\":[{\"content\":\"She accepted his offer with gratitude.\"},{\"content\":\"She had a deep gratitude towards David, but she did not love him.\"},{\"content\":\"The committee expressed its gratitude for the contribution he had made.\"},{\"content\":\"Will you let me take you out to dinner tomorrow in gratitude for what you\\u0027\\u0027ve done?\"},{\"content\":\"Tears of gratitude filled her eyes.\"}]}],\"description\":\"gratitude\",\"meaningMap\":{},\"timeStamp\":1296034301017}','gratitude','/ˈgræt.ɪ.tjuːd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/g/gra/grati/gratitude.mp3\', this)',1296034301017),
 (707,'{\"pron\":\"/ˈhæg.l ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/hag/haggl/haggle.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to argue when you are trying to agree about the price of something\",\"kindId\":9,\"examples\":[{\"content\":\"Ted was haggling with the street vendors.\"},{\"content\":\"tourists haggling over the price of souvenirs\"}]},{\"content\":\"sự tranh cãi, sự cãi nhau\",\"kindId\":2,\"examples\":[]},{\"content\":\"sự mặc cả\",\"kindId\":2,\"examples\":[]},{\"content\":\"mặc cả\",\"kindId\":3,\"examples\":[]},{\"examples\":[{\"content\":\"Ted was haggling with the street vendors.\"}],\"type\":\"gram\"},{\"content\":\"tranh cãi, cãi nhau\",\"kindId\":3,\"examples\":[]},{\"examples\":[{\"content\":\"tourists haggling over the price of souvenirs\"}],\"type\":\"gram\"}],\"description\":\"haggle\",\"meaningMap\":{},\"timeStamp\":1296034308230}','haggle','/ˈhæg.l ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/hag/haggl/haggle.mp3\', this)',1296034308230),
 (708,'{\"pron\":\"/ˈleɪ.bər/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lab/labor/labor.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[always + adverb/preposition] to move slowly and with difficulty\",\"kindId\":9,\"examples\":[{\"content\":\"I could see the bus labouring up the steep, windy road.\"}]},{\"content\":\"đau khổ\",\"kindId\":3,\"examples\":[]},{\"examples\":[{\"content\":\"I\\u0027\\u0027ve been labouring over this report all morning.\"}],\"type\":\"gram\"},{\"content\":\"labour ward/room\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"gắng công, nỗ lực, dốc sức\",\"kindId\":3,\"examples\":[{\"content\":\"to labour at a task\"},{\"content\":\"to labour for the happiness of mankind\"}]},{\"content\":\"công việc, công việc nặng nhọc\",\"kindId\":2,\"examples\":[{\"content\":\"the labours of Hercules; Herculian labours\"},{\"content\":\"labour of great difficulty\"}]},{\"content\":\"lao động\",\"kindId\":2,\"examples\":[{\"content\":\"manual labour\"}]},{\"content\":\" to believe something that is not true\",\"kindId\":9,\"examples\":[{\"content\":\"She had laboured under the misconception that Bella liked her.\"}]},{\"content\":\"đau đẻ\",\"kindId\":2,\"examples\":[{\"content\":\"a woman in labour\"}]},{\"content\":\"[uncountable] work, especially physical work\",\"kindId\":8,\"examples\":[{\"content\":\"Workers withdrew their labour (\\u003dprotested by stopping work) for twenty-four hours.\"},{\"content\":\"The garage charges £30 an hour for labour.\"},{\"content\":\"Many women do hard manual labour (\\u003dwork with their hands).\"}]},{\"content\":\" to work hard\",\"kindId\":9,\"examples\":[{\"content\":\"Ray had little talent but labored to acquire the skills of a writer.\"},{\"content\":\"They laboured all day in the mills.\"},{\"content\":\"I\\u0027\\u0027ve been labouring over this report all morning.\"}]},{\"content\":\"dày công trau dồi; chuẩn bị kỹ lưỡng; bàn bạc chi tiết\",\"kindId\":4,\"examples\":[{\"content\":\"to labour a point\"}]},{\"content\":\"a long/short/difficult labour\",\"examples\":[],\"type\":\"collo\"},{\"content\":\" to describe or explain something in too much detail or when people have already understood it\",\"kindId\":9,\"examples\":[]},{\"content\":\"di chuyển chậm chạp, di chuyển khó khăn; lắc lư tròng trành trên biển động\",\"kindId\":3,\"examples\":[]},{\"content\":\"in labour\",\"examples\":[{\"content\":\"Meg was in labour for ten hours.\"}],\"type\":\"gram\"},{\"content\":\"labour to do something\",\"examples\":[{\"content\":\"Ray had little talent but labored to acquire the skills of a writer.\"}],\"type\":\"gram\"},{\"content\":\" something that is hard work but that you do because you want to\",\"kindId\":8,\"examples\":[]},{\"content\":\"(+ under) bị giày vò, quằn quại, chịu đau đớn; là nạn nhân của\",\"kindId\":3,\"examples\":[{\"content\":\"to labour under a delusion\"},{\"content\":\"to labour under a disease\"}]},{\"content\":\"[uncountable] all the people who work for a company or in a country\",\"kindId\":8,\"examples\":[{\"content\":\"produce grown by slave labor\"},{\"content\":\"Wages for unskilled labour are very low.\"},{\"content\":\"a shortage of skilled labor\"},{\"content\":\"the use of child labour\"},{\"content\":\"the changing role of mothers in the labour market\"},{\"content\":\"Labour shortages have forced the Japanese into making heavy use of industrial robots.\"},{\"content\":\"These countries are a source of cheap labour.\"},{\"content\":\"small commercial farmers who depend on a casual labour supply\"},{\"content\":\"We need to reduce our labour costs.\"}]},{\"content\":\"[singular, uncountable] the process of giving birth to a baby\",\"kindId\":8,\"examples\":[{\"content\":\"The labour pains were unbearable.\"},{\"content\":\"Meg was in labour for ten hours.\"},{\"content\":\"Diane went into labour at 2 o\\u0027\\u0027clock.\"}]},{\"content\":\" a period of hard work\",\"kindId\":8,\"examples\":[{\"content\":\"After several hours gardening we sat down to admire the results of our labours.\"}]},{\"content\":\"tầng lớp lao động, nhân công\",\"kindId\":2,\"examples\":[{\"content\":\"labour and capital\"},{\"content\":\"shortage of labour\"}]}],\"description\":\"labour\",\"meaningMap\":{},\"timeStamp\":1296034320071}','labour','/ˈleɪ.bər/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lab/labor/labor.mp3\', this)',1296034320071),
 (709,'{\"pron\":\"/ˈmer.ɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/mer/merit/merit.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"giá trị\",\"kindId\":2,\"examples\":[{\"content\":\"to make a merit of\"},{\"content\":\"a man of merit\"}]},{\"content\":\"[uncountable] a good quality that makes someone or something deserve praise\",\"kindId\":8,\"examples\":[{\"content\":\"There is never any merit in being second best.\"},{\"content\":\"The suggestion has some merit.\"},{\"content\":\"Students are selected solely on merit (\\u003dbecause they are good).\"},{\"content\":\"a film lacking any artistic merit\"}]},{\"examples\":[{\"content\":\"The merit of the report is its realistic assessment of the changes required.\"},{\"content\":\"The film has the merit of being short.\"},{\"content\":\"The great merit of the project is its flexibility and low cost.\"}],\"type\":\"gram\"},{\"content\":\"artistic/literary merit\",\"examples\":[{\"content\":\"a film lacking any artistic merit\"}],\"type\":\"collo\"},{\"content\":\" to judge something only on what you see when you look at it rather than on what you know from other people or things\",\"kindId\":8,\"examples\":[{\"content\":\"It\\u0027\\u0027s important to judge each case on its merits.\"}]},{\"content\":\"have (some) merit/be of merit\",\"examples\":[{\"content\":\"The suggestion has some merit.\"}],\"type\":\"collo\"},{\"content\":\"on merit\",\"examples\":[{\"content\":\"Students are selected solely on merit (\\u003dbecause they are good).\"}],\"type\":\"gram\"},{\"content\":\"đáng, xứng đáng\",\"kindId\":4,\"examples\":[{\"content\":\"to merit reward\"}]},{\"content\":\"((thường) số nhiều) công tội; (pháp lý) kẽ phải trái\",\"kindId\":2,\"examples\":[{\"content\":\"to decide a case on its merits\"}]},{\"content\":\"công, công lao, công trạng\",\"kindId\":2,\"examples\":[]},{\"content\":\" to be good, important, or serious enough for praise or attention\",\"kindId\":9,\"examples\":[{\"content\":\"It\\u0027\\u0027s a fascinating book which merits attention.\"},{\"content\":\"The results have been encouraging enough to merit further investigation.\"}]},{\"content\":\"[countable] an advantage or good feature of something\",\"kindId\":8,\"examples\":[{\"content\":\"Each of these approaches to teaching has its merits.\"},{\"content\":\"The great merit of the project is its flexibility and low cost.\"},{\"content\":\"Tonight\\u0027\\u0027s meeting will weigh up the relative merits of the two candidates.\"},{\"content\":\"The merit of the report is its realistic assessment of the changes required.\"},{\"content\":\"The film has the merit of being short.\"}]}],\"description\":\"merit\",\"meaningMap\":{},\"timeStamp\":1296034331332}','merit','/ˈmer.ɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/mer/merit/merit.mp3\', this)',1296034331332);
