 (710,'{\"pron\":\"/næg/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/n/nag/nag__/nag.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a horse, especially one that is old or in bad condition\",\"kindId\":8,\"examples\":[]},{\"content\":\"nag somebody to do something\",\"examples\":[{\"content\":\"Nadia\\u0027\\u0027s been nagging me to fix the lamp.\"}],\"type\":\"gram\"},{\"content\":\"con ngựa nhỏ\",\"kindId\":2,\"examples\":[]},{\"content\":\"nag somebody about something\",\"examples\":[{\"content\":\"She keeps nagging me about my weight.\"}],\"type\":\"gram\"},{\"content\":\" to make someone feel continuously worried or uncomfortable\",\"kindId\":9,\"examples\":[{\"content\":\"a problem that had been nagging at him for days\"},{\"content\":\"One question still nagged me.\"}]},{\"content\":\" to keep asking someone to do something, or to keep complaining to someone about their behaviour, in an annoying way\",\"kindId\":9,\"examples\":[{\"content\":\"I wish you\\u0027\\u0027d stop nagging!\"},{\"content\":\"Nadia\\u0027\\u0027s been nagging me to fix the lamp.\"},{\"content\":\"He\\u0027\\u0027s always nagging at Paula for wearing too much makeup.\"},{\"content\":\"She keeps nagging me about my weight.\"}]},{\"content\":\" a person who keeps complaining or asking someone to do something, in an annoying way\",\"kindId\":8,\"examples\":[{\"content\":\"Don\\u0027\\u0027t be such a nag!\"}]},{\"content\":\"mè nheo, rầy la\",\"kindId\":0,\"examples\":[{\"content\":\"to be always nag give at somebody\"},{\"content\":\"to somebody into doing something\"}]},{\"examples\":[{\"content\":\"a problem that had been nagging at him for days\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"He\\u0027\\u0027s always nagging at Paula for wearing too much makeup.\"}],\"type\":\"gram\"}],\"description\":\"nag\",\"meaningMap\":{},\"timeStamp\":1296034345663}','nag','/næg/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/n/nag/nag__/nag.mp3\', this)',1296034345663),
 (711,'{\"pron\":\"/əˈpreʃ.ən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75249.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"political/racial/sexual etc oppression\",\"examples\":[{\"content\":\"They suffered years of political oppression.\"}],\"type\":\"collo\"},{\"content\":\"sự đàn áp, sự áp bức\",\"kindId\":2,\"examples\":[]},{\"content\":\" when someone treats a group of people unfairly or cruelly and prevents them from having the same rights as other people have\",\"kindId\":8,\"examples\":[{\"content\":\"They suffered years of political oppression.\"},{\"content\":\"the struggle against oppression\"}]}],\"description\":\"oppression\",\"meaningMap\":{},\"timeStamp\":1296034354548}','oppression','/əˈpreʃ.ən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75249.mp3\', this)',1296034354548),
 (712,'{\"pron\":\"/ˌrep.jʊˈteɪ.ʃən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/rep/reput/reputation.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"a good/bad reputation\",\"examples\":[{\"content\":\"a hotel with a good reputation for its food\"}],\"type\":\"collo\"},{\"content\":\"tiếng tốt, thanh danh, danh tiếng\",\"kindId\":2,\"examples\":[{\"content\":\"a scientist of world wide\"}]},{\"examples\":[{\"content\":\"In her last job she acquired a reputation as a troublemaker.\"}],\"type\":\"gram\"},{\"content\":\"tiếng (xấu, tốt...)\",\"kindId\":2,\"examples\":[{\"content\":\"he had the reputation of raching his tenants\"}]},{\"content\":\" the opinion that people have about someone or something because of what has happened in the past\",\"kindId\":8,\"examples\":[{\"content\":\"His approach had won him a reputation as a tough manager.\"},{\"content\":\"a hotel with a good reputation for its food\"},{\"content\":\"In her last job she acquired a reputation as a troublemaker.\"},{\"content\":\"Judge Kelso has a reputation for being strict but fair.\"},{\"content\":\"The service at Heron Lodge failed to live up to its reputation (\\u003dbe as good or bad as people say it is).\"}]},{\"examples\":[{\"content\":\"Judge Kelso has a reputation for being strict but fair.\"}],\"type\":\"gram\"},{\"content\":\"earn/gain/establish a reputation as something\",\"examples\":[{\"content\":\"His approach had won him a reputation as a tough manager.\"}],\"type\":\"collo\"}],\"description\":\"reputation\",\"meaningMap\":{},\"timeStamp\":1296034360625}','reputation','/ˌrep.jʊˈteɪ.ʃən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/rep/reput/reputation.mp3\', this)',1296034360625),
 (713,'{\"pron\":\"/ˈstɪp.jʊ.leɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/s/sti/stipu/stipulate.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"quy định, đặt điều kiện\",\"kindId\":4,\"examples\":[]},{\"content\":\"stipulate that\",\"examples\":[{\"content\":\"The regulations stipulate that everything has to comply to the relevant safety standards.\"}],\"type\":\"gram\"},{\"content\":\" if an agreement, law, or rule stipulates something, it must be done\",\"kindId\":9,\"examples\":[{\"content\":\"The regulations stipulate that everything has to comply to the relevant safety standards.\"},{\"content\":\"Laws stipulate the maximum interest rate that banks can charge.\"}]},{\"content\":\"(+ for) qui định (thành điều khoản), ước định (thành điều khoản)\",\"kindId\":3,\"examples\":[]}],\"description\":\"stipulate\",\"meaningMap\":{},\"timeStamp\":1296034369317}','stipulate','/ˈstɪp.jʊ.leɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/s/sti/stipu/stipulate.mp3\', this)',1296034369317),
 (714,'{\"pron\":\"/ˈtretʃ.ər.əs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/tre/treac/treacherous.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" ground, roads, weather conditions etc that are treacherous are particularly dangerous because you cannot see the dangers very easily\",\"kindId\":7,\"examples\":[{\"content\":\"treacherous mountain roads\"},{\"content\":\"Strong winds and loose rocks made climbing treacherous.\"}]},{\"content\":\"không tin được, dối trá, xảo trá\",\"kindId\":1,\"examples\":[{\"content\":\"memory\"},{\"content\":\"treacherous smile\"},{\"content\":\"treacherous weather\"},{\"content\":\"treacherousice\"}]},{\"content\":\"phản bội, phụ bạc, bội bạc\",\"kindId\":1,\"examples\":[{\"content\":\"treacherous man\"}]},{\"content\":\" someone who is treacherous cannot be trusted because they are not loyal and secretly intend to harm you\",\"kindId\":7,\"examples\":[{\"content\":\"a sly and treacherous woman\"},{\"content\":\"a treacherous plot to overthrow the leader\"}]}],\"description\":\"treacherous\",\"meaningMap\":{},\"timeStamp\":1296034377118}','treacherous','/ˈtretʃ.ər.əs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/tre/treac/treacherous.mp3\', this)',1296034377118),
 (715,'{\"pron\":\"/ˌʌn.dəˈkʌt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74710.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(thể dục,thể thao) cắt (bóng)\",\"kindId\":4,\"examples\":[]},{\"content\":\"(nghệ thuật) chạm trổ\",\"kindId\":4,\"examples\":[]},{\"content\":\"thịt thăn (bò)\",\"kindId\":2,\"examples\":[]},{\"content\":\"(thương nghiệp) bỏ thầu rẻ hơn; đưa ra giá rẻ hơn, đưa ra điều kiện dễ hơn (người cạnh tranh)\",\"kindId\":4,\"examples\":[]},{\"content\":\" to make something weaker or less effective\",\"kindId\":9,\"examples\":[{\"content\":\"Is a lack of self-confidence undercutting your performance at work?\"}]},{\"content\":\"(thể dục,thể thao) cú đấm móc (quyền Anh)\",\"kindId\":2,\"examples\":[]},{\"content\":\" to sell goods or a service at a lower price than another company\",\"kindId\":9,\"examples\":[{\"content\":\"Online bookstores can undercut retailers by up to 30%.\"}]}],\"description\":\"undercut\",\"meaningMap\":{},\"timeStamp\":1296034385085}','undercut','/ˌʌn.dəˈkʌt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74710.mp3\', this)',1296034385085),
 (716,'{\"pron\":\"/veɪn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/vai/vain_/vain.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"vô hiệu, không có kết quả, vô ích\",\"kindId\":1,\"examples\":[{\"content\":\"vain efforts\"}]},{\"content\":\"phù phiếm\",\"kindId\":1,\"examples\":[{\"content\":\"vain man\"}]},{\"content\":\"tự phụ, tự đắc\",\"kindId\":1,\"examples\":[{\"content\":\"to be vain of\"}]},{\"content\":\" without success in spite of your efforts\",\"kindId\":7,\"examples\":[{\"content\":\"Altman swore that his son\\u0027\\u0027s death would not be in vain.\"},{\"content\":\"Police searched in vain for the missing gunman.\"}]},{\"content\":\"vain attempt/effort/bid\",\"examples\":[{\"content\":\"The young mother died in a vain attempt to save her drowning son.\"}],\"type\":\"collo\"},{\"content\":\" someone who is vain is too proud of their good looks, abilities, or position - used to show disapproval\",\"kindId\":7,\"examples\":[{\"content\":\"Men can be just as vain as women.\"}]},{\"content\":\" a threat, promise etc that is not worrying because the person cannot do what they say they will\",\"kindId\":7,\"examples\":[]},{\"content\":\"rỗng, rỗng tuếch\",\"kindId\":1,\"examples\":[{\"content\":\"vain words\"}]},{\"content\":\" a vain attempt, hope or search fails to achieve the result you wanted\",\"kindId\":7,\"examples\":[{\"content\":\"The young mother died in a vain attempt to save her drowning son.\"}]},{\"content\":\"hão, hão huyền\",\"kindId\":1,\"examples\":[{\"content\":\"vain promises\"}]}],\"description\":\"vain\",\"meaningMap\":{},\"timeStamp\":1296034393778}','vain','/veɪn/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/vai/vain_/vain.mp3\', this)',1296034393778),
 (717,'{\"pron\":\"/ˈweɪ.vər/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/w/wav/waver/waver.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"rung rinh, chập chờn (ngọn lửa); rung rung (giọng nói)\",\"kindId\":3,\"examples\":[{\"content\":\"wavering flames\"}]},{\"content\":\"(quân sự) nao núng, núng thế\",\"kindId\":3,\"examples\":[{\"content\":\"the line of enemy troops wavered and then broke\"}]},{\"examples\":[{\"content\":\"Harris never wavered in his loyalty.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"We were determined not to waver from our goals.\"}],\"type\":\"gram\"},{\"content\":\" to become weaker or less certain\",\"kindId\":9,\"examples\":[{\"content\":\"Harris never wavered in his loyalty.\"},{\"content\":\"Her voice wavered uncertainly.\"},{\"content\":\"The students\\u0027\\u0027 attention did not waver.\"},{\"content\":\"We were determined not to waver from our goals.\"}]},{\"content\":\" to not make a decision because you have doubts\",\"kindId\":9,\"examples\":[{\"content\":\"The party wavered between free trade and protectionism.\"},{\"content\":\"Shareholders who were wavering met the directors.\"}]},{\"content\":\" to move gently in several different directions\",\"kindId\":9,\"examples\":[{\"content\":\"The candle flame wavered, throwing shadows on the wall.\"}]},{\"content\":\"waver between something and something\",\"examples\":[{\"content\":\"The party wavered between free trade and protectionism.\"}],\"type\":\"gram\"},{\"content\":\"(nghĩa bóng) lung lay, do dự, lưỡng lự, ngập ngừng; dao động\",\"kindId\":3,\"examples\":[{\"content\":\"to waver between two opinions\"}]}],\"description\":\"waver\",\"meaningMap\":{},\"timeStamp\":1296034400933}','waver','/ˈweɪ.vər/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/w/wav/waver/waver.mp3\', this)',1296034400933),
 (718,'{\"pron\":\"/æmˈfɪb.i.ən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/amp/amphi/amphibian.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(động vật học) động vật lưỡng cư\",\"kindId\":2,\"examples\":[]},{\"content\":\"(hàng không) thuỷ phi cơ\",\"kindId\":2,\"examples\":[]},{\"content\":\"(quân sự) xe tăng lội nước\",\"kindId\":2,\"examples\":[]},{\"content\":\"(động vật học) lưỡng cư, vừa ở cạn vừa ở nước\",\"kindId\":1,\"examples\":[]},{\"content\":\" animals such as frogs that can live both on land and in water\",\"kindId\":8,\"examples\":[]},{\"content\":\"(quân sự) lội nước (xe)\",\"kindId\":1,\"examples\":[{\"content\":\"an amphibian tank\"}]}],\"description\":\"amphibian\",\"meaningMap\":{},\"timeStamp\":1296034407323}','amphibian','/æmˈfɪb.i.ən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/amp/amphi/amphibian.mp3\', this)',1296034407323),
 (719,'{\"pron\":\"/bɔːld/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/b/bal/bald_/bald.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" not having enough of what usually covers something\",\"kindId\":7,\"examples\":[{\"content\":\"The car\\u0027\\u0027s tires are completely bald.\"}]},{\"content\":\"hói (đầu)\",\"kindId\":1,\"examples\":[]},{\"content\":\"trọc trụi\",\"kindId\":1,\"examples\":[{\"content\":\"bald bird\"},{\"content\":\"bald hill\"},{\"content\":\"bald tree\"}]},{\"content\":\"không che đậy; lộ liễu; phô bày ra rành rành (tật xấu khuyết điểm)\",\"kindId\":1,\"examples\":[]},{\"content\":\" having little or no hair on your head\",\"kindId\":7,\"examples\":[{\"content\":\"his shiny bald head\"},{\"content\":\"a bald man\"},{\"content\":\"Dad started going bald when he was in his thirties.\"},{\"content\":\"He combed his hair and tried to hide his bald patch (\\u003dpart of someone\\u0027\\u0027s head where there is no hair).\"}]},{\"content\":\"nghèo nàn, khô khan, tẻ (văn chương)\",\"kindId\":1,\"examples\":[]},{\"content\":\" a statement etc that is correct but gives no additional information to help you understand or accept what is said\",\"kindId\":7,\"examples\":[{\"content\":\"The bald truth was that Lori didn\\u0027\\u0027t love her husband anymore.\"}]},{\"content\":\"có lang trắng ở mặt (ngựa)\",\"kindId\":1,\"examples\":[]}],\"description\":\"bald\",\"meaningMap\":{},\"timeStamp\":1296034414983}','bald','/bɔːld/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/b/bal/bald_/bald.mp3\', this)',1296034414983),
 (720,'{\"pron\":\"/ˌdiː.mɑːˈkeɪ.ʃən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usd/usdel/usdelig021.mp3\\u0027, this)\",\"meanings\":[{\"examples\":[{\"content\":\"traditional lines of demarcation between medicine and surgery\"}],\"type\":\"gram\"},{\"content\":\"sự phân ranh giới\",\"kindId\":2,\"examples\":[{\"content\":\"line of demarcation\"}]},{\"content\":\" the point at which one area of work, responsibility etc ends and another begins\",\"kindId\":8,\"examples\":[{\"content\":\"traditional lines of demarcation between medicine and surgery\"}]},{\"examples\":[{\"content\":\"the exact demarcation of the north-south boundary\"}],\"type\":\"gram\"},{\"content\":\" the process of deciding on or marking the border between two areas of land\",\"kindId\":8,\"examples\":[{\"content\":\"the exact demarcation of the north-south boundary\"}]}],\"description\":\"demarcation\",\"meaningMap\":{},\"timeStamp\":1296034420974}','demarcation','/ˌdiː.mɑːˈkeɪ.ʃən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usd/usdel/usdelig021.mp3\', this)',1296034420974),
 (721,'{\"pron\":\"/ɪˈstiːm/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/est/estee/esteem.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"coi là, cho là\",\"kindId\":4,\"examples\":[{\"content\":\"to esteem it as a favour\"}]},{\"content\":\" a feeling of respect for someone, or a good opinion of someone\",\"kindId\":8,\"examples\":[{\"content\":\"The critics held him in high esteem as an actor.\"},{\"content\":\"my father\\u0027\\u0027s complete lack of esteem for actors\"},{\"content\":\"Please accept the small gift we enclose as a mark of our esteem.\"}]},{\"content\":\"sự kính mến, sự quý trọng\",\"kindId\":2,\"examples\":[{\"content\":\"to hold someone in high esteem\"}]},{\"content\":\"kính mến, quý trọng\",\"kindId\":4,\"examples\":[]},{\"content\":\"token/mark of somebody\\u0027\\u0027\\u0027\\u0027s esteem\",\"examples\":[{\"content\":\"Please accept the small gift we enclose as a mark of our esteem.\"}],\"type\":\"collo\"},{\"content\":\" to respect and admire someone or something\",\"kindId\":9,\"examples\":[{\"content\":\"Peden was greatly esteemed by the people of Ayrshire.\"},{\"content\":\"He was esteemed as a literary wit.\"}]},{\"content\":\"hold somebody in high/great esteem\",\"examples\":[{\"content\":\"The critics held him in high esteem as an actor.\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"my father\\u0027\\u0027s complete lack of esteem for actors\"}],\"type\":\"gram\"}],\"description\":\"esteem\",\"meaningMap\":{},\"timeStamp\":1296034433973}','esteem','/ɪˈstiːm/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/est/estee/esteem.mp3\', this)',1296034433973),
 (722,'{\"pron\":\"/feɪθ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fai/faith/faith.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" intentions that are not honest or sincere\",\"kindId\":8,\"examples\":[]},{\"content\":\"have faith (in somebody/something)\",\"examples\":[{\"content\":\"\\u0027\\u0027Have faith, Alexandra,\\u0027\\u0027 he said.\"},{\"content\":\"I still have faith in him.\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"my faith in God\"}],\"type\":\"gram\"},{\"content\":\"vật làm tin, vật bảo đảm\",\"kindId\":2,\"examples\":[{\"content\":\"on the faith of\"}]},{\"content\":\"sự tin tưởng, sự tin cậy\",\"kindId\":2,\"examples\":[{\"content\":\"to oin one\\u0027\\u0027s faith upon something\"}]},{\"content\":\" something you do that shows you trust someone completely\",\"kindId\":8,\"examples\":[{\"content\":\"Allowing Ken to be in charge of the project was a total act of faith.\"}]},{\"content\":\"lời hứa, lời cam kết\",\"kindId\":2,\"examples\":[{\"content\":\"to break (violate) one\\u0027\\u0027s faith\"},{\"content\":\"to pledge (give) one\\u0027\\u0027s faith\"}]},{\"content\":\"sự trung thành; lòng trung thành, lòng trung thực\",\"kindId\":2,\"examples\":[{\"content\":\"bad faith\"},{\"content\":\"good faith\"}]},{\"content\":\"destroy/restore somebody\\u0027\\u0027\\u0027\\u0027s faith (in somebody/something)\",\"examples\":[{\"content\":\"It\\u0027\\u0027s really helped restore my faith in human nature.\"}],\"type\":\"collo\"},{\"content\":\"the Jewish/Muslim/Hindu etc faith\",\"examples\":[{\"content\":\"members of the Jewish faith\"}],\"type\":\"collo\"},{\"content\":\" to continue to support or believe in a person, organization, or idea\",\"kindId\":8,\"examples\":[]},{\"content\":\" to stop supporting or believing in a person, organization, or idea\",\"kindId\":8,\"examples\":[{\"content\":\"How could he tell them the truth without breaking faith with the Party?\"}]},{\"content\":\" honest and sincere intentions\",\"kindId\":8,\"examples\":[{\"content\":\"He proposed a second meeting as a sign of his good faith.\"},{\"content\":\"The woman who sold me the car claimed she had acted in good faith (\\u003dhad not meant to deceive me).\"}]},{\"content\":\"lose faith (in somebody/something)\",\"examples\":[{\"content\":\"The public has lost faith in the government.\"}],\"type\":\"collo\"},{\"content\":\"[uncountable] a strong feeling of trust or confidence in someone or something\",\"kindId\":8,\"examples\":[{\"content\":\"I still have faith in him.\"},{\"content\":\"\\u0027\\u0027Have faith, Alexandra,\\u0027\\u0027 he said.\"},{\"content\":\"The public has lost faith in the government.\"},{\"content\":\"It\\u0027\\u0027s really helped restore my faith in human nature.\"}]},{\"content\":\"[uncountable] belief and trust in God\",\"kindId\":8,\"examples\":[{\"content\":\"members of the Jewish faith\"},{\"content\":\"People from all faiths are welcome.\"},{\"content\":\"deep religious faith\"},{\"content\":\"my faith in God\"}]},{\"content\":\"niềm tin\",\"kindId\":2,\"examples\":[]}],\"description\":\"faith\",\"meaningMap\":{},\"timeStamp\":1296034441762}','faith','/feɪθ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fai/faith/faith.mp3\', this)',1296034441762),
 (723,'{\"pron\":\"/griːd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/g/gre/greed/greed.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"tính tham lam\",\"kindId\":2,\"examples\":[]},{\"content\":\" a strong desire for more food, money, power, possessions etc than you need\",\"kindId\":8,\"examples\":[{\"content\":\"people motivated by jealousy and greed\"}]},{\"content\":\"tính tham ăn, thói háu ăn\",\"kindId\":2,\"examples\":[]}],\"description\":\"greed\",\"meaningMap\":{},\"timeStamp\":1296034448665}','greed','/griːd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/g/gre/greed/greed.mp3\', this)',1296034448665),
 (724,'{\"pron\":\"/heɪl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/hai/hail_/hail.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"loạt, tràng dồn dập (như mưa); trận tới tấp\",\"kindId\":2,\"examples\":[{\"content\":\"a hail of bullets\"},{\"content\":\"a hail of questions\"}]},{\"content\":\"gọi, réo, hò (đò...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"mưa đá\",\"kindId\":3,\"examples\":[{\"content\":\"it hails\"}]},{\"content\":\"[transitive] to describe someone or something as being very good\",\"kindId\":9,\"examples\":[{\"content\":\"A young man is being hailed a hero tonight after rescuing two children.\"},{\"content\":\"Lang\\u0027\\u0027s first film was immediately hailed as a masterpiece.\"},{\"content\":\"The new service has been hailed a success.\"}]},{\"content\":\"lời gọi, lời réo\",\"kindId\":2,\"examples\":[{\"content\":\"out of hail\"},{\"content\":\"within hail\"}]},{\"content\":\"trút xuống (như mưa), giáng xuống (như mưa), đổ dồn xuống\",\"kindId\":4,\"examples\":[{\"content\":\"to hail down blows on someone\"},{\"content\":\"to hail curses on someone\"}]},{\"content\":\"đổ dồn (như mưa đá), trút xuống (như mưa đá), giáng xuống (như mưa)\",\"kindId\":3,\"examples\":[]},{\"content\":\" a lot of criticism etc\",\"kindId\":8,\"examples\":[{\"content\":\"The proposals met with a hail of criticism.\"}]},{\"content\":\"mưa đá\",\"kindId\":2,\"examples\":[]},{\"content\":\"chào\",\"kindId\":4,\"examples\":[]},{\"content\":\"be hailed something\",\"examples\":[{\"content\":\"A young man is being hailed a hero tonight after rescuing two children.\"},{\"content\":\"The new service has been hailed a success.\"}],\"type\":\"gram\"},{\"content\":\"lời chào\",\"kindId\":2,\"examples\":[]},{\"content\":\"tới (từ đâu)\",\"kindId\":3,\"examples\":[{\"content\":\"a ship hailing drom Shanghai\"}]},{\"content\":\"[transitive] to call to someone in order to greet them or try to attract their attention\",\"kindId\":9,\"examples\":[{\"content\":\"She leaned out of the window and hailed a passerby.\"},{\"content\":\"The hotel doorman will hail a cab for you.\"}]},{\"content\":\" if it hails, small balls of ice fall like rain\",\"kindId\":9,\"examples\":[{\"content\":\"It\\u0027\\u0027s windy and hailing outside.\"}]},{\"content\":\"hail a cab/taxi\",\"examples\":[{\"content\":\"The hotel doorman will hail a cab for you.\"}],\"type\":\"collo\"},{\"content\":\"[uncountable] frozen rain drops which fall as hard balls of ice\",\"kindId\":8,\"examples\":[{\"content\":\"heavy showers of rain and hail\"}]},{\"content\":\"chào!\",\"examples\":[]},{\"content\":\"hail somebody/something as something\",\"examples\":[{\"content\":\"Lang\\u0027\\u0027s first film was immediately hailed as a masterpiece.\"}],\"type\":\"gram\"},{\"content\":\" a large number of bullets, stones etc that are thrown or fired at someone\",\"kindId\":8,\"examples\":[{\"content\":\"The aircraft were met by a hail of gunfire.\"}]},{\"content\":\" to have been born in a particular place\",\"kindId\":9,\"examples\":[{\"content\":\"And where do you hail from?\"}]},{\"content\":\"hoan hô, hoan nghênh\",\"kindId\":4,\"examples\":[{\"content\":\"the crowd hailed the combatants of the liberation forces\"}]}],\"description\":\"hail\",\"meaningMap\":{},\"timeStamp\":1296034460020}','hail','/heɪl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/hai/hail_/hail.mp3\', this)',1296034460020),
 (725,'{\"pron\":\"/ˌɪn.təˈspɜːs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72550.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"rắc, rải\",\"kindId\":4,\"examples\":[]},{\"content\":\" to put something in between pieces of speech or writing, parts of a film etc\",\"kindId\":9,\"examples\":[]},{\"content\":\" if something is interspersed with a particular kind of thing, it has a lot of them in it\",\"kindId\":9,\"examples\":[{\"content\":\"sunny periods interspersed with showers\"}]}],\"description\":\"intersperse\",\"meaningMap\":{},\"timeStamp\":1296034466051}','intersperse','/ˌɪn.təˈspɜːs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72550.mp3\', this)',1296034466051),
 (726,'{\"pron\":\"/ˈleɪ.dən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lad/laden/laden.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"chất đầy, nặng trĩu\",\"kindId\":1,\"examples\":[{\"content\":\"a cart laden with goods\"},{\"content\":\"a tree laden with fruit\"},{\"content\":\"a mind laden with frief\"}]},{\"examples\":[{\"content\":\"She was laden with doubts about the affair.\"},{\"content\":\"trucks laden with equipment\"}],\"type\":\"gram\"},{\"content\":\"fully/heavily laden\",\"examples\":[{\"content\":\"The lorry was fully laden.\"}],\"type\":\"collo\"},{\"content\":\" heavily loaded with something, or containing a lot of something\",\"kindId\":7,\"examples\":[{\"content\":\"The lorry was fully laden.\"},{\"content\":\"snow-laden branches\"},{\"content\":\"The tables were laden with food.\"}]},{\"examples\":[{\"content\":\"The tables were laden with food.\"}],\"type\":\"gram\"},{\"content\":\" having a lot of a particular quality, thing etc\",\"kindId\":7,\"examples\":[{\"content\":\"a debt-laden company\"},{\"content\":\"She was laden with doubts about the affair.\"},{\"content\":\"trucks laden with equipment\"}]}],\"description\":\"laden\",\"meaningMap\":{},\"timeStamp\":1296034472037}','laden','/ˈleɪ.dən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lad/laden/laden.mp3\', this)',1296034472037),
 (727,'{\"pron\":\"/ˈmaɪ.grənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/mig/migra/migrant.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"chim di trú\",\"kindId\":2,\"examples\":[]},{\"content\":\" a bird or animal that travels regularly from one part of the world to another\",\"kindId\":8,\"examples\":[]},{\"content\":\"economic migrant\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"người di trú\",\"kindId\":2,\"examples\":[]},{\"content\":\"di trú\",\"kindId\":1,\"examples\":[{\"content\":\"migrant birds\"}]},{\"content\":\"migrant worker/labourer\",\"examples\":[{\"content\":\"A lot of factory work is done by migrant workers.\"}],\"type\":\"collo\"},{\"content\":\" someone who goes to live in another area or country, especially in order to find work\",\"kindId\":8,\"examples\":[{\"content\":\"A lot of factory work is done by migrant workers.\"}]}],\"description\":\"migrant\",\"meaningMap\":{},\"timeStamp\":1296034478479}','migrant','/ˈmaɪ.grənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/mig/migra/migrant.mp3\', this)',1296034478479),
 (728,'{\"pron\":\"/ˈneɪ.kɪd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/n/nak/naked/naked.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" weak and unable to protect yourself\",\"kindId\":7,\"examples\":[{\"content\":\"Standing in front on his first day of teaching, Brad felt completely naked.\"}]},{\"content\":\"không thêm bớt\",\"kindId\":1,\"examples\":[{\"content\":\"naked quotations\"}]},{\"content\":\" not wearing any clothes or not covered by clothes\",\"kindId\":7,\"examples\":[{\"content\":\"The children ran naked through the yard.\"},{\"content\":\"They found the body lying half naked in the grass.\"},{\"content\":\"The governor ordered the prisoner to be stripped naked and whipped.\"},{\"content\":\"a picture of a naked man\"}]},{\"content\":\" truth, self-interest, aggression etc that is not hidden and is shocking\",\"kindId\":7,\"examples\":[{\"content\":\"The President condemned the invasion as an act of naked aggression.\"}]},{\"content\":\"stark naked\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"không căn cứ\",\"kindId\":1,\"examples\":[{\"content\":\"naked faith\"}]},{\"content\":\" a light, flame etc that is not enclosed by a cover\",\"kindId\":7,\"examples\":[{\"content\":\"A naked light bulb dangled from the ceiling.\"}]},{\"content\":\" if you can see something with the naked eye, you can see it without using anything to help you, such as a telescope\",\"kindId\":7,\"examples\":[{\"content\":\"The mite is just visible to the naked eye.\"},{\"content\":\"Through his telescope he could see millions of stars that were invisible to the naked eye.\"}]},{\"content\":\"trụi, trơ trụi, rỗng không (bức tường, cây cối, cánh dồng)\",\"kindId\":1,\"examples\":[{\"content\":\"naked trees\"},{\"content\":\"a naked room\"}]},{\"content\":\"không che đậy, không giấu giếm, phô bày ra, hiển nhiên, rõ ràng\",\"kindId\":1,\"examples\":[{\"content\":\"the naked truth\"}]},{\"content\":\"visible to/with the naked eye\",\"examples\":[{\"content\":\"The mite is just visible to the naked eye.\"}],\"type\":\"collo\"},{\"content\":\"trần, trần truồng, khoả thân, loã lồ\",\"kindId\":1,\"examples\":[{\"content\":\"naked sword\"},{\"content\":\"stark naked\"}]}],\"description\":\"naked\",\"meaningMap\":{},\"timeStamp\":1296034486830}','naked','/ˈneɪ.kɪd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/n/nak/naked/naked.mp3\', this)',1296034486830),
 (729,'{\"pron\":\"/aʊl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75454.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(nghĩa bóng) người hay đi đêm\",\"kindId\":2,\"examples\":[]},{\"content\":\"(động vật học) con cú\",\"kindId\":2,\"examples\":[]},{\"content\":\"người có vẻ nghiêm nghị; người có vẻ quạu cọ\",\"kindId\":2,\"examples\":[]},{\"content\":\" a bird with large eyes that hunts at night\",\"kindId\":8,\"examples\":[]}],\"description\":\"owl\",\"meaningMap\":{},\"timeStamp\":1296034492906}','owl','/aʊl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75454.mp3\', this)',1296034492906),
 (730,'{\"pron\":\"/piːk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/p/pea/peak_/peak.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[always + adverb/preposition] if something peeks from somewhere, you can just see a small amount of it\",\"kindId\":9,\"examples\":[{\"content\":\"The moon peeked out from behind the clouds.\"}]},{\"examples\":[{\"content\":\"Paula opened the box and peeked inside.\"},{\"content\":\"Carefully he peeked through the glass window in the door.\"}],\"type\":\"gram\"},{\"content\":\" to look quickly at something, or to look at something from behind something else, especially something that you are not supposed to see\",\"kindId\":9,\"examples\":[{\"content\":\"Paula opened the box and peeked inside.\"},{\"content\":\"Carefully he peeked through the glass window in the door.\"},{\"content\":\"Shut your eyes and don\\u0027\\u0027t peek!\"}]},{\"content\":\"hé nhìn, lé nhìn\",\"kindId\":3,\"examples\":[]}],\"description\":\"peek\",\"meaningMap\":{},\"timeStamp\":1296034500897}','peek','/piːk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/p/pea/peak_/peak.mp3\', this)',1296034500897),
 (731,'{\"pron\":\"/ˈrel.ɪ.geɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/rel/releg/relegate.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to give someone or something a less important position than before\",\"kindId\":9,\"examples\":[{\"content\":\"Women tended to be relegated to typing and filing jobs.\"}]},{\"content\":\"giao cho (ai để quyết định hoặc thi hành...)\",\"kindId\":4,\"examples\":[{\"content\":\"to relegate matter to someone\"}]},{\"content\":\"relegate somebody/something to something\",\"examples\":[{\"content\":\"Women tended to be relegated to typing and filing jobs.\"}],\"type\":\"gram\"},{\"content\":\"đổi (viên chức) đi xa; đày ải\",\"kindId\":4,\"examples\":[]},{\"content\":\"hạ tầng\",\"kindId\":4,\"examples\":[{\"content\":\"to be relegated to an inferior position\"}]},{\"content\":\" if a sports team is relegated, it is moved into a lower division\",\"kindId\":9,\"examples\":[{\"content\":\"We were relegated to the Fourth Division last year.\"}]},{\"content\":\"loại bỏ, bỏ xó, bỏ riêng ra\",\"kindId\":4,\"examples\":[{\"content\":\"to relegate a worthless book to the wastepaper-basket\"}]},{\"content\":\"chuyển (ai) đến (nơi nào, người nào...) để tìm hiểu thêm\",\"kindId\":4,\"examples\":[]},{\"content\":\"relegate something/somebody to something\",\"examples\":[{\"content\":\"We were relegated to the Fourth Division last year.\"}],\"type\":\"gram\"}],\"description\":\"relegate\",\"meaningMap\":{},\"timeStamp\":1296034507647}','relegate','/ˈrel.ɪ.geɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/rel/releg/relegate.mp3\', this)',1296034507647),
 (732,'{\"pron\":\"/səbˈstæn.ʃəl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75957.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"có thực chất, thực tế\",\"kindId\":1,\"examples\":[{\"content\":\"substantial agreement\"}]},{\"content\":\"[only before noun] large and strongly made\",\"kindId\":7,\"examples\":[{\"content\":\"a substantial piece of furniture\"}]},{\"content\":\"chắc chắn, chắc nịch, vạm vỡ\",\"kindId\":1,\"examples\":[{\"content\":\"a man of substantial build\"}]},{\"content\":\"bổ, có chất (món ăn)\",\"kindId\":1,\"examples\":[]},{\"content\":\"quan trọng, trọng yếu, có giá trị thực sự, lớn lao\",\"kindId\":1,\"examples\":[{\"content\":\"substantial progress\"},{\"content\":\"substantial contribution\"}]},{\"content\":\"giàu có, có tài sản, trường vốn, vững về mặt tài chính\",\"kindId\":1,\"examples\":[{\"content\":\"substantial firms\"}]},{\"content\":\" large in amount or number\",\"kindId\":7,\"examples\":[{\"content\":\"The document requires substantial changes.\"},{\"content\":\"a substantial breakfast\"},{\"content\":\"We have the support of a substantial number of parents.\"},{\"content\":\"a substantial salary\"}]},{\"content\":\"thật, có thật\",\"kindId\":1,\"examples\":[]}],\"description\":\"substantial\",\"meaningMap\":{},\"timeStamp\":1296034515752}','substantial','/səbˈstæn.ʃəl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75957.mp3\', this)',1296034515752),
 (733,'{\"pron\":\"/ˈtɒl.ər.eɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/tol/toler/tolerate.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" if a plant tolerates particular weather or soil conditions, it can exist in them\",\"kindId\":9,\"examples\":[{\"content\":\"plants that tolerate drought\"}]},{\"content\":\"tha thứ, khoan thứ\",\"kindId\":4,\"examples\":[]},{\"content\":\"chịu đựng (sự đau đớn, nóng, lạnh...)\",\"kindId\":4,\"examples\":[]},{\"content\":\" if a person or their body can tolerate a food or other substance, it can use it without becoming ill\",\"kindId\":9,\"examples\":[{\"content\":\"Women\\u0027\\u0027s bodies can tolerate less alcohol than men\\u0027\\u0027s.\"}]},{\"content\":\" to allow people to do, say, or believe something without criticizing or punishing them\",\"kindId\":9,\"examples\":[{\"content\":\"We simply will not tolerate vigilante groups on our streets.\"}]},{\"content\":\" to be able to accept something unpleasant or difficult, even though you do not like it\",\"kindId\":9,\"examples\":[{\"content\":\"I couldn\\u0027\\u0027t tolerate the long hours.\"}]},{\"content\":\"(y học) chịu (thuốc)\",\"kindId\":4,\"examples\":[]}],\"description\":\"tolerate\",\"meaningMap\":{},\"timeStamp\":1296034523717}','tolerate','/ˈtɒl.ər.eɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/tol/toler/tolerate.mp3\', this)',1296034523717),
 (734,'{\"pron\":\"/ˌʌn.dəˈgəʊ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/und/under/undergo.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"chịu, bị, trải qua\",\"kindId\":4,\"examples\":[{\"content\":\"to undergo a great change\"},{\"content\":\"to undergo hard trials\"}]},{\"content\":\" if you undergo a change, an unpleasant experience etc, it happens to you or is done to you\",\"kindId\":9,\"examples\":[{\"content\":\"The country has undergone massive changes recently.\"},{\"content\":\"She has been undergoing tests since Monday.\"},{\"content\":\"Teachers should be expected to undergo mid-career training and development.\"},{\"content\":\"He has been released from prison to undergo medical treatment in the United States.\"}]}],\"description\":\"undergo\",\"meaningMap\":{},\"timeStamp\":1296034529713}','undergo','/ˌʌn.dəˈgəʊ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/und/under/undergo.mp3\', this)',1296034529713),
 (735,'{\"pron\":\"/vælv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/val/valve/valve.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a part of a tube or pipe that opens and shuts like a door to control the flow of liquid, gas, air etc passing through it\",\"kindId\":8,\"examples\":[{\"content\":\"heart valves\"}]},{\"content\":\"(kỹ thuật); (giải phẫu) van\",\"kindId\":2,\"examples\":[{\"content\":\"the valves of the heart\"},{\"content\":\"the valve of a bicycle tyre\"}]},{\"content\":\"(thực vật học); (động vật học) mảnh vỏ (quả đậu, vỏ sò...)\",\"kindId\":2,\"examples\":[]},{\"content\":\" the part on a trumpet or similar musical instrument that you press to change the sound of the note\",\"kindId\":8,\"examples\":[]},{\"content\":\"(âm nhạc) cần bấm\",\"kindId\":2,\"examples\":[]},{\"content\":\"rađiô đèn điện tử\",\"kindId\":2,\"examples\":[]},{\"content\":\"(kỹ thuật) lắp van\",\"kindId\":0,\"examples\":[]},{\"content\":\"kiểm tra bằng van\",\"kindId\":0,\"examples\":[]},{\"content\":\" a closed glass tube used to control the flow of electricity in old radios, televisions etc\",\"kindId\":8,\"examples\":[]}],\"description\":\"valve\",\"meaningMap\":{},\"timeStamp\":1296034536311}','valve','/vælv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/val/valve/valve.mp3\', this)',1296034536311),
 (736,'{\"pron\":\"/ˈweb.kɑːst/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/cus/cus02/cus02249.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" an event such as a musical performance which you can listen to or watch on the Internet\",\"kindId\":8,\"examples\":[]},{\"content\":\" to broadcast an event on the Internet, at the time the event happens\",\"kindId\":9,\"examples\":[{\"content\":\"Various local news sites plan to webcast each of the mayoral debates.\"}]}],\"description\":\"webcast\",\"meaningMap\":{},\"timeStamp\":1296034547928}','webcast','/ˈweb.kɑːst/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/cus/cus02/cus02249.mp3\', this)',1296034547928),
 (737,'{\"pron\":\"/ˈeə.ri.əl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/aer/aeria/aerial.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(thuộc) không khí; nhẹ như không khí\",\"kindId\":1,\"examples\":[]},{\"content\":\" from a plane\",\"kindId\":7,\"examples\":[{\"content\":\"an aerial attack\"},{\"content\":\"an aerial view of the Three Gorges Dam project\"},{\"content\":\"aerial photographs\"}]},{\"content\":\" a sport in which someone goes down a mountain on skis and performs complicated jumps and turns in the air\",\"kindId\":8,\"examples\":[]},{\"content\":\" a piece of equipment for receiving or sending radio or television signals, usually consisting of a piece of metal or wire\",\"kindId\":8,\"examples\":[]},{\"content\":\"không thực, tưởng tượng\",\"kindId\":1,\"examples\":[]},{\"content\":\"ở trên trời, trên không\",\"kindId\":1,\"examples\":[{\"content\":\"aerial fight\"}]},{\"content\":\"rađiô dây trời, dây anten\",\"kindId\":2,\"examples\":[]},{\"content\":\" in or moving through the air\",\"kindId\":7,\"examples\":[]}],\"description\":\"aerial\",\"meaningMap\":{},\"timeStamp\":1296034561431}','aerial','/ˈeə.ri.əl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/aer/aeria/aerial.mp3\', this)',1296034561431),
 (738,'{\"pron\":\"/bəˈlɪs.tɪk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usb/usbaf/usbaffl025.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to suddenly become very angry\",\"kindId\":7,\"examples\":[{\"content\":\"I couldn\\u0027\\u0027t believe it! She went ballistic just because there were peas in her pasta.\"}]},{\"content\":\"(quân sự) (thuộc) đạn đạo học, (thuộc) khoa đường đạn\",\"kindId\":1,\"examples\":[]}],\"description\":\"ballistic\",\"meaningMap\":{},\"timeStamp\":1296034568159}','ballistic','/bəˈlɪs.tɪk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usb/usbaf/usbaffl025.mp3\', this)',1296034568159),
 (739,'{\"pron\":\"/ˈkɒn.və.luː.tɪd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/con/convo/convoluted.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"quấn, xoắn\",\"kindId\":1,\"examples\":[]},{\"content\":\" having many twists and bends\",\"kindId\":7,\"examples\":[{\"content\":\"a tightly-coiled convoluted tube\"}]},{\"content\":\" complicated and difficult to understand\",\"kindId\":7,\"examples\":[{\"content\":\"long paragraphs and convoluted sentences\"},{\"content\":\"The argument is rather convoluted.\"}]}],\"description\":\"convoluted\",\"meaningMap\":{},\"timeStamp\":1296034574462}','convoluted','/ˈkɒn.və.luː.tɪd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/con/convo/convoluted.mp3\', this)',1296034574462),
 (740,'{\"meanings\":[{\"content\":\"distill something into something\",\"examples\":[{\"content\":\"The notes I had brought back were waiting to be distilled into a book.\"}],\"type\":\"gram\"},{\"content\":\"(hoá học) được cất\",\"kindId\":3,\"examples\":[]},{\"content\":\" to remove a chemical substance from a plant, for example by heating or pressing it\",\"kindId\":9,\"examples\":[]},{\"content\":\"để chảy nhỏ giọt\",\"kindId\":4,\"examples\":[]},{\"content\":\"chảy nhỏ giọt\",\"kindId\":3,\"examples\":[]},{\"content\":\" to get the main ideas or facts from a much larger amount of information\",\"kindId\":9,\"examples\":[{\"content\":\"The notes I had brought back were waiting to be distilled into a book.\"}]},{\"content\":\"(hoá học) cất\",\"kindId\":4,\"examples\":[]},{\"content\":\" to make a liquid such as water or alcohol more pure by heating it so that it becomes a gas and then letting it cool. Drinks such as whisky are made this way\",\"kindId\":9,\"examples\":[{\"content\":\"distilled water\"}]}],\"description\":\"distill\",\"meaningMap\":{},\"timeStamp\":1296034582548}','distill',NULL,NULL,1296034582548),
 (741,'{\"pron\":\"/ˈiː.lɒŋ.geɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/elo/elong/elongate.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(thực vật học) thon dài\",\"kindId\":1,\"examples\":[]},{\"content\":\" to become longer, or make something longer than normal\",\"kindId\":9,\"examples\":[{\"content\":\"Her legs were elongated by the very high heels which she wore.\"}]},{\"content\":\"làm dài ra, kéo dài ra\",\"kindId\":4,\"examples\":[]},{\"content\":\"(thực vật học) có hình thon dài\",\"kindId\":3,\"examples\":[]}],\"description\":\"elongate\",\"meaningMap\":{},\"timeStamp\":1296034588548}','elongate','/ˈiː.lɒŋ.geɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/elo/elong/elongate.mp3\', this)',1296034588548),
 (742,'{\"pron\":\"/fʌs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fus/fuss_/fuss.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"sự quan trọng hoá\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"Paul was fussing with his clothes, trying to get his tie straight.\"}],\"type\":\"gram\"},{\"content\":\" to behave in an unhappy or angry way\",\"kindId\":9,\"examples\":[{\"content\":\"The baby woke up and started to fuss.\"}]},{\"content\":\" to pay a lot of attention or too much attention to someone or something, especially to show that you are pleased with them or like them\",\"kindId\":9,\"examples\":[{\"content\":\"His aunts fussed over him all the time.\"}]},{\"content\":\"sự ồn ào, sự om sòm, sự rối rít; sự nhăng nhít, sự nhặng xị\",\"kindId\":2,\"examples\":[{\"content\":\"to kick up a fuss\"},{\"content\":\"to make a great fuss about trifles\"},{\"content\":\"to make a freat fuss about somebody\"}]},{\"content\":\"làm phiền, làm rầy (ai)\",\"kindId\":4,\"examples\":[]},{\"content\":\" anxious behaviour or activity that is usually about unimportant things\",\"kindId\":8,\"examples\":[{\"content\":\"The Steamatic enables you to clean any carpet with the minimum of fuss.\"},{\"content\":\"James said he\\u0027\\u0027d better be getting back or there\\u0027\\u0027d be a fuss.\"}]},{\"content\":\"làm ầm lên; rối rít; nhặng xị lên\",\"kindId\":3,\"examples\":[]},{\"content\":\" attention or excitement that is usually unnecessary or unwelcome\",\"kindId\":8,\"examples\":[{\"content\":\"They wanted a quiet wedding without any fuss.\"},{\"content\":\"Until I heard her sing I couldn\\u0027\\u0027t see what all the fuss was about (\\u003dwhy people liked it so much).\"}]},{\"content\":\"làm (ai) cuống quít\",\"kindId\":4,\"examples\":[]},{\"content\":\" to pay a lot of attention to someone or something, to show that you are pleased with them or like them\",\"kindId\":8,\"examples\":[{\"content\":\"Make a fuss of your dog when he behaves properly.\"}]},{\"content\":\" to pay too much attention to small unimportant details\",\"kindId\":9,\"examples\":[{\"content\":\"Paul was fussing with his clothes, trying to get his tie straight.\"}]},{\"content\":\" to complain or become angry about something, especially when this is not necessary\",\"kindId\":8,\"examples\":[{\"content\":\"Josie kicked up a fuss because the soup was too salty.\"},{\"content\":\"I don\\u0027\\u0027t know why you\\u0027\\u0027re making such a fuss about it.\"}]},{\"content\":\" to worry a lot about things that may not be very important\",\"kindId\":9,\"examples\":[{\"content\":\"I wish you\\u0027\\u0027d stop fussing - I\\u0027\\u0027ll be perfectly all right.\"}]}],\"description\":\"fuss\",\"meaningMap\":{},\"timeStamp\":1296034600431}','fuss','/fʌs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fus/fuss_/fuss.mp3\', this)',1296034600431),
 (743,'{\"pron\":\"/grəʊ ˈtesk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/g/gro/grote/grotesque.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"bức tranh kỳ cục, bức tượng kỳ cục\",\"kindId\":2,\"examples\":[]},{\"content\":\"[countable] a picture, sculpture etc of someone who is strangely ugly\",\"kindId\":8,\"examples\":[]},{\"content\":\" a grotesque style in art\",\"kindId\":8,\"examples\":[]},{\"content\":\" unpleasant, shocking, and offensive\",\"kindId\":7,\"examples\":[{\"content\":\"It\\u0027\\u0027s grotesque to portray peace campaigners as unpatriotic.\"},{\"content\":\"By modern standards, the treatment of prisoners was grotesque.\"}]},{\"content\":\" extremely ugly in a strange or unnatural way\",\"kindId\":7,\"examples\":[{\"content\":\"a grotesque figure with a huge head\"}]},{\"content\":\"lố bịch, kỳ cục\",\"kindId\":1,\"examples\":[{\"content\":\"grotesque manners\"}]}],\"description\":\"grotesque\",\"meaningMap\":{},\"timeStamp\":1296034614314}','grotesque','/grəʊ ˈtesk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/g/gro/grote/grotesque.mp3\', this)',1296034614314),
 (744,'{\"pron\":\"/həˌluː.sɪˈneɪ.ʃən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/hal/hallu/hallucination.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[uncountable and countable] something which you imagine you can see or hear, but which is not really there, or the experience of this\",\"kindId\":8,\"examples\":[{\"content\":\"The patients suffered hallucinations caused by the drug.\"}]},{\"content\":\"ảo giác\",\"kindId\":2,\"examples\":[]}],\"description\":\"hallucination\",\"meaningMap\":{},\"timeStamp\":1296034620958}','hallucination','/həˌluː.sɪˈneɪ.ʃən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/hal/hallu/hallucination.mp3\', this)',1296034620958),
 (745,'{\"pron\":\"/ɪnˈspaɪər/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72451.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"inspire somebody to do something\",\"examples\":[{\"content\":\"He inspired many young people to take up the sport.\"}],\"type\":\"gram\"},{\"content\":\" to give someone the idea for something, especially a story, painting, poem etc\",\"kindId\":9,\"examples\":[{\"content\":\"The story was inspired by a chance meeting with an old Russian duke.\"},{\"content\":\"a range of designs inspired by wild flowers\"}]},{\"content\":\"gây (tình cảm...) (cho ai); gây ra; xúi giục\",\"kindId\":4,\"examples\":[]},{\"content\":\"inspire somebody to something\",\"examples\":[{\"content\":\"I hope this success will inspire you to greater efforts.\"}],\"type\":\"gram\"},{\"content\":\"inspire confidence\",\"examples\":[{\"content\":\"The hospital\\u0027\\u0027s record does not inspire confidence.\"},{\"content\":\"His driving hardly inspires confidence.\"}],\"type\":\"collo\"},{\"content\":\" to breathe in\",\"kindId\":9,\"examples\":[]},{\"content\":\" to make someone have a particular feeling or react in a particular way\",\"kindId\":9,\"examples\":[{\"content\":\"The hospital\\u0027\\u0027s record does not inspire confidence.\"},{\"content\":\"His driving hardly inspires confidence.\"},{\"content\":\"Gandhi\\u0027\\u0027s quiet dignity inspired great respect.\"}]},{\"content\":\"hít vào, thở vào\",\"kindId\":4,\"examples\":[]},{\"content\":\"truyền (cảm hứng, ý nghĩ...); truyền cảm hứng cho (ai), gây cảm hứng cho (ai)\",\"kindId\":4,\"examples\":[]},{\"content\":\"(tôn giáo) linh cảm\",\"kindId\":4,\"examples\":[]},{\"content\":\" to encourage someone by making them feel confident and eager to do something\",\"kindId\":9,\"examples\":[{\"content\":\"We need someone who can inspire the team.\"},{\"content\":\"Inspired by the sunny weather, I decided to explore the woods.\"},{\"content\":\"He inspired many young people to take up the sport.\"},{\"content\":\"I hope this success will inspire you to greater efforts.\"}]}],\"description\":\"inspire\",\"meaningMap\":{},\"timeStamp\":1296034627511}','inspire','/ɪnˈspaɪər/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72451.mp3\', this)',1296034627511),
 (746,'{\"pron\":\"/ləˈment/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lam/lamen/lament.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"than van, rên rỉ, than khóc, kêu than\",\"kindId\":3,\"examples\":[]},{\"content\":\"lament the lack/absence/decline etc of something\",\"examples\":[{\"content\":\"Steiner lamented the lack of public interest in the issue.\"}],\"type\":\"collo\"},{\"content\":\"thương xót, xót xa, than khóc\",\"kindId\":4,\"examples\":[]},{\"content\":\"lament that\",\"examples\":[{\"content\":\"She lamented the fact that manufacturers did not produce small packs for single-person households.\"},{\"content\":\"He lamented that people had expected too much of him too soon.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"a lament for the dead\"}],\"type\":\"gram\"},{\"content\":\"[intransitive and transitive] to express feelings of great sadness about something\",\"kindId\":9,\"examples\":[{\"content\":\"The nation lamented the death of its great war leader.\"}]},{\"content\":\" a song, piece of music, or something that you say, that expresses a feeling of sadness\",\"kindId\":8,\"examples\":[{\"content\":\"A lone piper played a lament.\"},{\"content\":\"a lament for the dead\"}]},{\"content\":\"lời than van, lời rên rỉ\",\"kindId\":2,\"examples\":[]},{\"content\":\"bài ca ai oán, bài ca bi thảm\",\"kindId\":2,\"examples\":[]},{\"content\":\"[transitive] to express annoyance or disappointment about something you think is unsatisfactory or unfair\",\"kindId\":9,\"examples\":[{\"content\":\"She lamented the fact that manufacturers did not produce small packs for single-person households.\"},{\"content\":\"He lamented that people had expected too much of him too soon.\"},{\"content\":\"Steiner lamented the lack of public interest in the issue.\"}]}],\"description\":\"lament\",\"meaningMap\":{},\"timeStamp\":1296034638461}','lament','/ləˈment/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lam/lamen/lament.mp3\', this)',1296034638461),
 (747,'{\"meanings\":[{\"content\":\"hành động hào hiệp, hành động cao thượng\",\"kindId\":2,\"examples\":[]},{\"content\":\"tính hào hiệp, tính cao thượng ((cũng) magnanimousness)\",\"kindId\":2,\"examples\":[]}],\"description\":\"magnanimity\",\"meaningMap\":{},\"timeStamp\":1296034646153}','magnanimity',NULL,NULL,1296034646153),
 (748,'{\"meanings\":[{\"content\":\" relating to birth\",\"kindId\":7,\"examples\":[{\"content\":\"Green turtles return to their natal island to breed.\"}]},{\"content\":\"(thuộc) sinh\",\"kindId\":1,\"examples\":[{\"content\":\"natal day\"},{\"content\":\"natal place\"}]}],\"description\":\"natal\",\"meaningMap\":{},\"timeStamp\":1296034653628}','natal',NULL,NULL,1296034653628),
 (749,'{\"pron\":\"/əbˈses/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/uso/usobs/usobser002.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"ám ảnh\",\"kindId\":4,\"examples\":[{\"content\":\"to be obsessed by an idea\"}]},{\"content\":\"be obsessed by/with something/somebody\",\"examples\":[{\"content\":\"A lot of young girls are obsessed by their weight.\"}],\"type\":\"gram\"},{\"content\":\" to think about something or someone much more than is necessary or sensible\",\"kindId\":9,\"examples\":[{\"content\":\"Stop obsessing about your hair. It\\u0027\\u0027s fine.\"}]},{\"content\":\"[transitive usually passive] if something or someone obsesses you, you think or worry about them all the time and you cannot think about anything else - used to show disapproval\",\"kindId\":9,\"examples\":[{\"content\":\"A lot of young girls are obsessed by their weight.\"},{\"content\":\"Jody\\u0027\\u0027s been obsessed with some lifeguard for months.\"}]}],\"description\":\"obsess\",\"meaningMap\":{},\"timeStamp\":1296034659457}','obsess','/əbˈses/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/uso/usobs/usobser002.mp3\', this)',1296034659457),
 (750,'{\"pron\":\"/prɒkˈsɪm.ɪ.ti/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73763.mp3\\u0027, this)\",\"meanings\":[{\"examples\":[{\"content\":\"We chose the house for its proximity to the school.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"the proximity of the Bahamas to the States\"}],\"type\":\"gram\"},{\"content\":\"trạng thái gần (về không gian, thời gian...))\",\"kindId\":2,\"examples\":[{\"content\":\"proximity of blood\"}]},{\"content\":\" nearness in distance or time\",\"kindId\":8,\"examples\":[{\"content\":\"Here the rich and the poor live in close proximity (\\u003dvery near to each other).\"},{\"content\":\"We chose the house for its proximity to the school.\"},{\"content\":\"the proximity of the Bahamas to the States\"}]}],\"description\":\"proximity\",\"meaningMap\":{},\"timeStamp\":1296034665139}','proximity','/prɒkˈsɪm.ɪ.ti/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus73/eus73763.mp3\', this)',1296034665139),
 (751,'{\"pron\":\"/ˈrep.taɪl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/rep/repti/reptile.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(động vật học) loài bò sát\",\"kindId\":2,\"examples\":[]},{\"content\":\"người hèn hạ, người đê tiện; người luồn cúi, kẻ bợ đỡ, kẻ liếm gót\",\"kindId\":2,\"examples\":[]},{\"content\":\" a type of animal, such as a snake or lizard, whose body temperature changes according to the temperature around it, and that usually lays eggs to have babies\",\"kindId\":8,\"examples\":[]},{\"content\":\"bò\",\"kindId\":1,\"examples\":[]},{\"content\":\"(nghĩa bóng) hèn hạ, đê tiện; luồn cúi, bợ đỡ, liếm gót\",\"kindId\":1,\"examples\":[]},{\"content\":\" someone who is unpleasant or cannot be trusted\",\"kindId\":8,\"examples\":[]}],\"description\":\"reptile\",\"meaningMap\":{},\"timeStamp\":1296034672096}','reptile','/ˈrep.taɪl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/rep/repti/reptile.mp3\', this)',1296034672096),
 (752,'{\"pron\":\"/ˈsæn.ɪ.ti/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74063.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"sự lành mạnh (tinh thần)\",\"kindId\":2,\"examples\":[]},{\"content\":\"sự ôn hoà, sự đúng mực (quan điểm)\",\"kindId\":2,\"examples\":[]},{\"content\":\" when someone or something is being reasonable and sensible\",\"kindId\":8,\"examples\":[{\"content\":\"Sanity appears to be returning to the stock market.\"},{\"content\":\"I took a vacation to try to recover my sanity.\"}]},{\"content\":\" the condition of being mentally healthy\",\"kindId\":8,\"examples\":[{\"content\":\"I began to doubt his sanity.\"},{\"content\":\"She wondered if she was losing her sanity.\"}]},{\"content\":\"regain/get back/recover your sanity\",\"examples\":[{\"content\":\"I took a vacation to try to recover my sanity.\"}],\"type\":\"collo\"}],\"description\":\"sanity\",\"meaningMap\":{},\"timeStamp\":1296034678616}','sanity','/ˈsæn.ɪ.ti/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74063.mp3\', this)',1296034678616),
 (753,'{\"pron\":\"/ˈtent .ʃən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/ten/tensi/tension.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[countable usually plural, uncountable] the feeling that exists when people or countries do not trust each other and may suddenly attack each other or start arguing\",\"kindId\":8,\"examples\":[{\"content\":\"In those days, there was a great deal of racial tension on campus.\"},{\"content\":\"The obvious tension between Warren and Anne made everyone else uncomfortable.\"}]},{\"content\":\"[uncountable and countable] if there is tension between two things, there is a difference between the needs or influences of each, and that causes problems\",\"kindId\":8,\"examples\":[{\"content\":\"In business, there\\u0027\\u0027s always a tension between the needs of customers and shareholders.\"}]},{\"examples\":[{\"content\":\"In business, there\\u0027\\u0027s always a tension between the needs of customers and shareholders.\"}],\"type\":\"gram\"},{\"content\":\"sự căng\",\"kindId\":2,\"examples\":[]},{\"content\":\"political/racial/social etc tension\",\"examples\":[{\"content\":\"In those days, there was a great deal of racial tension on campus.\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"There was a lot of tension on the wire before it snapped.\"}],\"type\":\"gram\"},{\"content\":\"(điện học) điện áp\",\"kindId\":2,\"examples\":[]},{\"content\":\"[uncountable] tightness or stiffness in a wire, rope, muscle etc\",\"kindId\":8,\"examples\":[{\"content\":\"Tension in the neck muscles can cause headaches.\"},{\"content\":\"Muscle tension can be a sign of stress.\"}]},{\"content\":\"(vật lý) sức ép, áp lực (của hơi...)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[uncountable] the amount of force that stretches something\",\"kindId\":8,\"examples\":[{\"content\":\"This wire will take 50 pounds tension.\"},{\"content\":\"There was a lot of tension on the wire before it snapped.\"}]},{\"examples\":[{\"content\":\"The obvious tension between Warren and Anne made everyone else uncomfortable.\"}],\"type\":\"gram\"},{\"content\":\"[uncountable] a nervous worried feeling that makes it impossible for you to relax\",\"kindId\":8,\"examples\":[{\"content\":\"Exercise is the ideal way to relieve tension after a hard day.\"},{\"content\":\"The tension was becoming unbearable, and I wanted to scream.\"}]},{\"content\":\"reduce/relieve/ease etc tension\",\"examples\":[{\"content\":\"Exercise is the ideal way to relieve tension after a hard day.\"}],\"type\":\"collo\"},{\"content\":\"trạng thái căng (của dây...); (nghĩa bóng) tình hình căng thẳng, sự căng thẳng\",\"kindId\":2,\"examples\":[{\"content\":\"to ease tension\"}]}],\"description\":\"tension\",\"meaningMap\":{},\"timeStamp\":1296034688004}','tension','/ˈtent .ʃən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/ten/tensi/tension.mp3\', this)',1296034688004),
 (754,'{\"pron\":\"/ˌʌn.dəˈlaɪ.ɪŋ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74719.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"nằm dưới, dưới\",\"kindId\":1,\"examples\":[]},{\"content\":\" the cause, idea etc that is the most important, although it is not easily noticed\",\"kindId\":7,\"examples\":[{\"content\":\"the underlying causes of her depression\"},{\"content\":\"There is an underlying assumption that younger workers are easier to train.\"}]},{\"content\":\"(nghĩa bóng) cơ bản, cơ sở\",\"kindId\":1,\"examples\":[{\"content\":\"underlying principles\"}]}],\"description\":\"underlying\",\"meaningMap\":{},\"timeStamp\":1296034694514}','underlying','/ˌʌn.dəˈlaɪ.ɪŋ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74719.mp3\', this)',1296034694514);
