 (755,'{\"meanings\":[{\"content\":\"bốc hơi, lên hơi\",\"kindId\":3,\"examples\":[]},{\"content\":\"làm cho bốc hơi\",\"kindId\":4,\"examples\":[]},{\"content\":\"xì, bơm (nước hoa...)\",\"kindId\":4,\"examples\":[]}],\"description\":\"vaporized\",\"meaningMap\":{},\"timeStamp\":1296034703198}','vaporized',NULL,NULL,1296034703198),
 (756,'{\"pron\":\"/ˈæk.wɪ.dʌkt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/aqu/aqued/aqueduct.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"cống nước\",\"kindId\":2,\"examples\":[]},{\"content\":\"(giải phẫu) cống\",\"kindId\":2,\"examples\":[]},{\"content\":\" a structure like a bridge, that carries water across a river or valley\",\"kindId\":8,\"examples\":[]}],\"description\":\"aqueduct\",\"meaningMap\":{},\"timeStamp\":1296034719473}','aqueduct','/ˈæk.wɪ.dʌkt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/aqu/aqued/aqueduct.mp3\', this)',1296034719473),
 (757,'{\"pron\":\"/ˈbɑː.mi/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/b/bal/balmy/balmy.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"dịu, êm dịu (không khí, gió nhẹ)\",\"kindId\":1,\"examples\":[]},{\"content\":\"(từ lóng) gàn dở, điên rồ\",\"kindId\":1,\"examples\":[]},{\"content\":\" balmy air, weather etc is warm and pleasant\",\"kindId\":7,\"examples\":[{\"content\":\"a balmy summer night\"}]},{\"content\":\"thơm, thơm ngát\",\"kindId\":1,\"examples\":[]},{\"content\":\"làm dịu, làm khỏi (vết thương, bệnh...)\",\"kindId\":1,\"examples\":[]}],\"description\":\"balmy\",\"meaningMap\":{},\"timeStamp\":1296034726197}','balmy','/ˈbɑː.mi/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/b/bal/balmy/balmy.mp3\', this)',1296034726197),
 (758,'{\"pron\":\"/kəˈmɪt.i/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus70/eus70902.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[C also + plural verb British English] a group of people chosen to do a particular job, make decisions etc\",\"kindId\":8,\"examples\":[{\"content\":\"He\\u0027\\u0027s on the finance committee.\"},{\"content\":\"committee members\"},{\"content\":\"the International Committee of the Red Cross\"},{\"content\":\"a Ministerial committee on security affairs\"},{\"content\":\"a committee meeting\"}]},{\"content\":\"uỷ ban\",\"kindId\":2,\"examples\":[{\"content\":\"executive committee\"},{\"content\":\"standing committee\"}]},{\"examples\":[{\"content\":\"the International Committee of the Red Cross\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"a Ministerial committee on security affairs\"}],\"type\":\"gram\"},{\"content\":\"on a committee\",\"examples\":[{\"content\":\"He\\u0027\\u0027s on the finance committee.\"}],\"type\":\"gram\"}],\"description\":\"committee\",\"meaningMap\":{},\"timeStamp\":1296034733011}','committee','/kəˈmɪt.i/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus70/eus70902.mp3\', this)',1296034733011),
 (759,'{\"pron\":\"/dɪˈfɪʃ.ənt .si/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/d/def/defic/deficiency.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"sự thiếu hụt, sự không đầy đủ\",\"kindId\":2,\"examples\":[]},{\"content\":\"số tiền thiếu hụt; lượng thiếu hụt\",\"kindId\":2,\"examples\":[{\"content\":\"to make up a deficiency\"}]},{\"examples\":[{\"content\":\"a deficiency of safe play areas for children\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"There are deep deficiencies in this law.\"}],\"type\":\"gram\"},{\"content\":\" a lack of something that is necessary\",\"kindId\":8,\"examples\":[{\"content\":\"a deficiency of safe play areas for children\"},{\"content\":\"Some elderly people suffer from iron deficiency in their diet.\"}]},{\"content\":\"iron/vitamin etc deficiency\",\"examples\":[{\"content\":\"Some elderly people suffer from iron deficiency in their diet.\"}],\"type\":\"collo\"},{\"content\":\"sự thiếu sót, sự kém cỏi, sự bất tài\",\"kindId\":2,\"examples\":[]},{\"content\":\" a weakness or fault in something\",\"kindId\":8,\"examples\":[{\"content\":\"There are deep deficiencies in this law.\"}]},{\"content\":\"(toán học) số khuyết\",\"kindId\":2,\"examples\":[{\"content\":\"mental deficiency\"},{\"content\":\"deficiency of a curve\"},{\"content\":\"y deficiency disease\"}]}],\"description\":\"deficiency\",\"meaningMap\":{},\"timeStamp\":1296034738877}','deficiency','/dɪˈfɪʃ.ənt .si/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/d/def/defic/deficiency.mp3\', this)',1296034738877),
 (760,'{\"pron\":\"/ɪgˈzem.plɪ.faɪ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75724.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to give an example of something\",\"kindId\":9,\"examples\":[{\"content\":\"Problems are exemplified in the report.\"}]},{\"content\":\"sao (một văn kiện)\",\"kindId\":4,\"examples\":[]},{\"content\":\" to be a very typical example of something\",\"kindId\":9,\"examples\":[{\"content\":\"The building exemplifies the style of architecture which was popular at the time.\"}]},{\"content\":\"minh hoạ bằng thí dụ; làm thí dụ cho\",\"kindId\":4,\"examples\":[]}],\"description\":\"exemplify\",\"meaningMap\":{},\"timeStamp\":1296034744984}','exemplify','/ɪgˈzem.plɪ.faɪ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75724.mp3\', this)',1296034744984),
 (761,'{\"pron\":\"/ˈfʌn.əl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fun/funne/funnel.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"cái phễu\",\"kindId\":2,\"examples\":[]},{\"content\":\" a metal chimney that allows smoke from a steam engine or steam-ship to get out\",\"kindId\":8,\"examples\":[]},{\"content\":\" a thin tube with a wide top that you use for pouring liquid into a container with a narrow opening, such as a bottle\",\"kindId\":8,\"examples\":[]},{\"content\":\"ống khói (tàu thuỷ, xe lửa)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[transitive always + adverb/preposition] to send money, information etc from various places to someone\",\"kindId\":9,\"examples\":[{\"content\":\"His office funneled millions of dollars in secret contributions to the re-election campaign.\"}]},{\"content\":\"[intransitive,transitive always + adverb/preposition] if you funnel something somewhere, or if it funnels there, it goes there by passing through a narrow opening\",\"kindId\":9,\"examples\":[{\"content\":\"Incoming tides funnel up the channel with enormous power.\"},{\"content\":\"Police at the barriers funnelled the crowd into the arena.\"}]},{\"content\":\"phần dưới ống khói\",\"kindId\":2,\"examples\":[]}],\"description\":\"funnel\",\"meaningMap\":{},\"timeStamp\":1296034756815}','funnel','/ˈfʌn.əl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fun/funne/funnel.mp3\', this)',1296034756815),
 (762,'{\"pron\":\"/ˈgɑː.mənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/g/gar/garme/garment.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"outer/upper garment\",\"examples\":[{\"content\":\"The outer garment was a loose-fitting robe.\"}],\"type\":\"collo\"},{\"content\":\"garment industry/factory/district etc\",\"examples\":[{\"content\":\"She works in the garment district of Manhattan.\"}],\"type\":\"collo\"},{\"content\":\"áo quần\",\"kindId\":2,\"examples\":[{\"content\":\"nether garments\"}]},{\"content\":\" a piece of clothing\",\"kindId\":8,\"examples\":[{\"content\":\"The outer garment was a loose-fitting robe.\"},{\"content\":\"She works in the garment district of Manhattan.\"},{\"content\":\"She pulled the garment on and zipped it up.\"}]},{\"content\":\"vỏ ngoài, cái bọc ngoài\",\"kindId\":2,\"examples\":[]},{\"content\":\"mặc quần áo\",\"examples\":[]}],\"description\":\"garment\",\"meaningMap\":{},\"timeStamp\":1296034763947}','garment','/ˈgɑː.mənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/g/gar/garme/garment.mp3\', this)',1296034763947),
 (763,'{\"pron\":\"/hɒlt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72143.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to stop an activity from continuing\",\"kindId\":8,\"examples\":[{\"content\":\"I urge those responsible to call a halt to the violence.\"}]},{\"content\":\"đi ngập ngừng\",\"kindId\":3,\"examples\":[]},{\"content\":\"(từ cổ,nghĩa cổ) què, khập khểnh, tập tễnh\",\"kindId\":1,\"examples\":[]},{\"content\":\"sự tạm nghỉ, sự tạm dừng lại (trong lúc đang đi...)\",\"kindId\":2,\"examples\":[{\"content\":\"to call a halt\"},{\"content\":\"to come to a halt\"}]},{\"content\":\"(từ cổ,nghĩa cổ) đi khập khiễng, đi tập tễnh\",\"kindId\":3,\"examples\":[]},{\"content\":\"dừng chân, nghỉ chân\",\"kindId\":3,\"examples\":[]},{\"content\":\"come/grind/screech etc to a halt\",\"examples\":[{\"content\":\"The car skidded to a halt.\"},{\"content\":\"The whole peace process seems to have ground to a halt.\"}],\"type\":\"collo\"},{\"content\":\" used as a military order to tell someone to stop moving or soldiers to stop marching\",\"kindId\":9,\"examples\":[{\"content\":\"Company halt!\"},{\"content\":\"Halt! Who goes there?\"}]},{\"content\":\"[transitive] to prevent someone or something from continuing - used especially in news reports\",\"kindId\":9,\"examples\":[{\"content\":\"Safety concerns have led them to halt work on the dam.\"},{\"content\":\"The government has failed to halt economic decline.\"}]},{\"content\":\"[countable] a place in the countryside where a train stops to let passengers get off, but where there is no station\",\"kindId\":8,\"examples\":[]},{\"content\":\"[intransitive] to stop moving\",\"kindId\":9,\"examples\":[{\"content\":\"The parade halted by a busy corner.\"}]},{\"content\":\"ngập ngừng, lưỡng lự, do dự\",\"kindId\":3,\"examples\":[{\"content\":\"to halt between two opinions\"}]},{\"content\":\"cho dừng lại; bắt dừng lại\",\"kindId\":4,\"examples\":[]},{\"content\":\"[singular] a stop or pause\",\"kindId\":8,\"examples\":[{\"content\":\"The President has called for a halt to the wave of emigration.\"},{\"content\":\"The World Championship was brought to a temporary halt (\\u003dwas stopped from continuing).\"},{\"content\":\"The car skidded to a halt.\"},{\"content\":\"The whole peace process seems to have ground to a halt.\"},{\"content\":\"Heavy snowfalls brought traffic to a halt (\\u003dmade it stop moving).\"}]},{\"content\":\"(từ cổ,nghĩa cổ) sự đi khập khiễng, sự đi tập tễnh\",\"kindId\":2,\"examples\":[]},{\"content\":\"(ngành đường sắt) ga xép\",\"kindId\":2,\"examples\":[]},{\"content\":\"què quặt, không chỉnh (lý luận, của thơ...)\",\"kindId\":3,\"examples\":[]}],\"description\":\"halt\",\"meaningMap\":{},\"timeStamp\":1296034776120}','halt','/hɒlt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72143.mp3\', this)',1296034776120),
 (764,'{\"pron\":\"/ɪˈment .sli/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usl/usl30/usl30236.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(thông tục) rất nhiều\",\"kindId\":5,\"examples\":[]},{\"content\":\"rất, hết sức\",\"kindId\":5,\"examples\":[]},{\"content\":\"immensely powerful/strong/important etc\",\"examples\":[{\"content\":\"Nationalism is an immensely powerful force.\"}],\"type\":\"collo\"},{\"content\":\" very much\",\"kindId\":6,\"examples\":[{\"content\":\"We enjoyed the play immensely.\"},{\"content\":\"Champagne wines became immensely popular in the 18th century.\"},{\"content\":\"Nationalism is an immensely powerful force.\"}]}],\"description\":\"immensely\",\"meaningMap\":{},\"timeStamp\":1296034784116}','immensely','/ɪˈment .sli/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usl/usl30/usl30236.mp3\', this)',1296034784116),
 (765,'{\"pron\":\"/lænd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lan/land_/land.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[transitive] to catch a fish\",\"kindId\":9,\"examples\":[]},{\"content\":\" to cause someone to have serious problems or be in a difficult situation\",\"kindId\":9,\"examples\":[{\"content\":\"Connie\\u0027\\u0027s going to land herself in big trouble if she keeps arriving late for work.\"},{\"content\":\"She developed pneumonia which landed her in hospital.\"}]},{\"content\":\"[uncountable] the solid dry part of the Earth\\u0027\\u0027s surface\",\"kindId\":8,\"examples\":[{\"content\":\"The white stork is one of the biggest land birds of the region.\"},{\"content\":\"After 21 days at sea, we sighted land.\"},{\"content\":\"Troops began an assault on the city by land and sea.\"},{\"content\":\"The crocodile lays its eggs on land.\"}]},{\"content\":\" to succeed in hitting someone\",\"kindId\":9,\"examples\":[]},{\"content\":\"work/farm the land\",\"examples\":[{\"content\":\"Many people were forced to give up working the land.\"}],\"type\":\"collo\"},{\"content\":\"ghé vào bờ (tàu); hạ cánh (máy bay); xuống đất, xuống xe (người); lên bờ (từ dưới tàu)\",\"kindId\":3,\"examples\":[{\"content\":\"the plane landed safety\"},{\"content\":\"to land at Odessa\"}]},{\"content\":\" an imaginary place where life is easy and pleasant\",\"kindId\":8,\"examples\":[]},{\"content\":\"live off the land\",\"examples\":[{\"content\":\"A third of the region\\u0027\\u0027s population still lives off the land.\"}],\"type\":\"collo\"},{\"content\":\"dẫn đến, đưa đến, đẩy vào (một tình thế, một hoàn cảnh)\",\"kindId\":4,\"examples\":[{\"content\":\"extravagance will land a man in debt\"}]},{\"content\":\"đưa đi, giáng, đánh\",\"kindId\":4,\"examples\":[{\"content\":\"to land a ball in the goal\"},{\"content\":\"to land a blow in someone\\u0027\\u0027s eye\"}]},{\"content\":\"[transitive] to succeed in getting a job, contract etc that was difficult to get\",\"kindId\":9,\"examples\":[{\"content\":\"Bill\\u0027\\u0027s just landed himself a part in a Broadway show.\"},{\"content\":\"He landed a job with a law firm.\"}]},{\"content\":\"housing/industrial etc land\",\"examples\":[{\"content\":\"a shortage of housing land\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"Louis fell out of the tree and landed in a holly bush.\"},{\"content\":\"A couple of bombs landed quite near to the village.\"},{\"content\":\"A large branch landed on the hood of my car.\"},{\"content\":\"She fell and landed heavily on the floor.\"}],\"type\":\"gram\"},{\"content\":\"[uncountable] an area of ground, especially when used for farming or building\",\"kindId\":8,\"examples\":[{\"content\":\"a piece of open land (\\u003dland which has not been built on)\"},{\"content\":\"a shortage of housing land\"},{\"content\":\"500 acres of land\"},{\"content\":\"land prices\"}]},{\"content\":\"đất, đất trồng, đất đai\",\"kindId\":2,\"examples\":[{\"content\":\"barren land\"}]},{\"examples\":[{\"content\":\"In 1969, the first men landed on the moon.\"},{\"content\":\"We expect to be landing in Oslo in about fifty minutes.\"}],\"type\":\"gram\"},{\"content\":\"[uncountable] the area of land that someone owns\",\"kindId\":8,\"examples\":[{\"content\":\"He ordered us to get off his land.\"}]},{\"content\":\"waste/vacant/derelict land\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"native land\",\"examples\":[{\"content\":\"He\\u0027\\u0027s fiercely proud of his native land.\"}],\"type\":\"collo\"},{\"content\":\"vùng, xứ, địa phương\",\"kindId\":2,\"examples\":[{\"content\":\"one\\u0027\\u0027s native land\"}]},{\"content\":\"land yourself something\",\"examples\":[{\"content\":\"Bill\\u0027\\u0027s just landed himself a part in a Broadway show.\"}],\"type\":\"gram\"},{\"content\":\"[intransitive always + adverb/preposition] to come down through the air onto something\",\"kindId\":9,\"examples\":[{\"content\":\"Louis fell out of the tree and landed in a holly bush.\"},{\"content\":\"A large branch landed on the hood of my car.\"},{\"content\":\"A couple of bombs landed quite near to the village.\"},{\"content\":\"She fell and landed heavily on the floor.\"}]},{\"content\":\"land bird/animal\",\"examples\":[{\"content\":\"The white stork is one of the biggest land birds of the region.\"}],\"type\":\"collo\"},{\"content\":\" to get someone into trouble by telling other people that they did something wrong\",\"kindId\":9,\"examples\":[{\"content\":\"Geoff landed me in it by saying I should have checked that the door was locked.\"}]},{\"content\":\"đất đai, điền sản\",\"kindId\":2,\"examples\":[{\"content\":\"to own houses and land\"}]},{\"content\":\"[transitive] if a boat or aircraft lands people or goods, it brings them to a place, and the people get out or the goods are carried out\",\"kindId\":9,\"examples\":[{\"content\":\"The troops were landed by helicopter.\"}]},{\"content\":\"[countable] a country or area\",\"kindId\":8,\"examples\":[{\"content\":\"Australia represented a real land of opportunity for thousands of people.\"},{\"content\":\"He\\u0027\\u0027s fiercely proud of his native land.\"},{\"content\":\"Their journey took them to many foreign lands.\"}]},{\"examples\":[{\"content\":\"I landed up with five broken ribs.\"}],\"type\":\"gram\"},{\"content\":\"[intransitive always + adverb/preposition] to arrive unexpectedly, and cause problems\",\"kindId\":9,\"examples\":[{\"content\":\"Just when I thought my problems were over, this letter landed on my desk.\"}]},{\"content\":\" to get into a good situation again, after having problems\",\"kindId\":9,\"examples\":[{\"content\":\"She certainly landed on her feet when she got that job.\"}]},{\"content\":\" to be in a particular place, situation, or position after a lot of things have happened to you\",\"kindId\":9,\"examples\":[{\"content\":\"I landed up with five broken ribs.\"},{\"content\":\"Be careful that you don\\u0027\\u0027t land up in serious debt.\"},{\"content\":\"We landed up in a bar at 3 am.\"}]},{\"content\":\"on land\",\"examples\":[{\"content\":\"The crocodile lays its eggs on land.\"}],\"type\":\"gram\"},{\"content\":\"by land\",\"examples\":[{\"content\":\"Troops began an assault on the city by land and sea.\"}],\"type\":\"gram\"},{\"content\":\" asleep\",\"kindId\":8,\"examples\":[]},{\"examples\":[{\"content\":\"Be careful that you don\\u0027\\u0027t land up in serious debt.\"},{\"content\":\"We landed up in a bar at 3 am.\"}],\"type\":\"gram\"},{\"content\":\"đạt được, giành được; bắt được\",\"kindId\":4,\"examples\":[{\"content\":\"to land a prize\"}]},{\"content\":\"đất; đất liền\",\"kindId\":2,\"examples\":[{\"content\":\"to go by land\"},{\"content\":\"to come insight of land\"}]},{\"content\":\" to try to discover what the situation really is before you make a decision\",\"kindId\":8,\"examples\":[]},{\"content\":\" to give someone something unpleasant to do, because no one else wants to do it\",\"kindId\":9,\"examples\":[{\"content\":\"Maria\\u0027\\u0027s been landed with all the tidying up as usual.\"}]},{\"examples\":[{\"content\":\"Just when I thought my problems were over, this letter landed on my desk.\"}],\"type\":\"gram\"},{\"content\":\"[intransitive] if a plane, bird, or insect lands, it moves safely down onto the ground\",\"kindId\":9,\"examples\":[{\"content\":\"The pilot managed to land the aircraft safely.\"},{\"content\":\"The bird landed gracefully on the water.\"},{\"content\":\"Flight 846 landed five minutes ago.\"}]},{\"content\":\"đưa vào bờ; đổ bộ\",\"kindId\":4,\"examples\":[{\"content\":\"to land troops\"}]},{\"content\":\"private/public/common land\",\"examples\":[],\"type\":\"collo\"},{\"content\":\" the countryside thought of as a place where people grow food\",\"kindId\":8,\"examples\":[{\"content\":\"A third of the region\\u0027\\u0027s population still lives off the land.\"},{\"content\":\"Many people were forced to give up working the land.\"}]},{\"content\":\"agricultural/arable land\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"fertile/arid/dry land\",\"examples\":[],\"type\":\"collo\"},{\"content\":\"[intransitive] to arrive somewhere in a plane, boat etc\",\"kindId\":9,\"examples\":[{\"content\":\"In 1969, the first men landed on the moon.\"},{\"content\":\"We expect to be landing in Oslo in about fifty minutes.\"}]},{\"content\":\"rơi vào (tình trạng nào đó)\",\"kindId\":3,\"examples\":[{\"content\":\"to land in a fix\"}]},{\"content\":\" awake - used humorously\",\"kindId\":8,\"examples\":[]}],\"description\":\"land\",\"meaningMap\":{},\"timeStamp\":1296034796436}','land','/lænd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lan/land_/land.mp3\', this)',1296034796436),
 (766,'{\"pron\":\"/ˌmæg.nɪ.fɪˈkeɪ.ʃən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/mag/magni/magnification.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"sự phóng đại, sự mở rộng, sự làm to\",\"kindId\":2,\"examples\":[]},{\"content\":\"at high/low etc magnification\",\"examples\":[{\"content\":\"greater levels of magnification\"},{\"content\":\"When viewed at high magnification it is clear that the crystals are quite different.\"}],\"type\":\"collo\"},{\"content\":\"[uncountable] the process of making something look bigger than it is\",\"kindId\":8,\"examples\":[{\"content\":\"The colour is evident even under low magnification.\"},{\"content\":\"When viewed at high magnification it is clear that the crystals are quite different.\"},{\"content\":\"greater levels of magnification\"}]},{\"content\":\"[countable] the degree to which something is able to make things look bigger\",\"kindId\":8,\"examples\":[{\"content\":\"binoculars with a magnification of x12 (\\u003dwhich make things look 12 times as big)\"}]},{\"content\":\"sự ca ngợi, sự tán tụng, sự tán dương\",\"kindId\":2,\"examples\":[]},{\"content\":\"under magnification\",\"examples\":[{\"content\":\"The colour is evident even under low magnification.\"}],\"type\":\"gram\"}],\"description\":\"magnification\",\"meaningMap\":{},\"timeStamp\":1296034803751}','magnification','/ˌmæg.nɪ.fɪˈkeɪ.ʃən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/mag/magni/magnification.mp3\', this)',1296034803751),
 (767,'{\"pron\":\"/ˌneɪ.ʃənˈwaɪd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/n/nat/natio/nationwide.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" happening or existing in every part of the country\",\"kindId\":7,\"examples\":[{\"content\":\"a nationwide search for a missing British tourist\"},{\"content\":\"nationwide television\"}]}],\"description\":\"nationwide\",\"meaningMap\":{},\"timeStamp\":1296034810117}','nationwide','/ˌneɪ.ʃənˈwaɪd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/n/nat/natio/nationwide.mp3\', this)',1296034810117),
 (768,'{\"pron\":\"/ˌpriːˈrek.wɪ.zɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/p/pre/prere/prerequisite.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"điều cần trước hết, điều kiện tiên quyết, điều kiện quyết định trước hết\",\"kindId\":2,\"examples\":[]},{\"examples\":[{\"content\":\"A reasonable proficiency in English is a prerequisite for the course.\"}],\"type\":\"gram\"},{\"content\":\"cần trước hết, đòi hỏi phải có trước hết\",\"kindId\":1,\"examples\":[]},{\"content\":\" something that is necessary before something else can happen or be done\",\"kindId\":8,\"examples\":[{\"content\":\"A reasonable proficiency in English is a prerequisite for the course.\"}]}],\"description\":\"prerequisite\",\"meaningMap\":{},\"timeStamp\":1296034817152}','prerequisite','/ˌpriːˈrek.wɪ.zɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/p/pre/prere/prerequisite.mp3\', this)',1296034817152),
 (769,'{\"pron\":\"/rɪˈfjuːt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/ref/refut/refute.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"refute an allegation/a suggestion etc\",\"examples\":[{\"content\":\"She refuted any allegations of malpractice.\"}],\"type\":\"collo\"},{\"content\":\" to prove that a statement or idea is not correct\",\"kindId\":9,\"examples\":[{\"content\":\"an attempt to refute Darwin\\u0027\\u0027s theories\"}]},{\"content\":\"refute a hypothesis/a claim/an idea etc\",\"examples\":[{\"content\":\"an attempt to refute Darwin\\u0027\\u0027s theories\"}],\"type\":\"collo\"},{\"content\":\" to say that a statement is wrong or unfair\",\"kindId\":9,\"examples\":[{\"content\":\"She refuted any allegations of malpractice.\"}]},{\"content\":\"bác, bẻ lại\",\"kindId\":4,\"examples\":[{\"content\":\"to refute someone\\u0027\\u0027s argument\"}]}],\"description\":\"refute\",\"meaningMap\":{},\"timeStamp\":1296034823452}','refute','/rɪˈfjuːt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/ref/refut/refute.mp3\', this)',1296034823452),
