 (771,'{\"pron\":\"/traʊt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/tro/trout/trout.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[uncountable and countable] a common river-fish, often used for food, or the flesh of this fish\",\"kindId\":8,\"examples\":[]},{\"content\":\"câu cá hồi\",\"kindId\":3,\"examples\":[]},{\"content\":\" an unpleasant or annoying old person, especially a woman\",\"kindId\":8,\"examples\":[]},{\"content\":\"(động vật học) cá hồi\",\"examples\":[]}],\"description\":\"trout\",\"meaningMap\":{},\"timeStamp\":1296034839314}','trout','/traʊt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/tro/trout/trout.mp3\', this)',1296034839314),
 (772,'{\"pron\":\"/ˌʌn.dəˈpɪn/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usu/usunc/usuncro023.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(kiến trúc) trụ, chống bằng trụ\",\"kindId\":4,\"examples\":[]},{\"content\":\"(nghĩa bóng) làm nền, làm cốt\",\"kindId\":4,\"examples\":[{\"content\":\"he underpins his speech with sound arguments\"}]},{\"content\":\" to put a solid piece of metal under a wall or house in order to make it stronger\",\"kindId\":9,\"examples\":[]},{\"content\":\" to give strength or support to something and to help it succeed\",\"kindId\":9,\"examples\":[{\"content\":\"the theories that underpin his teaching method\"},{\"content\":\"America\\u0027\\u0027s wealth is underpinned by a global system which exploits the world\\u0027\\u0027s poor.\"}]}],\"description\":\"underpin\",\"meaningMap\":{},\"timeStamp\":1296034851062}','underpin','/ˌʌn.dəˈpɪn/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usu/usunc/usuncro023.mp3\', this)',1296034851062),
 (773,'{\"pron\":\"/ˈveə.rɪd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/var/varie/varied.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"lắm vẻ; đầy những đổi thay\",\"kindId\":1,\"examples\":[]},{\"content\":\"khác nhau; thay đổi, biến đổi\",\"kindId\":1,\"examples\":[{\"content\":\"varied colours\"},{\"content\":\"varied interests\"},{\"content\":\"varied opinions\"}]},{\"content\":\" consisting of or including many different kinds of things or people, especially in a way that seems interesting\",\"kindId\":7,\"examples\":[{\"content\":\"a varied diet\"},{\"content\":\"The responsibilities of government are many, and they are varied.\"},{\"content\":\"A good teacher is aware of the extremely varied needs of each student.\"}]},{\"content\":\"richly/extremely/widely etc varied\",\"examples\":[{\"content\":\"A good teacher is aware of the extremely varied needs of each student.\"}],\"type\":\"collo\"}],\"description\":\"varied\",\"meaningMap\":{},\"timeStamp\":1296034857251}','varied','/ˈveə.rɪd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/var/varie/varied.mp3\', this)',1296034857251),
 (774,'{\"pron\":\"/ˈhəʊl.seɪl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/w/who/whole/wholesale.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" relating to the business of selling goods in large quantities at low prices to other businesses, rather than to the general public\",\"kindId\":7,\"examples\":[{\"content\":\"wholesale prices\"}]},{\"content\":\"(nghĩa bóng) quy mô lớn; hàng loạt, hàng đống\",\"examples\":[{\"content\":\"wholesale slaughter\"}]},{\"content\":\"[usually before noun] affecting almost everything or everyone, and often done without any concern for the results\",\"kindId\":7,\"examples\":[{\"content\":\"This company will not be successful until there are wholesale changes.\"},{\"content\":\"the capture and wholesale destruction of a city\"}]},{\"content\":\"(thưng nghiệp) buôn, sỉ\",\"examples\":[{\"content\":\"wholesale trade\"},{\"content\":\"wholesale price\"}]},{\"content\":\"(thưng nghiệp) sự bán buôn, sự bán sỉ\",\"kindId\":2,\"examples\":[{\"content\":\"wholesale and retail\"},{\"content\":\"to sell by wholesale\"}]},{\"content\":\"(nghĩa bóng) c lô, c khối\",\"kindId\":2,\"examples\":[]},{\"content\":\" the business of selling goods in large quantities at low prices to other businesses, rather than to the general public\",\"kindId\":8,\"examples\":[]}],\"description\":\"wholesale\",\"meaningMap\":{},\"timeStamp\":1296034871182}','wholesale','/ˈhəʊl.seɪl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/w/who/whole/wholesale.mp3\', this)',1296034871182),
 (775,'{\"pron\":\"/ɪnˈdʌl.dʒənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/i/ind/indul/indulgent.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" willing to allow someone, especially a child, to do or have whatever they want, even if this is not good for them\",\"kindId\":7,\"examples\":[{\"content\":\"toys bought by their indulgent grandparents\"}]},{\"content\":\"khoan dung\",\"kindId\":1,\"examples\":[{\"content\":\"to be indulgent towards someone\\u0027\\u0027s faults\"}]},{\"content\":\"hay nuông chiều, hay chiều theo\",\"kindId\":1,\"examples\":[]}],\"description\":\"indulgent\",\"meaningMap\":{},\"timeStamp\":1296034886059}','indulgent','/ɪnˈdʌl.dʒənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/i/ind/indul/indulgent.mp3\', this)',1296034886059),
 (776,'{\"pron\":\"/ˌself.ɪˈstiːm/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/s/sel/self_/self_esteem.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"raise/build (up)/boost somebody\\u0027\\u0027\\u0027\\u0027s self-esteem\",\"examples\":[{\"content\":\"students\\u0027\\u0027 sense of self-esteem\"},{\"content\":\"Playing a sport can boost a girl\\u0027\\u0027s self-esteem.\"}],\"type\":\"collo\"},{\"content\":\"sự tự đánh giá cao\",\"kindId\":2,\"examples\":[]},{\"content\":\"lòng tự trọng\",\"kindId\":2,\"examples\":[]},{\"content\":\" the feeling of being satisfied with your own abilities, and that you deserve to be liked or respected\",\"kindId\":8,\"examples\":[{\"content\":\"Playing a sport can boost a girl\\u0027\\u0027s self-esteem.\"},{\"content\":\"students\\u0027\\u0027 sense of self-esteem\"}]},{\"content\":\"low/poor self-esteem\",\"examples\":[],\"type\":\"collo\"}],\"description\":\"self-esteem\",\"meaningMap\":{},\"timeStamp\":1296034894297}','self-esteem','/ˌself.ɪˈstiːm/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/s/sel/self_/self_esteem.mp3\', this)',1296034894297),
 (777,'{\"pron\":\"/əˈmiː.nə.bl ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/ame/amena/amenable.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"chịu trách nhiệm; phải chịu, đáng chịu\",\"kindId\":1,\"examples\":[{\"content\":\"amenable to someone\"},{\"content\":\"amenable to a fine\"}]},{\"content\":\"tuân theo, vâng theo\",\"kindId\":1,\"examples\":[{\"content\":\"amenable to the law\"}]},{\"content\":\" suitable for a particular type of treatment\",\"kindId\":7,\"examples\":[{\"content\":\"Such conditions may be amenable to medical intervention.\"}]},{\"content\":\"dễ bảo, biết nghe theo, phục tùng\",\"kindId\":1,\"examples\":[{\"content\":\"amenable to reason\"}]},{\"examples\":[{\"content\":\"Young people are more amenable than older citizens to the idea of immigration.\"}],\"type\":\"gram\"},{\"content\":\" willing to accept what someone says or does without arguing\",\"kindId\":7,\"examples\":[{\"content\":\"She was always a very amenable child.\"},{\"content\":\"Young people are more amenable than older citizens to the idea of immigration.\"}]},{\"examples\":[{\"content\":\"Such conditions may be amenable to medical intervention.\"}],\"type\":\"gram\"}],\"description\":\"amenable\",\"meaningMap\":{},\"timeStamp\":1296034909196}','amenable','/əˈmiː.nə.bl ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/ame/amena/amenable.mp3\', this)',1296034909196),
 (778,'{\"pron\":\"/bəˈnɑːl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus70/eus70432.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"thường, tầm thường; sáo, vô vị\",\"kindId\":1,\"examples\":[{\"content\":\"a banal remark\"}]},{\"content\":\" ordinary and not interesting, because of a lack of new or different ideas\",\"kindId\":7,\"examples\":[{\"content\":\"conversations about the most banal subjects\"}]}],\"description\":\"banal\",\"meaningMap\":{},\"timeStamp\":1296034916087}','banal','/bəˈnɑːl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus70/eus70432.mp3\', this)',1296034916087),
 (779,'{\"pron\":\"/kɔːs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/coa/coars/coarse.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" consisting of threads or parts that are thick or large\",\"kindId\":7,\"examples\":[{\"content\":\"The coarse sand was hot and rough under her feet.\"},{\"content\":\"tufts of coarse grass\"}]},{\"content\":\" talking in a rude and offensive way, especially about sex\",\"kindId\":7,\"examples\":[{\"content\":\"coarse jokes\"}]},{\"content\":\"thô lỗ, lỗ mãng\",\"kindId\":1,\"examples\":[{\"content\":\"coarse manners\"}]},{\"content\":\"kém, tồi tàn (đồ ăn...)\",\"kindId\":1,\"examples\":[]},{\"content\":\"thô tục, tục tĩu\",\"kindId\":1,\"examples\":[{\"content\":\"coarse words\"}]},{\"content\":\"to cánh, to sợi, không mịn, thô\",\"kindId\":1,\"examples\":[{\"content\":\"coarse sand\"}]},{\"content\":\" having a rough surface that feels slightly hard\",\"kindId\":7,\"examples\":[{\"content\":\"a jacket of coarse wool\"}]}],\"description\":\"coarse\",\"meaningMap\":{},\"timeStamp\":1296034924999}','coarse','/kɔːs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/coa/coars/coarse.mp3\', this)',1296034924999),
 (780,'{\"pron\":\"/ɪˈmɜːdʒ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71511.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"nổi lên, hiện ra, lòi ra\",\"kindId\":3,\"examples\":[]},{\"content\":\" to begin to be known or noticed\",\"kindId\":9,\"examples\":[{\"content\":\"Local government has recently emerged as a major issue.\"},{\"content\":\"a religious sect that emerged in the 1830s\"}]},{\"content\":\" to appear or come out from somewhere\",\"kindId\":9,\"examples\":[{\"content\":\"The sun emerged from behind the clouds.\"},{\"content\":\"The flowers emerge in the spring.\"}]},{\"examples\":[{\"content\":\"Local government has recently emerged as a major issue.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"The sun emerged from behind the clouds.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"She emerged from the divorce a stronger person.\"}],\"type\":\"gram\"},{\"content\":\"thoát khỏi (sự đau khổ)\",\"kindId\":3,\"examples\":[]},{\"content\":\"(nghĩa bóng) nổi bật lên, rõ nét lên; nổi lên, nảy ra (vấn đề...)\",\"kindId\":3,\"examples\":[]},{\"content\":\" if facts emerge, they become known after being hidden or secret\",\"kindId\":9,\"examples\":[{\"content\":\"Later it emerged that the judge had employed an illegal immigrant.\"},{\"content\":\"Eventually the truth emerged.\"}]},{\"content\":\" to come out of a difficult experience\",\"kindId\":9,\"examples\":[{\"content\":\"She emerged from the divorce a stronger person.\"}]}],\"description\":\"emerge\",\"meaningMap\":{},\"timeStamp\":1296034935552}','emerge','/ɪˈmɜːdʒ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71511.mp3\', this)',1296034935552),
 (781,'{\"pron\":\"/fliːs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fle/fleec/fleece.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(từ hiếm,nghĩa hiếm) cắt (lông cừu)\",\"kindId\":4,\"examples\":[]},{\"content\":\"[countable] the woolly coat of a sheep, especially the wool and skin of a sheep when it has been made into a piece of clothing\",\"kindId\":8,\"examples\":[]},{\"content\":\"lừa đảo\",\"kindId\":4,\"examples\":[{\"content\":\"to fleece someone of his money\"}]},{\"content\":\"cụm xốp nhẹ, bông\",\"kindId\":2,\"examples\":[{\"content\":\"a fleece of cloud\"},{\"content\":\"a fleece of snow\"}]},{\"content\":\"(nghành dệt) tuyết\",\"kindId\":2,\"examples\":[]},{\"content\":\"mớ tóc xù, mớ tóc xoắn bồng (như lông cừu)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[uncountable] an artificial soft material used to make warm jackets\",\"kindId\":8,\"examples\":[]},{\"content\":\"bộ lông (cừu...); mớ lông cừu (cắt ở một con)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[countable] a jacket made of this artificial material\",\"kindId\":8,\"examples\":[]},{\"content\":\" to charge someone too much money for something, especially by tricking them\",\"kindId\":9,\"examples\":[]},{\"content\":\"phủ (một lớp như bộ lông cừu)\",\"kindId\":4,\"examples\":[{\"content\":\"a sky fleeced with clouds\"}]}],\"description\":\"fleece\",\"meaningMap\":{},\"timeStamp\":1296034947692}','fleece','/fliːs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fle/fleec/fleece.mp3\', this)',1296034947692),
 (782,'{\"pron\":\"/ˈgædʒ.ɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/g/gad/gadge/gadget.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a small, useful, and cleverly-designed machine or tool\",\"kindId\":8,\"examples\":[{\"content\":\"a neat gadget for sharpening knives\"}]},{\"content\":\"đồ dùng, đồ vật, đ\",\"kindId\":2,\"examples\":[]},{\"content\":\"(thực vật học) bộ phận cải tiến (trong máy móc); máy cải tiến\",\"kindId\":2,\"examples\":[]}],\"description\":\"gadget\",\"meaningMap\":{},\"timeStamp\":1296034954015}','gadget','/ˈgædʒ.ɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/g/gad/gadge/gadget.mp3\', this)',1296034954015),
 (783,'{\"pron\":\"/ˈhæm.ər/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/ham/hamme/hammer.mp3\\u0027, this)\",\"meanings\":[{\"examples\":[{\"content\":\"The decision is a hammer blow for the coal industry.\"}],\"type\":\"gram\"},{\"content\":\"[transitive] to defeat someone completely at a sport\",\"kindId\":9,\"examples\":[{\"content\":\"Arsenal hammered Manchester United 5-0.\"}]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) phê bình kịch liệt; chỉ trích kịch liệt\",\"kindId\":4,\"examples\":[]},{\"content\":\"hammer something in/into something\",\"examples\":[{\"content\":\"Hammer the nails into the back of the frame.\"}],\"type\":\"gram\"},{\"content\":\" to decide on an agreement, contract etc after a lot of discussion and disagreement\",\"kindId\":9,\"examples\":[{\"content\":\"Leading oil producers tried to hammer out a deal.\"}]},{\"content\":\" to make sure that people understand something by repeating it many times\",\"kindId\":9,\"examples\":[{\"content\":\"The message must be hammered home that crime doesn\\u0027\\u0027t pay.\"}]},{\"content\":\"gõ ba lần búa tuyên bố (ai) vỡ nợ\",\"kindId\":4,\"examples\":[]},{\"content\":\" an event that damages something very seriously\",\"kindId\":8,\"examples\":[{\"content\":\"The decision is a hammer blow for the coal industry.\"}]},{\"content\":\"[transitive] to hit or kick something very hard\",\"kindId\":9,\"examples\":[{\"content\":\"Robinson hammered the ball into the goal.\"}]},{\"content\":\" a heavy metal ball on a wire with a handle at the end, which you throw as far as possible as a sport\",\"kindId\":8,\"examples\":[]},{\"examples\":[{\"content\":\"I keep hammering away at this point because it\\u0027\\u0027s important.\"}],\"type\":\"gram\"},{\"content\":\" to keep saying something because you want people to understand or accept it\",\"kindId\":9,\"examples\":[{\"content\":\"I keep hammering away at this point because it\\u0027\\u0027s important.\"}]},{\"content\":\" a wooden part of a piano that hits the strings inside to make a musical sound\",\"kindId\":8,\"examples\":[]},{\"examples\":[{\"content\":\"Keep on hammering away at achieving your goals.\"}],\"type\":\"gram\"},{\"content\":\"hammer away (at something)\",\"examples\":[{\"content\":\"All afternoon, Martin had been hammering away in the conservatory.\"}],\"type\":\"gram\"},{\"content\":\"quấy rầy, quấy nhiễu (ai)\",\"kindId\":3,\"examples\":[]},{\"content\":\"[transitive] to hurt someone or something by causing them a lot of problems\",\"kindId\":9,\"examples\":[{\"content\":\"British industry was being hammered by the recession.\"}]},{\"content\":\"[intransitive] to hit something many times, especially making a loud noise\",\"kindId\":9,\"examples\":[{\"content\":\"Daniella hammered at the door.\"},{\"content\":\"The rain was hammering against the window.\"}]},{\"content\":\" to be offered for sale at an auction\",\"kindId\":8,\"examples\":[]},{\"content\":\"làm bền bỉ; cố sức làm, gắng công làm (việc gì)\",\"kindId\":3,\"examples\":[]},{\"content\":\"búa\",\"kindId\":2,\"examples\":[{\"content\":\"pneumatic hammer\"}]},{\"content\":\" the part of a gun that hits the explosive charge that fires a bullet\",\"kindId\":8,\"examples\":[]},{\"content\":\"đầu cần (đàn pianô)\",\"kindId\":2,\"examples\":[]},{\"content\":\" a tool with a heavy metal part on a long handle, used for hitting nails into wood\",\"kindId\":8,\"examples\":[{\"content\":\"an auctioneer\\u0027\\u0027s hammer\"}]},{\"content\":\"nhồi nhét, tọng\",\"kindId\":4,\"examples\":[{\"content\":\"to hammer an idea into someone\\u0027\\u0027s head\"}]},{\"content\":\" if people go at each other hammer and tongs, they fight or argue very loudly\",\"kindId\":8,\"examples\":[]},{\"content\":\"[transitive] to strongly criticize or attack someone for something they have said or done\",\"kindId\":9,\"examples\":[{\"content\":\"The president has been hammered for his lack of leadership.\"}]},{\"content\":\"quai, búa, nện, đóng, đạp mạnh (bằng búa hoặc như bằng búa)\",\"kindId\":4,\"examples\":[{\"content\":\"to hammer a piece of metal flat\"},{\"content\":\"to hammer a nail in\"}]},{\"content\":\"[intransitive] if your heart hammers, you feel it beating strongly and quickly\",\"kindId\":9,\"examples\":[{\"content\":\"She stood outside the door, her heart hammering.\"}]},{\"examples\":[{\"content\":\"Daniella hammered at the door.\"}],\"type\":\"gram\"},{\"content\":\"[intransitive and transitive] to hit something with a hammer in order to force it into a particular position or shape\",\"kindId\":9,\"examples\":[{\"content\":\"the sound of hammering and sawing\"},{\"content\":\"Hammer the nails into the back of the frame.\"},{\"content\":\"All afternoon, Martin had been hammering away in the conservatory.\"}]},{\"content\":\"cò (súng)\",\"kindId\":2,\"examples\":[]},{\"content\":\"(thông tục) đánh bại, giáng cho những thất bại nặng nề (trong chiến tranh, trong thi đấu thể thao...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"búa gỗ (cho người bán đấu giá)\",\"kindId\":2,\"examples\":[{\"content\":\"to come to the hammer\"},{\"content\":\"to bring to the hammer\"}]},{\"content\":\" to work hard and continuously at something\",\"kindId\":9,\"examples\":[{\"content\":\"Keep on hammering away at achieving your goals.\"}]},{\"content\":\" to keep saying something until people completely understand it\",\"kindId\":9,\"examples\":[{\"content\":\"The coach hammered his message into the team.\"}]}],\"description\":\"hammer\",\"meaningMap\":{},\"timeStamp\":1296034966388}','hammer','/ˈhæm.ər/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/ham/hamme/hammer.mp3\', this)',1296034966388),
 (784,'{\"pron\":\"/ˌɪn.təˈwiːv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72562.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" if two things are interwoven, they are closely related or combined in a complicated way\",\"kindId\":9,\"examples\":[{\"content\":\"The two themes are inextricably interwoven in the book.\"},{\"content\":\"practical help for the bereaved interwoven with emotional support\"}]},{\"content\":\"dệt lẫn với nhau\",\"examples\":[{\"content\":\"to interweave a nylon warp with a cotton weft\"}]},{\"content\":\" to weave two or more things together\",\"kindId\":9,\"examples\":[{\"content\":\"silk interwoven with gold and silver threads\"}]},{\"content\":\"be interwoven with something\",\"examples\":[{\"content\":\"silk interwoven with gold and silver threads\"}],\"type\":\"gram\"},{\"content\":\"trộn lẫn với nhau; xen lẫn\",\"examples\":[{\"content\":\"to interweave facts with fiction\"}]},{\"content\":\"closely/inextricably/tightly etc interwoven\",\"examples\":[{\"content\":\"The two themes are inextricably interwoven in the book.\"}],\"type\":\"collo\"},{\"content\":\"be interwoven with something\",\"examples\":[{\"content\":\"practical help for the bereaved interwoven with emotional support\"}],\"type\":\"gram\"}],\"description\":\"interweave\",\"meaningMap\":{},\"timeStamp\":1296034972977}','interweave','/ˌɪn.təˈwiːv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus72/eus72562.mp3\', this)',1296034972977),
 (785,'{\"pron\":\"/ˈlæn.dɪŋ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lan/landi/landing.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[countable] the floor at the top of a set of stairs or between two sets of stairs\",\"kindId\":8,\"examples\":[{\"content\":\"the first-floor landing\"}]},{\"content\":\"[countable] a landing stage\",\"kindId\":8,\"examples\":[]},{\"content\":\"sự đổ bộ, sự ghé vào bờ (tàu biển, thuyền bè); sự hạ cánh (máy bay)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[countable] the action of bringing soldiers onto land that is controlled by the enemy\",\"kindId\":8,\"examples\":[{\"content\":\"the first landings of American Marines at Da Nang\"}]},{\"content\":\"[uncountable and countable] the action of bringing an aircraft down to the ground after being in the air\",\"kindId\":8,\"examples\":[{\"content\":\"take-off and landing procedures\"},{\"content\":\"the Apollo moon landings\"}]},{\"content\":\"đầu cầu thang\",\"kindId\":2,\"examples\":[]},{\"content\":\"bến, nơi đổ\",\"kindId\":2,\"examples\":[]},{\"content\":\"crash/emergency landing\",\"examples\":[],\"type\":\"collo\"}],\"description\":\"landing\",\"meaningMap\":{},\"timeStamp\":1296034980315}','landing','/ˈlæn.dɪŋ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lan/landi/landing.mp3\', this)',1296034980315),
 (786,'{\"pron\":\"/ˈmæg.nɪ.tjuːd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/mag/magni/magnitude.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"of such/this/similar etc magnitude\",\"examples\":[{\"content\":\"We did not think the cuts would be of this magnitude.\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"They didn\\u0027\\u0027t seem to appreciate the magnitude of the problem.\"}],\"type\":\"gram\"},{\"content\":\"[countable] the force of an earthquake\",\"kindId\":8,\"examples\":[]},{\"content\":\"[uncountable] the great size or importance of something\",\"kindId\":8,\"examples\":[{\"content\":\"They didn\\u0027\\u0027t seem to appreciate the magnitude of the problem.\"},{\"content\":\"We did not think the cuts would be of this magnitude.\"},{\"content\":\"an increase of this order of magnitude (\\u003dsize)\"}]},{\"content\":\"tầm lớn, độ lớn, lượng\",\"kindId\":2,\"examples\":[]},{\"content\":\"[countable] the degree of brightness of a star\",\"kindId\":8,\"examples\":[]},{\"content\":\"tầm quan trọng, tính chất trọng đại\",\"kindId\":2,\"examples\":[{\"content\":\"this is an event of the first magnitude\"}]}],\"description\":\"magnitude\",\"meaningMap\":{},\"timeStamp\":1296034985995}','magnitude','/ˈmæg.nɪ.tjuːd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/mag/magni/magnitude.mp3\', this)',1296034985995),
 (787,'{\"pron\":\"/ˈnæv.ɪ.gə.bl ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/n/nav/navig/navigable.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a river, lake etc that is navigable is deep and wide enough for ships to travel on\",\"kindId\":7,\"examples\":[]},{\"content\":\"để tàu bè đi lại được (sông, biển)\",\"kindId\":1,\"examples\":[]},{\"content\":\"có thể đi sông biển được (tàu bè)\",\"kindId\":1,\"examples\":[]},{\"content\":\"có thể điều khiển được (khí cầu)\",\"kindId\":1,\"examples\":[]}],\"description\":\"navigable\",\"meaningMap\":{},\"timeStamp\":1296034992774}','navigable','/ˈnæv.ɪ.gə.bl ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/n/nav/navig/navigable.mp3\', this)',1296034992774),
 (788,'{\"meanings\":[{\"content\":\"sự béo phị, sự trệ\",\"kindId\":2,\"examples\":[]},{\"content\":\" when someone is very fat in a way that is unhealthy\",\"kindId\":8,\"examples\":[]}],\"description\":\"obesity\",\"meaningMap\":{},\"timeStamp\":1296035000116}','obesity',NULL,NULL,1296035000116),
 (789,'{\"pron\":\"/ˈpɒv.ə.ti/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/p/pov/pover/poverty.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a situation in which a poor person without a job cannot afford to take a low paying job because they would lose the money they receive from the government\",\"kindId\":8,\"examples\":[]},{\"content\":\"sự nghèo nàn; cảnh nghèo nàn, cảnh bần cùng\",\"kindId\":2,\"examples\":[{\"content\":\"to be reduced to extreme poverty\"}]},{\"content\":\"[singular,uncountable] a lack of a particular quality\",\"kindId\":8,\"examples\":[{\"content\":\"The novel shows a surprising poverty of imagination.\"}]},{\"content\":\" the income below which a person or a family is officially considered to be very poor and in need of help\",\"kindId\":8,\"examples\":[{\"content\":\"20% of the population now live below the poverty line.\"}]},{\"content\":\"[uncountable] the situation or experience of being poor\",\"kindId\":8,\"examples\":[{\"content\":\"the causes of urban poverty\"},{\"content\":\"We need an effective strategy to fight poverty.\"},{\"content\":\"scenes of abject poverty\"},{\"content\":\"Millions of elderly people live in poverty.\"},{\"content\":\"continued efforts to alleviate poverty and raise living standards\"}]},{\"content\":\"(nghĩa bóng) sự nghèo nàn, sự thiếu thốn; sự thấp kém, sự tồi tàn\",\"kindId\":2,\"examples\":[{\"content\":\"a great poverty of ideas\"}]},{\"examples\":[{\"content\":\"The novel shows a surprising poverty of imagination.\"}],\"type\":\"gram\"}],\"description\":\"poverty\",\"meaningMap\":{},\"timeStamp\":1296035006653}','poverty','/ˈpɒv.ə.ti/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/p/pov/pover/poverty.mp3\', this)',1296035006653),
 (790,'{\"pron\":\"/rɪˈzem.bl ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/res/resem/resemble.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"giống với (người nào, vật gì)\",\"kindId\":4,\"examples\":[{\"content\":\"to resemble one another\"}]},{\"content\":\" to look like or be similar to someone or something\",\"kindId\":9,\"examples\":[{\"content\":\"He grew up to resemble his father.\"},{\"content\":\"It\\u0027\\u0027s amazing how closely Brian and Steve resemble each other.\"}]}],\"description\":\"resemble\",\"meaningMap\":{},\"timeStamp\":1296035012287}','resemble','/rɪˈzem.bl ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/res/resem/resemble.mp3\', this)',1296035012287),
 (791,'{\"pron\":\"/ˈsæk.rɪ.faɪs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/s/sac/sacri/sacrifice.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"bán lỗ\",\"kindId\":0,\"examples\":[]},{\"content\":\"sự giết (người, vật) để cúng thần\",\"kindId\":2,\"examples\":[]},{\"content\":\"sự hy sinh\",\"kindId\":2,\"examples\":[{\"content\":\"to make sacrifices for the fatherland\"},{\"content\":\"the last (great) sacrifice\"}]},{\"examples\":[{\"content\":\"In those days, an animal was offered as a sacrifice to God.\"}],\"type\":\"gram\"},{\"content\":\"hy sinh\",\"kindId\":0,\"examples\":[{\"content\":\"to sacrifice one\\u0027\\u0027s whole life to the happiness of the people\"}]},{\"content\":\"sự bán lỗ; hàng bán lỗ; sự lỗ\",\"kindId\":2,\"examples\":[]},{\"content\":\"cúng, cúng tế\",\"kindId\":0,\"examples\":[]},{\"content\":\"sacrifice something to do something\",\"examples\":[{\"content\":\"He sacrificed a promising career to look after his kids.\"}],\"type\":\"gram\"},{\"content\":\"người bị giết để cúng thần; vật bị giết để cúng thần\",\"kindId\":2,\"examples\":[]},{\"content\":\"[intransitive and transitive] to kill an animal or person and offer them to a god in a religious ceremony\",\"kindId\":9,\"examples\":[]},{\"content\":\" the act of dying while you are fighting for a principle or in order to help other people\",\"kindId\":8,\"examples\":[{\"content\":\"Captain Oates made the ultimate sacrifice in a bid to save his colleagues.\"}]},{\"content\":\"[transitive] to willingly stop having something you want or doing something you like in order to get something more important\",\"kindId\":9,\"examples\":[{\"content\":\"A Labour government chose to sacrifice defence for welfare.\"},{\"content\":\"mothers who sacrifice themselves for their children\"},{\"content\":\"He sacrificed a promising career to look after his kids.\"}]},{\"content\":\"[uncountable and countable] the act of offering something to a god, especially in the past, by killing an animal or person in a religious ceremony\",\"kindId\":8,\"examples\":[{\"content\":\"a human sacrifice (\\u003da person killed as a sacrifice)\"},{\"content\":\"They made sacrifices to ensure a good harvest.\"},{\"content\":\"In those days, an animal was offered as a sacrifice to God.\"}]},{\"content\":\"sacrifice something for something\",\"examples\":[{\"content\":\"A Labour government chose to sacrifice defence for welfare.\"}],\"type\":\"gram\"},{\"content\":\"sacrifice yourself (for something)\",\"examples\":[{\"content\":\"mothers who sacrifice themselves for their children\"}],\"type\":\"gram\"},{\"content\":\"[uncountable and countable] when you decide not to have something valuable, in order to get something that is more important\",\"kindId\":8,\"examples\":[{\"content\":\"The minister stressed the need for economic sacrifice.\"},{\"content\":\"She brought three children up single-handedly, often at great personal sacrifice.\"},{\"content\":\"The workforce were willing to make sacrifices in order to preserve jobs.\"}]}],\"description\":\"sacrifice\",\"meaningMap\":{},\"timeStamp\":1296035023072}','sacrifice','/ˈsæk.rɪ.faɪs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/s/sac/sacri/sacrifice.mp3\', this)',1296035023072),
 (792,'{\"meanings\":[{\"content\":\"bảo đảm, cam đoan\",\"kindId\":4,\"examples\":[{\"content\":\"I will undertake that it will not transpire\"}]},{\"content\":\"làm, định làm\",\"kindId\":4,\"examples\":[]},{\"content\":\"(thông tục) làm nghề lo liệu đám ma\",\"kindId\":3,\"examples\":[]},{\"content\":\"(từ cổ,nghĩa cổ) hứa làm, cam đoan làm được\",\"kindId\":3,\"examples\":[]},{\"content\":\"nhận làm, cam kết\",\"kindId\":4,\"examples\":[{\"content\":\"I can\\u0027\\u0027t undertake to do that\"}]}],\"description\":\"undertook\",\"meaningMap\":{},\"timeStamp\":1296035031336}','undertook',NULL,NULL,1296035031336),
 (793,'{\"pron\":\"/vɑːst/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/vas/vast_/vast.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" used when you want to emphasize that something is true about almost all of a group of people or things\",\"kindId\":7,\"examples\":[{\"content\":\"The vast majority of books on the subject are complete rubbish.\"}]},{\"content\":\" extremely large\",\"kindId\":7,\"examples\":[{\"content\":\"The refugees come across the border in vast numbers.\"},{\"content\":\"The government will have to borrow vast amounts of money.\"},{\"content\":\"vast areas of rainforest\"},{\"content\":\"In the past five years, there has been a vast improvement in graduation rates.\"}]},{\"content\":\"(thơ ca); (văn học) khoảng rộng bao la\",\"kindId\":2,\"examples\":[{\"content\":\"the vast of ocean\"},{\"content\":\"the vast of heaven\"}]},{\"content\":\"vast areas/expanses/tracts etc (of something)\",\"examples\":[{\"content\":\"vast areas of rainforest\"}],\"type\":\"collo\"},{\"content\":\"rộng lớn, mênh mông, bao la; to lớn ((nghĩa đen) \\u0026amp; (nghĩa bóng))\",\"kindId\":1,\"examples\":[{\"content\":\"a vast mountain\"},{\"content\":\"a vast sum\"},{\"content\":\"a vast expanse of water\"},{\"content\":\"vast reading\"}]},{\"content\":\"vast amounts/numbers/quantities/sums etc (of something)\",\"examples\":[{\"content\":\"The government will have to borrow vast amounts of money.\"},{\"content\":\"The refugees come across the border in vast numbers.\"}],\"type\":\"collo\"}],\"description\":\"vast\",\"meaningMap\":{},\"timeStamp\":1296035038306}','vast','/vɑːst/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/vas/vast_/vast.mp3\', this)',1296035038306),
 (794,'{\"pron\":\"/ˌwaɪdˈspred/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74988.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" existing or happening in many places or situations, or among many people\",\"kindId\":7,\"examples\":[{\"content\":\"The storm caused widespread damage.\"},{\"content\":\"the widespread use of chemicals in agriculture\"},{\"content\":\"There was widespread support for the war.\"}]},{\"content\":\"widespread support/acceptance/criticism/condemnation etc\",\"examples\":[{\"content\":\"There was widespread support for the war.\"},{\"content\":\"The storm caused widespread damage.\"}],\"type\":\"collo\"},{\"content\":\"lan rộng, phổ biến\",\"kindId\":1,\"examples\":[]}],\"description\":\"widespread\",\"meaningMap\":{},\"timeStamp\":1296035044007}','widespread','/ˌwaɪdˈspred/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus74/eus74988.mp3\', this)',1296035044007),
 (795,'{\"pron\":\"/æbˈdʌkt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/abd/abduc/abduct.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"bắt cóc, cuỗm đi, lừa đem đi (người đàn bà...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"(giải phẫu) rẽ ra, giạng ra\",\"kindId\":4,\"examples\":[]},{\"content\":\" to take someone away by force\",\"kindId\":9,\"examples\":[{\"content\":\"She was abducted late last night.\"}]}],\"description\":\"abduct\",\"meaningMap\":{},\"timeStamp\":1296035055937}','abduct','/æbˈdʌkt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/abd/abduc/abduct.mp3\', this)',1296035055937),
 (796,'{\"pron\":\"/ˈbæn.dɪdʒ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/b/ban/banda/bandage.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a narrow piece of cloth that you tie around a wound or around a part of the body that has been injured\",\"kindId\":8,\"examples\":[]},{\"content\":\" to tie or cover a part of the body with a bandage\",\"kindId\":9,\"examples\":[{\"content\":\"The nurse bandaged up his sprained ankle.\"}]},{\"content\":\"băng (để băng vết thương, bịt mắt...)\",\"kindId\":2,\"examples\":[]},{\"content\":\"băng bó\",\"kindId\":4,\"examples\":[]}],\"description\":\"bandage\",\"meaningMap\":{},\"timeStamp\":1296035068624}','bandage','/ˈbæn.dɪdʒ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/b/ban/banda/bandage.mp3\', this)',1296035068624),
 (797,'{\"pron\":\"/ˈkɒm.prə.maɪz/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/com/compr/compromise.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[transitive] to do something which is against your principles and which therefore seems dishonest or shameful\",\"kindId\":9,\"examples\":[{\"content\":\"As soon as you compromise your principles you are lost.\"},{\"content\":\"She had already compromised herself by accepting his invitation.\"}]},{\"examples\":[{\"content\":\"a happy compromise between the needs of family and work\"}],\"type\":\"gram\"},{\"content\":\"sự thoả hiệp\",\"kindId\":2,\"examples\":[{\"content\":\"a arrive at a compromise\"}]},{\"examples\":[{\"content\":\"a compromise between government and opposition\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"His work-mates demanded that he never compromise with the bosses.\"}],\"type\":\"gram\"},{\"content\":\"[intransitive] to reach an agreement in which everyone involved accepts less that what they wanted at first\",\"kindId\":9,\"examples\":[{\"content\":\"His work-mates demanded that he never compromise with the bosses.\"},{\"content\":\"She admitted that she was unable to compromise.\"},{\"content\":\"The new regime was prepared to compromise on the oil dispute.\"}]},{\"content\":\"compromise yourself\",\"examples\":[{\"content\":\"She had already compromised herself by accepting his invitation.\"}],\"type\":\"gram\"},{\"examples\":[{\"content\":\"Fresh attempts at compromise with the legislature were also on the agenda.\"}],\"type\":\"gram\"},{\"content\":\"[uncountable and countable] an agreement that is achieved after everyone involved accepts less than what they wanted at first, or the act of making this agreement\",\"kindId\":8,\"examples\":[{\"content\":\"To stop the argument they decided on a compromise.\"},{\"content\":\"Fresh attempts at compromise with the legislature were also on the agenda.\"},{\"content\":\"a compromise between government and opposition\"},{\"content\":\"Be prepared to make compromises.\"},{\"content\":\"If moderates fail to reach a compromise, the extremists will dominate the agenda.\"},{\"content\":\"Compromise is an inevitable part of marriage.\"}]},{\"content\":\"làm hại, làm tổn thương\",\"kindId\":4,\"examples\":[{\"content\":\"to compromise oneself\"}]},{\"content\":\"thoả hiệp\",\"kindId\":3,\"examples\":[]},{\"examples\":[{\"content\":\"The new regime was prepared to compromise on the oil dispute.\"}],\"type\":\"gram\"},{\"content\":\"[countable] a solution to a problem in which two things or situations are changed slightly so that they can exist together\",\"kindId\":8,\"examples\":[{\"content\":\"a happy compromise between the needs of family and work\"}]},{\"content\":\"compromise your principles/standards/integrity etc\",\"examples\":[{\"content\":\"As soon as you compromise your principles you are lost.\"}],\"type\":\"collo\"},{\"content\":\"dàn xếp, thoả hiệp\",\"kindId\":4,\"examples\":[]}],\"description\":\"compromise\",\"meaningMap\":{},\"timeStamp\":1296035080797}','compromise','/ˈkɒm.prə.maɪz/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/com/compr/compromise.mp3\', this)',1296035080797),
 (798,'{\"meanings\":[{\"content\":\"người lao dịch; nô lệ, thân trâu ngựa\",\"kindId\":2,\"examples\":[]},{\"content\":\"làm công việc vất vả cực nhọc, làm lao dịch; làm nô lệ, làm thân trâu ngựa\",\"kindId\":3,\"examples\":[]},{\"content\":\" someone who does hard boring work\",\"kindId\":8,\"examples\":[]}],\"description\":\"drudge\",\"meaningMap\":{},\"timeStamp\":1296035088439}','drudge',NULL,NULL,1296035088439);
