 (799,'{\"pron\":\"/ɪˈvəʊk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/evo/evoke/evoke.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"gọi lên (hồn...), gợi lên (ký ức, tình cảm...)\",\"kindId\":4,\"examples\":[]},{\"content\":\" to produce a strong feeling or memory in someone\",\"kindId\":9,\"examples\":[{\"content\":\"Her speech evoked a hostile response.\"},{\"content\":\"The photographs evoked strong memories of our holidays in France.\"},{\"content\":\"His appearance is bound to evoke sympathy.\"}]},{\"content\":\"(pháp lý) gọi ra toà trên\",\"kindId\":4,\"examples\":[]}],\"description\":\"evoke\",\"meaningMap\":{},\"timeStamp\":1296035094376}','evoke','/ɪˈvəʊk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/evo/evoke/evoke.mp3\', this)',1296035094376),
 (800,'{\"pron\":\"/ˌɪn.təˈneɪ.ʃən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/i/int/inton/intonation.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"sự ngâm nga\",\"kindId\":2,\"examples\":[]},{\"content\":\"(âm nhạc) âm điệu; âm chuẩn\",\"kindId\":2,\"examples\":[]},{\"content\":\"[uncountable] the playing or singing of correct musical notes\",\"kindId\":8,\"examples\":[]},{\"content\":\"(ngôn ngữ học) ngữ điệu\",\"kindId\":2,\"examples\":[]},{\"content\":\"[uncountable and countable] the way in which the level of your voice changes in order to add meaning to what you are saying, for example by going up at the end of a question\",\"kindId\":8,\"examples\":[{\"content\":\"intonation patterns\"}]}],\"description\":\"intonation\",\"meaningMap\":{},\"timeStamp\":1296035108922}','intonation','/ˌɪn.təˈneɪ.ʃən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/i/int/inton/intonation.mp3\', this)',1296035108922),
 (801,'{\"pron\":\"/ˈlænd.slaɪd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lan/lands/landslide.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(chính trị) sự thắng phiếu lớn (của một đảng phái trong kỳ bầu cử)\",\"kindId\":2,\"examples\":[]},{\"content\":\"(định ngữ) long trời lở đất ((thường) chỉ dùng trong tuyển cử)\",\"kindId\":2,\"examples\":[{\"content\":\"a landslide victory\"}]},{\"content\":\"sự lở đất\",\"kindId\":2,\"examples\":[]},{\"content\":\"lở (như đá... trên núi xuống)\",\"kindId\":3,\"examples\":[]},{\"content\":\"by a landslide\",\"examples\":[{\"content\":\"The SNP candidate won by a landslide.\"}],\"type\":\"gram\"},{\"content\":\"(từ Mỹ,nghĩa Mỹ) thắng lợi long trời lở đất\",\"kindId\":2,\"examples\":[]},{\"content\":\" a sudden fall of a lot of earth or rocks down a hill, cliff etc\",\"kindId\":8,\"examples\":[]},{\"content\":\"thắng phiếu lớn\",\"kindId\":3,\"examples\":[]},{\"content\":\"[usually singular] a victory in an election in which one person or party gets a lot more votes than all the others\",\"kindId\":8,\"examples\":[{\"content\":\"The SNP candidate won by a landslide.\"},{\"content\":\"a landslide election victory\"}]}],\"description\":\"landslide\",\"meaningMap\":{},\"timeStamp\":1296035117981}','landslide','/ˈlænd.slaɪd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lan/lands/landslide.mp3\', this)',1296035117981),
 (802,'{\"pron\":\"/ˈmeɪn.striːm/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/mai/mains/mainstream.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" accepted by or involving most people in a society\",\"kindId\":7,\"examples\":[{\"content\":\"the mainstream political parties\"},{\"content\":\"Deaf children can often be included in mainstream education.\"}]},{\"content\":\" the most usual ideas or methods, or the people who have these ideas or methods\",\"kindId\":8,\"examples\":[{\"content\":\"Environmental ideas have been absorbed into the mainstream of European politics.\"},{\"content\":\"Genet started as a rebel, but soon became part of the literary mainstream.\"}]},{\"examples\":[{\"content\":\"Environmental ideas have been absorbed into the mainstream of European politics.\"}],\"type\":\"gram\"},{\"content\":\" to include a child with physical or mental problems in an ordinary class\",\"kindId\":9,\"examples\":[]}],\"description\":\"mainstream\",\"meaningMap\":{},\"timeStamp\":1296035129939}','mainstream','/ˈmeɪn.striːm/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/mai/mains/mainstream.mp3\', this)',1296035129939),
 (803,'{\"pron\":\"/nəˈgəʊ.ʃi.eɪt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/n/neg/negot/negotiate.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(thương nghiệp),  (chính trị) điều đình, đàm phán, thương lượng, dàn xếp\",\"kindId\":0,\"examples\":[{\"content\":\"to negotiate a treaty\"}]},{\"content\":\"[intransitive and transitive] to discuss something in order to reach an agreement, especially in business or politics\",\"kindId\":9,\"examples\":[{\"content\":\"Union leaders have negotiated an agreement for a shorter working week.\"},{\"content\":\"His first aim is to get the warring parties back to the negotiating table (\\u003ddiscussing something).\"},{\"content\":\"The government refuses to negotiate with terrorists.\"}]},{\"content\":\"đổi thành tiền, chuyển nhượng cho người khác để lấy tiền, trả bằng tiền (chứng khoán, hối phiếu, ngân phiếu)\",\"kindId\":0,\"examples\":[]},{\"examples\":[{\"content\":\"The government refuses to negotiate with terrorists.\"}],\"type\":\"gram\"},{\"content\":\"vượt qua được (vật chướng ngại, khó khăn...)\",\"kindId\":0,\"examples\":[]},{\"content\":\"negotiate an agreement/contract etc\",\"examples\":[{\"content\":\"Union leaders have negotiated an agreement for a shorter working week.\"}],\"type\":\"collo\"},{\"content\":\"[transitive] to succeed in getting past or over a difficult place on a path, road etc\",\"kindId\":9,\"examples\":[{\"content\":\"Guido swung the steering-wheel round to negotiate a corner.\"}]}],\"description\":\"negotiate\",\"meaningMap\":{},\"timeStamp\":1296035137057}','negotiate','/nəˈgəʊ.ʃi.eɪt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/n/neg/negot/negotiate.mp3\', this)',1296035137057),
 (804,'{\"pron\":\"/əbˈdʒek.tɪv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75096.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" based on facts, or making a decision that is based on facts rather than on your feelings or beliefs\",\"kindId\":7,\"examples\":[{\"content\":\"It\\u0027\\u0027s hard to give an objective opinion about your own children.\"},{\"content\":\"Scientists need to be objective when doing research.\"},{\"content\":\"the importance of a completely objective, independent press\"}]},{\"content\":\"(thuộc) mục tiêu\",\"kindId\":1,\"examples\":[{\"content\":\"objective point\"}]},{\"content\":\"(ngôn ngữ học) cách mục đích\",\"kindId\":2,\"examples\":[]},{\"content\":\" something that you are trying hard to achieve, especially in business or politics\",\"kindId\":8,\"examples\":[{\"content\":\"A clear objective was set and adhered to.\"},{\"content\":\"One of your first business objectives should be to get your own office.\"},{\"content\":\"Managers should set specific performance objectives for their teams.\"},{\"content\":\"The main objective was to improve children\\u0027\\u0027s knowledge of geography.\"},{\"content\":\"the best way to accomplish your objectives\"},{\"content\":\"The degree program has two main objectives.\"},{\"content\":\"He vowed to achieve certain objectives before the end of his presidency.\"}]},{\"content\":\" a place that you are trying to reach, especially in a military attack\",\"kindId\":8,\"examples\":[{\"content\":\"The 4th Division\\u0027\\u0027s objective was a town twenty miles to the east.\"}]},{\"content\":\"(ngôn ngữ học) (thuộc) cách mục tiêu\",\"kindId\":1,\"examples\":[]},{\"content\":\" existing outside the mind as something real, not only as an idea\",\"kindId\":7,\"examples\":[{\"content\":\"The world has an objective reality.\"}]},{\"content\":\"khách quan\",\"kindId\":1,\"examples\":[{\"content\":\"objective existence\"},{\"content\":\"objective opinion\"}]},{\"content\":\"purely/totally/completely objective\",\"examples\":[{\"content\":\"the importance of a completely objective, independent press\"}],\"type\":\"collo\"},{\"content\":\"objective assessment/measurement/description etc\",\"examples\":[{\"content\":\"It\\u0027\\u0027s hard to give an objective opinion about your own children.\"}],\"type\":\"collo\"},{\"content\":\"mục tiêu, mục đích\",\"kindId\":2,\"examples\":[]}],\"description\":\"objective\",\"meaningMap\":{},\"timeStamp\":1296035148490}','objective','/əbˈdʒek.tɪv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75096.mp3\', this)',1296035148490),
 (805,'{\"pron\":\"/ˈpəʊ.tənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/p/pot/poten/potent.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a man who is potent is able to have sex or able to make a woman pregnant\",\"kindId\":7,\"examples\":[]},{\"content\":\"có hiệu lực; hiệu nghiệm (thuốc...)\",\"kindId\":1,\"examples\":[]},{\"content\":\"có sức thuyết phục mạnh mẽ (lý lẽ)\",\"kindId\":1,\"examples\":[]},{\"content\":\" powerful and effective\",\"kindId\":7,\"examples\":[{\"content\":\"The treaty requires them to get rid of their most potent weapons.\"}]},{\"content\":\"có lực lượng, có quyền thế, hùng mạnh\",\"kindId\":1,\"examples\":[]},{\"content\":\" having a very powerful effect or influence on your body or mind\",\"kindId\":7,\"examples\":[{\"content\":\"potent drugs\"},{\"content\":\"Advertising is a potent force in showing smoking as a socially acceptable habit.\"},{\"content\":\"a potent symbol of oppression\"},{\"content\":\"A good company pension scheme remains a potent weapon for attracting staff.\"}]}],\"description\":\"potent\",\"meaningMap\":{},\"timeStamp\":1296035155298}','potent','/ˈpəʊ.tənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/p/pot/poten/potent.mp3\', this)',1296035155298),
 (806,'{\"pron\":\"/rɪˈlʌk.tənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/r/rel/reluc/reluctant.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"trơ trơ, chống lại, khó bảo, khó làm\",\"kindId\":1,\"examples\":[{\"content\":\"the soil proved quite reluctant to the oil plough\"}]},{\"content\":\"reluctant to do something\",\"examples\":[{\"content\":\"Maddox was reluctant to talk about it.\"}],\"type\":\"gram\"},{\"content\":\" slow and unwilling\",\"kindId\":7,\"examples\":[{\"content\":\"She gave a reluctant smile.\"},{\"content\":\"Maddox was reluctant to talk about it.\"}]},{\"content\":\"miễn cưỡng, bất đắc dĩ, không thích, không sẵn lòng\",\"kindId\":1,\"examples\":[{\"content\":\"to be reluctant to accept the invitation\"},{\"content\":\"to give a reluctant consent\"}]}],\"description\":\"reluctant\",\"meaningMap\":{},\"timeStamp\":1296035161086}','reluctant','/rɪˈlʌk.tənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/r/rel/reluc/reluctant.mp3\', this)',1296035161086),
 (807,'{\"pron\":\"/ˈstaɪ.fl ̩/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/s/sti/stifl/stifle.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"khuỷu chân sau (của ngựa) ((cũng) stifle  joint)\",\"kindId\":2,\"examples\":[]},{\"content\":\"[intransitive,transitive usually passive] if you are stifled by something, it stops you breathing comfortably\",\"kindId\":9,\"examples\":[{\"content\":\"He was almost stifled by the fumes.\"}]},{\"content\":\"bệnh đau khuỷu chân sau (ngựa)\",\"kindId\":2,\"examples\":[]},{\"content\":\"stifle a yawn/smile/grin etc\",\"examples\":[{\"content\":\"I tried to stifle my laughter.\"}],\"type\":\"collo\"},{\"content\":\"(như) smother\",\"kindId\":4,\"examples\":[]},{\"content\":\"[transitive] to stop a feeling from being expressed\",\"kindId\":9,\"examples\":[{\"content\":\"I tried to stifle my laughter.\"},{\"content\":\"He stifled an urge to hit her.\"}]},{\"content\":\"[transitive] to stop something from happening or developing\",\"kindId\":9,\"examples\":[{\"content\":\"rules and regulations that stifle innovation\"},{\"content\":\"How can this party stifle debate on such a crucial issue?\"}]}],\"description\":\"stifle\",\"meaningMap\":{},\"timeStamp\":1296035168467}','stifle','/ˈstaɪ.fl ̩/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/s/sti/stifl/stifle.mp3\', this)',1296035168467),
 (808,'{\"pron\":\"/ˈtræn.zi.ənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/tra/trans/transient.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"tạm thời\",\"kindId\":1,\"examples\":[]},{\"content\":\"khách ở lại thời gian ngắn; khách trọ ngắn ngày\",\"kindId\":2,\"examples\":[]},{\"content\":\" continuing only for a short time\",\"kindId\":7,\"examples\":[{\"content\":\"transient fashions\"}]},{\"content\":\" someone who has no home and moves around from place to place\",\"kindId\":8,\"examples\":[]},{\"content\":\"ngắn ngủi, nhất thời, chóng tàn\",\"kindId\":1,\"examples\":[{\"content\":\"transient success\"}]},{\"content\":\"thoáng qua, nhanh, vội vàng\",\"kindId\":1,\"examples\":[{\"content\":\"a transient gleam of hope\"},{\"content\":\"to cast a transient look at\"},{\"content\":\"transient sorrow\"}]},{\"content\":\"ở thời gian ngắn\",\"kindId\":1,\"examples\":[{\"content\":\"transient lodger\"},{\"content\":\"transient guest\"}]},{\"content\":\"(âm nhạc) (thuộc) nốt đệm\",\"kindId\":1,\"examples\":[]},{\"content\":\" working or staying somewhere for only a short time\",\"kindId\":7,\"examples\":[{\"content\":\"a transient population\"}]}],\"description\":\"transient\",\"meaningMap\":{},\"timeStamp\":1296035180086}','transient','/ˈtræn.zi.ənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/tra/trans/transient.mp3\', this)',1296035180086),
 (809,'{\"meanings\":[{\"content\":\"không phân biệt\",\"kindId\":1,\"examples\":[]},{\"content\":\"tầm thường, xoàng, không bị xuyên tạc\",\"kindId\":1,\"examples\":[]}],\"description\":\"undistinguished\",\"meaningMap\":{},\"timeStamp\":1296035187655}','undistinguished',NULL,NULL,1296035187655),
 (810,'{\"pron\":\"/veɪld/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/vei/veile/veiled.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"bị che, bị phủ\",\"kindId\":1,\"examples\":[]},{\"content\":\"che mạng\",\"kindId\":1,\"examples\":[]},{\"content\":\" a veiled threat, warning, attack, reference etc is expressed so that its exact meaning is hidden or unclear\",\"kindId\":7,\"examples\":[{\"content\":\"His speech is being seen as a veiled attack on asylum-seekers.\"},{\"content\":\"Jasper remained silent and his eyes were veiled (\\u003dyou could not guess what he was thinking).\"},{\"content\":\"\\u0027\\u0027I\\u0027\\u0027m impressed,\\u0027\\u0027 said Greg, with thinly veiled (\\u003donly slightly hidden) sarcasm.\"}]},{\"content\":\"úp mở; che đậy, che giấu\",\"kindId\":1,\"examples\":[{\"content\":\"a veiled threat\"},{\"content\":\"veiled resentment\"}]},{\"content\":\"khàn (âm thanh); mờ (ảnh)\",\"kindId\":1,\"examples\":[{\"content\":\"veiled voice\"},{\"content\":\"veiled negative\"}]}],\"description\":\"veiled\",\"meaningMap\":{},\"timeStamp\":1296035194455}','veiled','/veɪld/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/vei/veile/veiled.mp3\', this)',1296035194455),
 (811,'{\"pron\":\"/wiːld/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/w/wie/wield/wield.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"nắm và sử dụng (vũ khí)\",\"kindId\":4,\"examples\":[]},{\"content\":\"dùng, cầm (một dụng cụ)\",\"kindId\":4,\"examples\":[{\"content\":\"to wield the pen\"}]},{\"content\":\"(nghĩa bóng) sử dụng, vận dụng, thi hành\",\"kindId\":4,\"examples\":[{\"content\":\"to wield influence\"},{\"content\":\"to wield power\"}]},{\"content\":\" to hold a weapon or tool that you are going to use\",\"kindId\":9,\"examples\":[{\"content\":\"She had her car windows smashed by a gang wielding baseball bats.\"}]},{\"content\":\" to have a lot of power or influence, and to use it\",\"kindId\":9,\"examples\":[{\"content\":\"The Church wields immense power in Ireland.\"}]}],\"description\":\"wield\",\"meaningMap\":{},\"timeStamp\":1296035200318}','wield','/wiːld/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/w/wie/wield/wield.mp3\', this)',1296035200318),
 (812,'{\"meanings\":[{\"content\":\"thông minh, khéo léo, nhanh trí\",\"kindId\":5,\"examples\":[]},{\"content\":\"thích hợp, thích đáng, đúng\",\"kindId\":5,\"examples\":[]},{\"content\":\" named, described etc in a way that seems very suitable\",\"kindId\":6,\"examples\":[{\"content\":\"The aptly named Skyline Restaurant provides spectacular views of the city below.\"}]}],\"description\":\"aptly\",\"meaningMap\":{},\"timeStamp\":1296035208557}','aptly',NULL,NULL,1296035208557),
 (813,'{\"pron\":\"/bɑːd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usb/usban/usbante025.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" William Shakespeare\",\"kindId\":8,\"examples\":[]},{\"content\":\"(thơ ca) thi sĩ, nhà thơ\",\"kindId\":2,\"examples\":[]},{\"content\":\"giáp (sắt cho) ngựa\",\"kindId\":2,\"examples\":[]},{\"content\":\" a poet\",\"kindId\":8,\"examples\":[]},{\"content\":\"ca sĩ chuyên hát những bài hát cổ\",\"kindId\":2,\"examples\":[]}],\"description\":\"bard\",\"meaningMap\":{},\"timeStamp\":1296035218044}','bard','/bɑːd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usb/usban/usbante025.mp3\', this)',1296035218044),
 (814,'{\"pron\":\"/ɪnˈdaʊ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71540.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" to give someone something\",\"kindId\":9,\"examples\":[]},{\"content\":\"((thường) động tính từ quá khứ) phú cho\",\"kindId\":4,\"examples\":[{\"content\":\"to be endowed with many talents\"}]},{\"content\":\"để vốn lại cho (vợ, con gái...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"cúng vốn cho (một tổ chức...)\",\"kindId\":4,\"examples\":[]},{\"content\":\" to give a college, hospital etc a large sum of money that provides it with an income\",\"kindId\":9,\"examples\":[]},{\"content\":\" to make someone or something have a particular quality, or to believe that they have it\",\"kindId\":9,\"examples\":[{\"content\":\"Her resistance to the Nationalists endowed her with legendary status.\"}]},{\"content\":\" to naturally have a good feature or quality\",\"kindId\":9,\"examples\":[{\"content\":\"She was endowed with good looks.\"}]}],\"description\":\"endow\",\"meaningMap\":{},\"timeStamp\":1296035231101}','endow','/ɪnˈdaʊ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus71/eus71540.mp3\', this)',1296035231101),
 (815,'{\"pron\":\"/fəʊk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/fol/folk_/folk.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"young/old folk\",\"examples\":[{\"content\":\"Young folk these days don\\u0027\\u0027t know the meaning of work.\"}],\"type\":\"collo\"},{\"content\":\" science etc that is based on the ideas or beliefs that ordinary people have, and does not involve a high level of technical knowledge\",\"kindId\":7,\"examples\":[]},{\"content\":\"(số nhiều) (thông tục) người thân thuộc\",\"examples\":[{\"content\":\"one\\u0027\\u0027s folks\"},{\"content\":\"the old folks at home\"}]},{\"content\":\"[plural] people who live in a particular area or do a particular kind of work\",\"kindId\":8,\"examples\":[{\"content\":\"simple country folk\"}]},{\"content\":\"người\",\"examples\":[{\"content\":\"old folk\"},{\"content\":\"country folk\"}]},{\"content\":\"[plural] people\",\"kindId\":8,\"examples\":[{\"content\":\"Thanks to the folks at NBC.\"},{\"content\":\"I\\u0027\\u0027m sure there are some folk who would rather they weren\\u0027\\u0027t here.\"},{\"content\":\"Young folk these days don\\u0027\\u0027t know the meaning of work.\"},{\"content\":\"Wait till the folks back home hear about this!\"}]},{\"content\":\" folk art, stories, customs etc are traditional and typical of the ordinary people who live in a particular area\",\"kindId\":7,\"examples\":[{\"content\":\"folk tales\"},{\"content\":\"an Irish folk song\"}]},{\"content\":\"(từ cổ,nghĩa cổ) dân tộc, dân gian\",\"examples\":[]},{\"content\":\"[plural] your parents and family\",\"kindId\":8,\"examples\":[{\"content\":\"Is it OK if I call my folks?\"},{\"content\":\"That\\u0027\\u0027s all for now, folks.\"}]},{\"content\":\" a traditional type of medical treatment that uses plants or simple treatments rather than scientific methods\",\"kindId\":7,\"examples\":[]},{\"content\":\"[uncountable] folk music\",\"kindId\":8,\"examples\":[{\"content\":\"a folk singer\"}]}],\"description\":\"folk\",\"meaningMap\":{},\"timeStamp\":1296035244425}','folk','/fəʊk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/fol/folk_/folk.mp3\', this)',1296035244425),
 (816,'{\"pron\":\"/ˈgæl.ək.si/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usz/uszzz/uszzzzd018.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"[singular] a large number of things that are similar\",\"kindId\":8,\"examples\":[{\"content\":\"a galaxy of British artistic talent\"}]},{\"content\":\"(nghĩa bóng) nhóm tinh hoa, nhóm\",\"kindId\":2,\"examples\":[{\"content\":\"a galaxy of talent\"}]},{\"content\":\"[countable] one of the large groups of stars that make up the universe\",\"kindId\":8,\"examples\":[]},{\"content\":\" the large group of stars which our sun and its planets belong to\",\"kindId\":8,\"examples\":[]},{\"examples\":[{\"content\":\"a galaxy of British artistic talent\"}],\"type\":\"gram\"},{\"content\":\"(thiên văn học) ngân hà, thiên hà\",\"kindId\":2,\"examples\":[]}],\"description\":\"galaxy\",\"meaningMap\":{},\"timeStamp\":1296035250927}','galaxy','/ˈgæl.ək.si/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usz/uszzz/uszzzzd018.mp3\', this)',1296035250927),
 (817,'{\"pron\":\"/ˈhæn.dɪ.kæp/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/h/han/handi/handicap.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"cuộc thi có chấp (đẻ cho hai bên cân sức)\",\"kindId\":2,\"examples\":[]},{\"content\":\" to make it difficult for someone to do something that they want or need to do\",\"kindId\":9,\"examples\":[{\"content\":\"The charity is handicapped by lack of funds.\"}]},{\"content\":\"điều chấp (trong một cuộc thi)\",\"kindId\":2,\"examples\":[]},{\"content\":\" if someone has a handicap, a part of their body or their mind has been permanently injured or damaged. Many people think that this word is offensive.\",\"kindId\":8,\"examples\":[]},{\"content\":\"(nghĩa bóng) sự cản trở; điều bất lợi\",\"kindId\":2,\"examples\":[]},{\"content\":\" a race for horses in which the best horses carry extra weight so that all the horses have an equal chance of winning\",\"kindId\":8,\"examples\":[]},{\"content\":\" an advantage that is given to a weaker player in a game of golf\",\"kindId\":8,\"examples\":[{\"content\":\"He\\u0027\\u0027s improved a lot, and his handicap has come down from 18 to 12.\"}]},{\"content\":\" a situation that makes it difficult for someone to do what they want\",\"kindId\":8,\"examples\":[{\"content\":\"Not speaking the language is a real handicap.\"}]}],\"description\":\"handicap\",\"meaningMap\":{},\"timeStamp\":1296035262230}','handicap','/ˈhæn.dɪ.kæp/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/h/han/handi/handicap.mp3\', this)',1296035262230),
 (818,'{\"pron\":\"/ɪnˈtriːg/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/i/int/intri/intrigue.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"có mưu đồ; vận động ngầm\",\"kindId\":3,\"examples\":[]},{\"content\":\"tình tiết (của một vở kịch...); cốt truyện\",\"kindId\":2,\"examples\":[]},{\"content\":\"dan díu, tằng tịu (với người có chồng)\",\"kindId\":3,\"examples\":[]},{\"content\":\"[intransitive] to make secret plans to harm someone or make them lose their position of power\",\"kindId\":9,\"examples\":[{\"content\":\"While King Richard was abroad, the barons had been intriguing against him.\"}]},{\"examples\":[{\"content\":\"While King Richard was abroad, the barons had been intriguing against him.\"}],\"type\":\"gram\"},{\"content\":\"làm ngạc nhiên, làm phải suy nghĩ\",\"kindId\":4,\"examples\":[{\"content\":\"to intrigued by the suddenness of an event\"}]},{\"content\":\"[transitive] if something intrigues you, it interests you a lot because it seems strange or mysterious\",\"kindId\":9,\"examples\":[{\"content\":\"Other people\\u0027\\u0027s houses always intrigued her.\"}]},{\"content\":\"[uncountable and countable] the making of secret plans to harm someone or make them lose their position of power, or a plan of this kind\",\"kindId\":8,\"examples\":[{\"content\":\"a web of intrigue (\\u003dcomplicated set of secret plans)\"},{\"content\":\"the political intrigues of the capital\"},{\"content\":\"It\\u0027\\u0027s an exciting story of political intrigue and murder.\"}]},{\"content\":\"mưu đồ; sự vận động ngầm; thói hay vận động ngầm\",\"kindId\":2,\"examples\":[]},{\"content\":\"mối dan díu ngầm, sự tằng tịu ngầm (với người có chồng)\",\"kindId\":2,\"examples\":[]},{\"content\":\"hấp dẫn, gợi thích thú, kích thích tò mò\",\"kindId\":4,\"examples\":[{\"content\":\"to be intrigued by a new idea\"}]},{\"content\":\"mưu đồ làm (cái gì); vận động ngần làm (cái gì)\",\"kindId\":4,\"examples\":[{\"content\":\"to intrigue a bill through Congress\"}]},{\"examples\":[{\"content\":\"the political intrigues of the capital\"}],\"type\":\"gram\"}],\"description\":\"intrigue\",\"meaningMap\":{},\"timeStamp\":1296035273816}','intrigue','/ɪnˈtriːg/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/i/int/intri/intrigue.mp3\', this)',1296035273816),
 (819,'{\"pron\":\"/ˈlɑː.və/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/l/lar/larva/larva.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a young insect with a soft tube-shaped body, which will later become an insect with wings\",\"kindId\":8,\"examples\":[]},{\"content\":\"(động vật học) ấu trùng\",\"kindId\":2,\"examples\":[]}],\"description\":\"larva\",\"meaningMap\":{},\"timeStamp\":1296035279767}','larva','/ˈlɑː.və/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/l/lar/larva/larva.mp3\', this)',1296035279767),
 (820,'{\"pron\":\"/məˈdʒes.tɪk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/m/maj/majes/majestic.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" very big, impressive, or beautiful\",\"kindId\":7,\"examples\":[{\"content\":\"This lovely village is surrounded by majestic mountain scenery.\"}]},{\"content\":\"uy nghi, oai nghiêm, oai vệ, đường bệ\",\"kindId\":1,\"examples\":[]}],\"description\":\"majestic\",\"meaningMap\":{},\"timeStamp\":1296035285904}','majestic','/məˈdʒes.tɪk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/m/maj/majes/majestic.mp3\', this)',1296035285904),
 (821,'{\"pron\":\"/ˌniː.əʊ ˈlɪθ.ɪk/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75845.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(thuộc) thời kỳ đồ đá mới\",\"kindId\":1,\"examples\":[]}],\"description\":\"neolithic\",\"meaningMap\":{},\"timeStamp\":1296035292452}','neolithic','/ˌniː.əʊ ˈlɪθ.ɪk/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/eus/eus75/eus75845.mp3\', this)',1296035292452),
 (822,'{\"meanings\":[{\"content\":\" to make someone have to do something, because it is the law, their duty, or the right thing to do\",\"kindId\":9,\"examples\":[{\"content\":\"Tenants are obligated to pay their rent on time.\"}]},{\"content\":\"obligate somebody to do something\",\"examples\":[{\"content\":\"Tenants are obligated to pay their rent on time.\"}],\"type\":\"gram\"},{\"content\":\" to feel that you must do something because it is right or because someone has done something for you\",\"kindId\":9,\"examples\":[{\"content\":\"Ava felt obligated to help her mother, even if it meant leaving college.\"},{\"content\":\"Watson felt obligated to him for the loan.\"}]},{\"content\":\"be/feel obligated to do something\",\"examples\":[{\"content\":\"Ava felt obligated to help her mother, even if it meant leaving college.\"}],\"type\":\"gram\"},{\"content\":\"be/feel obligated to somebody\",\"examples\":[{\"content\":\"Watson felt obligated to him for the loan.\"}],\"type\":\"gram\"},{\"content\":\"bắt buộc, ép buộc\",\"kindId\":4,\"examples\":[]}],\"description\":\"obligate\",\"meaningMap\":{},\"timeStamp\":1296035299543}','obligate',NULL,NULL,1296035299543),
 (823,'{\"pron\":\"/ˈpruː.dənt/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/p/pru/prude/prudent.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" sensible and careful, especially by trying to avoid unnecessary risks\",\"kindId\":7,\"examples\":[{\"content\":\"prudent house buyers\"},{\"content\":\"It might be prudent to get a virus detector for the network.\"}]},{\"content\":\"it is prudent (for somebody) to do something\",\"examples\":[{\"content\":\"It might be prudent to get a virus detector for the network.\"}],\"type\":\"gram\"},{\"content\":\"thận trọng, cẩn thận\",\"kindId\":1,\"examples\":[]},{\"content\":\"khôn ngoan\",\"kindId\":1,\"examples\":[]}],\"description\":\"prudent\",\"meaningMap\":{},\"timeStamp\":1296035305296}','prudent','/ˈpruː.dənt/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/p/pru/prude/prudent.mp3\', this)',1296035305296),
 (824,'{\"pron\":\"/slɜːr/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/s/slu/slur_/slur.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"điều xấu hổ, điều nhục nhã\",\"kindId\":2,\"examples\":[]},{\"content\":\" a curved line written over musical notes to show they must be played together smoothly\",\"kindId\":8,\"examples\":[]},{\"examples\":[{\"content\":\"Milton regarded her comment as a slur on his country.\"}],\"type\":\"gram\"},{\"content\":\"(âm nhạc) luyến âm\",\"kindId\":2,\"examples\":[]},{\"content\":\"(âm nhạc) hát luyến; đánh dấu luyến âm (vào bản nhạc)\",\"kindId\":4,\"examples\":[]},{\"content\":\"viết líu nhíu; nói líu nhíu, nói lắp; hát nhịu\",\"kindId\":4,\"examples\":[]},{\"content\":\"sự nói xấu, sự gièm pha\",\"kindId\":2,\"examples\":[{\"content\":\"to put a slur upon someone\"}]},{\"content\":\"viết chữ líu nhíu; nói líu nhíu, nói lắp; hát nhịu\",\"kindId\":3,\"examples\":[]},{\"content\":\"[transitive] to play a group of musical notes smoothly together\",\"kindId\":9,\"examples\":[]},{\"content\":\"bôi bẩn, bôi nhoè (bản in...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"(+ over) bỏ qua, lướt qua\",\"kindId\":3,\"examples\":[{\"content\":\"to slur over details\"}]},{\"content\":\"giấu giếm; giảm nhẹ (mức trầm trọng, sai lầm)\",\"kindId\":4,\"examples\":[]},{\"content\":\"[transitive] to criticize someone or something unfairly\",\"kindId\":9,\"examples\":[]},{\"content\":\" an unfair criticism that is intended to make people dislike someone or something\",\"kindId\":8,\"examples\":[{\"content\":\"a racist slur\"},{\"content\":\"Milton regarded her comment as a slur on his country.\"},{\"content\":\"How dare she cast a slur on (\\u003dcriticize) my character?\"}]},{\"content\":\"mờ nét đi (hình ảnh)\",\"kindId\":3,\"examples\":[]},{\"content\":\"slur your words/speech\",\"examples\":[{\"content\":\"She was slurring her words as if she was drunk.\"}],\"type\":\"collo\"},{\"content\":\"chữ viết líu nhíu; sự nói líu nhíu, sự nói lắp; hát nhịu\",\"kindId\":2,\"examples\":[]},{\"content\":\"[intransitive and transitive] to speak unclearly without separating your words or sounds correctly\",\"kindId\":9,\"examples\":[{\"content\":\"His voice sounded slurred.\"},{\"content\":\"She was slurring her words as if she was drunk.\"}]},{\"content\":\"nói xấu, gièm pha; nói kháy\",\"kindId\":4,\"examples\":[]},{\"content\":\"vết bẩn, vết nhơ\",\"kindId\":2,\"examples\":[]}],\"description\":\"slur\",\"meaningMap\":{},\"timeStamp\":1296035323321}','slur','/slɜːr/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/s/slu/slur_/slur.mp3\', this)',1296035323321),
 (825,'{\"pron\":\"/trænˈskraɪb/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/t/tra/trans/transcribe.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"ghi lại để phát thanh, phát thanh theo chương trình đã ghi lại\",\"kindId\":4,\"examples\":[]},{\"content\":\"transcribe something for something\",\"examples\":[{\"content\":\"a piece transcribed for piano\"}],\"type\":\"gram\"},{\"content\":\"(âm nhạc) chuyển biên\",\"kindId\":4,\"examples\":[]},{\"content\":\" to change a piece of writing into the alphabet of another language\",\"kindId\":9,\"examples\":[{\"content\":\"The book has been transcribed into braille.\"}]},{\"content\":\"sao lại, chép lại\",\"kindId\":4,\"examples\":[]},{\"content\":\" to write an exact copy of something\",\"kindId\":9,\"examples\":[{\"content\":\"He had been asked to transcribe an ancient manuscript.\"}]},{\"content\":\" to represent speech sounds with phonetic symbols\",\"kindId\":9,\"examples\":[]},{\"content\":\"transcribe something into something\",\"examples\":[{\"content\":\"The book has been transcribed into braille.\"}],\"type\":\"gram\"},{\"content\":\" to copy recorded music, speech etc from one system to another, for example from tape to CD\",\"kindId\":9,\"examples\":[]},{\"content\":\" to arrange a piece of music for a different instrument or voice\",\"kindId\":9,\"examples\":[{\"content\":\"a piece transcribed for piano\"}]},{\"content\":\"(ngôn ngữ học) phiên âm (bằng dấu phiên âm)\",\"kindId\":4,\"examples\":[]},{\"content\":\" to write down something exactly as it was said\",\"kindId\":9,\"examples\":[{\"content\":\"A secretary transcribed the witnesses\\u0027\\u0027 statements.\"}]}],\"description\":\"transcribe\",\"meaningMap\":{},\"timeStamp\":1296035331125}','transcribe','/trænˈskraɪb/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/t/tra/trans/transcribe.mp3\', this)',1296035331125),
 (826,'{\"pron\":\"/ˈʌn.djʊ.leɪ.tɪŋ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usu/usund/usunder010.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"gợn sóng, nhấp nhô\",\"kindId\":1,\"examples\":[]}],\"description\":\"undulating\",\"meaningMap\":{},\"timeStamp\":1296035337748}','undulating','/ˈʌn.djʊ.leɪ.tɪŋ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usu/usund/usunder010.mp3\', this)',1296035337748),
 (827,'{\"pron\":\"/vəˈlɒs.ɪ.ti/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/v/vel/veloc/velocity.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"tốc độ, tốc lực\",\"kindId\":2,\"examples\":[{\"content\":\"muzzle velocity\"},{\"content\":\"initial velocity\"}]},{\"content\":\"[uncountable] a high speed\",\"kindId\":8,\"examples\":[{\"content\":\"Martinez had good velocity on his fastball.\"}]},{\"content\":\"[uncountable and countable] the speed of something that is moving in a particular direction\",\"kindId\":8,\"examples\":[{\"content\":\"The speedboat reached a velocity of 120 mph.\"},{\"content\":\"a high velocity bullet\"},{\"content\":\"the velocity of light\"}]}],\"description\":\"velocity\",\"meaningMap\":{},\"timeStamp\":1296035343591}','velocity','/vəˈlɒs.ɪ.ti/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/v/vel/veloc/velocity.mp3\', this)',1296035343591),
 (828,'{\"pron\":\"/ˈwɪnd .mɪl/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/u/usw/uswil/uswillo010.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"cối xay gió; máy xay gió\",\"kindId\":2,\"examples\":[]},{\"content\":\" a toy consisting of a stick with curved pieces of plastic at the end that turn around when they are blown\",\"kindId\":8,\"examples\":[]},{\"content\":\" a building or structure with parts that turn around in the wind, used for producing electrical power or crushing grain\",\"kindId\":8,\"examples\":[]}],\"description\":\"windmill\",\"meaningMap\":{},\"timeStamp\":1296035351174}','windmill','/ˈwɪnd .mɪl/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/u/usw/uswil/uswillo010.mp3\', this)',1296035351174),
 (829,'{\"pron\":\"/əˈwɔːd/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/a/awa/award/award.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"win/receive an award\",\"examples\":[{\"content\":\"Rosie was in London to receive her award as Mum of the Year.\"},{\"content\":\"The hotel\\u0027\\u0027s award-winning restaurant specializes in traditional food.\"}],\"type\":\"collo\"},{\"examples\":[{\"content\":\"the Presidential Award for Excellence in Science and Mathematics Teaching\"}],\"type\":\"gram\"},{\"content\":\"award somebody something\",\"examples\":[{\"content\":\"The government awarded a German company the contract.\"}],\"type\":\"gram\"},{\"content\":\"award something to somebody\",\"examples\":[{\"content\":\"A Nobel Prize was awarded to Waksman in 1952.\"}],\"type\":\"gram\"},{\"content\":\"sự quyết định của quan toà, của hội đồng giám khảo...\",\"kindId\":2,\"examples\":[]},{\"content\":\"award somebody something\",\"examples\":[{\"content\":\"The judge awarded me first prize.\"}],\"type\":\"gram\"},{\"content\":\" something, especially money, that is officially given to someone as a payment or after a legal decision\",\"kindId\":8,\"examples\":[{\"content\":\"the teachers\\u0027\\u0027 pay award\"},{\"content\":\"an award for unfair dismissal\"}]},{\"content\":\" something such as a prize or money given to someone to reward them for something they have done\",\"kindId\":8,\"examples\":[{\"content\":\"The hotel\\u0027\\u0027s award-winning restaurant specializes in traditional food.\"},{\"content\":\"Rosie was in London to receive her award as Mum of the Year.\"},{\"content\":\"Magnusson presented the £1000 award to the group\\u0027\\u0027s chairman.\"},{\"content\":\"the Presidential Award for Excellence in Science and Mathematics Teaching\"}]},{\"content\":\" to officially give someone something such as a prize or money to reward them for something they have done\",\"kindId\":9,\"examples\":[{\"content\":\"A Nobel Prize was awarded to Waksman in 1952.\"},{\"content\":\"The judge awarded me first prize.\"},{\"content\":\"Moodie has been awarded a golf scholarship at the University of Hawaii.\"}]},{\"content\":\"award something to somebody\",\"examples\":[{\"content\":\"£45,000 was awarded to a typist with an injured hand.\"}],\"type\":\"gram\"},{\"content\":\"phần thưởng, tặng thưởng (do quan toà, hội đồng trọng tài, hội đồng giám khảo... quyết định ban cho)\",\"kindId\":2,\"examples\":[]},{\"content\":\" to officially decide that someone should receive a payment or a formal agreement\",\"kindId\":9,\"examples\":[{\"content\":\"The government awarded a German company the contract.\"},{\"content\":\"£45,000 was awarded to a typist with an injured hand.\"}]},{\"content\":\"sự trừng phạt, hình phạt (do quan toà, hội đồng trọng tài, hội đồng giám khảo... quyết định bắt phải chịu)\",\"kindId\":2,\"examples\":[]},{\"content\":\"quyết định ban cho, quyết định cấp cho (quan toà, hội đồng trọng tài, hội đồng giám khảo...)\",\"kindId\":4,\"examples\":[]},{\"content\":\"tặng, tặng thưởng, trao tặng\",\"kindId\":4,\"examples\":[{\"content\":\"to award somebody a gold medal\"}]}],\"description\":\"award\",\"meaningMap\":{},\"timeStamp\":1296035362315}','award','/əˈwɔːd/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/a/awa/award/award.mp3\', this)',1296035362315),
 (830,'{\"pron\":\"/ˈbær.ən/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/b/bar/barre/barren.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" a businessman with a lot of power or influence\",\"kindId\":8,\"examples\":[{\"content\":\"drug barons\"},{\"content\":\"conservative press barons like Beaverbrook\"}]},{\"content\":\"(nghĩa bóng) nhà đại tư bản; vua (một ngành kinh doanh)\",\"kindId\":2,\"examples\":[]},{\"content\":\" a man who is a member of a low rank of the British nobility or of a rank of European nobility\",\"kindId\":8,\"examples\":[]},{\"content\":\"nam tước\",\"kindId\":2,\"examples\":[]}],\"description\":\"baron\",\"meaningMap\":{},\"timeStamp\":1296035368626}','baron','/ˈbær.ən/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/b/bar/barre/barren.mp3\', this)',1296035368626),
 (831,'{\"pron\":\"/kənˈfɜːr /\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/c/con/confe/confer.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"(+ with) bàn bạc, hỏi ý kiến, hội ý\",\"kindId\":3,\"examples\":[{\"content\":\"to confer with somebody\"}]},{\"content\":\"phong, ban\",\"kindId\":4,\"examples\":[{\"content\":\"to confer a title on somebody\"}]},{\"content\":\" to officially give someone a title etc, especially as a reward for something they have achieved\",\"kindId\":9,\"examples\":[{\"content\":\"An honorary degree was conferred on him by the University.\"}]},{\"examples\":[{\"content\":\"An honorary degree was conferred on him by the University.\"}],\"type\":\"gram\"},{\"content\":\"[intransitive] to discuss something with other people, so that everyone can express their opinions and decide on something\",\"kindId\":9,\"examples\":[{\"content\":\"Franklin leant over and conferred with his attorneys.\"}]},{\"examples\":[{\"content\":\"Franklin leant over and conferred with his attorneys.\"}],\"type\":\"gram\"}],\"description\":\"confer\",\"meaningMap\":{},\"timeStamp\":1296035376227}','confer','/kənˈfɜːr /','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/c/con/confe/confer.mp3\', this)',1296035376227),
 (832,'{\"pron\":\"/dɪˈsiːv/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/d/dec/decei/deceive.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"lừa dối, đánh lừa, lừa đảo, lừa gạt\",\"kindId\":0,\"examples\":[{\"content\":\"to deceive oneself\"}]},{\"content\":\"deceive yourself that\",\"examples\":[{\"content\":\"He didn\\u0027\\u0027t deceive himself that he and Ruth could remain friends.\"}],\"type\":\"gram\"},{\"content\":\"deceive somebody about something\",\"examples\":[{\"content\":\"I wouldn\\u0027\\u0027t deceive you about anything as important as this.\"}],\"type\":\"gram\"},{\"content\":\"deceive somebody into doing something\",\"examples\":[{\"content\":\"He tried to deceive the public into thinking the war could still be won.\"}],\"type\":\"gram\"},{\"content\":\"làm thất vọng\",\"kindId\":0,\"examples\":[{\"content\":\"to deceive one\\u0027\\u0027s hopes\"}]},{\"content\":\" to give someone a wrong belief or opinion about something\",\"kindId\":9,\"examples\":[{\"content\":\"Don\\u0027\\u0027t be deceived by the new cover - this is a rehash of old hits.\"}]},{\"content\":\" to refuse to believe that something is true because the truth is unpleasant\",\"kindId\":9,\"examples\":[{\"content\":\"He didn\\u0027\\u0027t deceive himself that he and Ruth could remain friends.\"},{\"content\":\"I thought she loved me, but I was deceiving myself.\"}]},{\"content\":\" to make someone believe something that is not true\",\"kindId\":9,\"examples\":[{\"content\":\"He tried to deceive the public into thinking the war could still be won.\"},{\"content\":\"I wouldn\\u0027\\u0027t deceive you about anything as important as this.\"},{\"content\":\"He had been deceived by a young man claiming to be the son of a millionaire.\"}]}],\"description\":\"deceive\",\"meaningMap\":{},\"timeStamp\":1296035383711}','deceive','/dɪˈsiːv/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/d/dec/decei/deceive.mp3\', this)',1296035383711),
 (833,'{\"pron\":\"/ɪˈrəʊ.ni.əs/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/e/err/erron/erroneous.mp3\\u0027, this)\",\"meanings\":[{\"content\":\" erroneous ideas or information are wrong and based on facts that are not correct\",\"kindId\":7,\"examples\":[{\"content\":\"His economic predictions are based on some erroneous assumptions.\"}]},{\"content\":\"sai lầm, sai sót; không đúng\",\"kindId\":1,\"examples\":[]}],\"description\":\"erroneous\",\"meaningMap\":{},\"timeStamp\":1296035390965}','erroneous','/ɪˈrəʊ.ni.əs/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/e/err/erron/erroneous.mp3\', this)',1296035390965),
 (834,'{\"pron\":\"/flʌʃ/\",\"soundSource\":\"playSoundFromFlash(\\u0027http://dictionary.cambridge.org/media/british/us_pron/f/flu/flush/flush.mp3\\u0027, this)\",\"meanings\":[{\"content\":\"sự giội rửa\",\"kindId\":2,\"examples\":[]},{\"content\":\"làm ngập nước, làm tràn nước\",\"kindId\":4,\"examples\":[]},{\"content\":\"vỗ cánh bay hốt hoảng, vụt bay đi\",\"kindId\":3,\"examples\":[]},{\"examples\":[{\"content\":\"Make sure that the cupboard is flush with the wall.\"}],\"type\":\"gram\"},{\"content\":\"lớp cỏ mới mọc\",\"kindId\":2,\"examples\":[]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) đứng thẳng\",\"kindId\":1,\"examples\":[{\"content\":\"a blow flush in the face\"}]},{\"content\":\"flush red/crimson/scarlet\",\"examples\":[{\"content\":\"Robyn felt her cheeks flush scarlet.\"}],\"type\":\"collo\"},{\"content\":\"kích thích, làm phấn khởi, làm hân hoan\",\"kindId\":4,\"examples\":[{\"content\":\"flushed with victory\"}]},{\"content\":\"làm cho bằng phẳng, làm cho đều, làm cho ngang bằng\",\"kindId\":4,\"examples\":[]},{\"content\":\"[not before noun] if someone is flush, they have plenty of money to spend\",\"kindId\":7,\"examples\":[{\"content\":\"I\\u0027\\u0027m feeling flush at the moment.\"}]},{\"content\":\"làm đâm chồi nẩy lộc\",\"kindId\":4,\"examples\":[]},{\"content\":\"bằng phẳng, ngang bằng\",\"kindId\":1,\"examples\":[{\"content\":\"the door is flush with the walls\"}]},{\"content\":\"[intransitive] to become red in the face, for example when you are angry or embarrassed\",\"kindId\":9,\"examples\":[{\"content\":\"Robyn felt her cheeks flush scarlet.\"},{\"content\":\"Mrs Cooper flushed with indignation.\"},{\"content\":\"He flushed angrily.\"},{\"content\":\"Susan flushed deeply and looked away.\"}]},{\"content\":\"[countable] the part of a toilet that cleans it with a sudden flow of water\",\"kindId\":8,\"examples\":[{\"content\":\"The flush isn\\u0027\\u0027t working properly.\"}]},{\"content\":\"sự tràn đầy; sự phong phú\",\"kindId\":2,\"examples\":[]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) hồng hào, đỏ ửng\",\"kindId\":1,\"examples\":[]},{\"content\":\"sự chảy xiết, sự chảy mạnh (nước); dòng nước (từ guồng cối xay gió)\",\"kindId\":2,\"examples\":[]},{\"content\":\"bằng phẳng, ngang bằng\",\"kindId\":5,\"examples\":[]},{\"content\":\"đâm chồi nẩy lộc (cây)\",\"kindId\":3,\"examples\":[]},{\"content\":\"tràn đầy, chứa chan, đầy dẫy; nhiều tiền lắm của\",\"kindId\":1,\"examples\":[]},{\"content\":\"sự xúc động dào dạt; niềm hân hoan (vì thắng lợi...)\",\"kindId\":2,\"examples\":[]},{\"content\":\"hừng sáng; ánh lên (màu); đỏ bừng, ửng hồng (mặt)\",\"kindId\":3,\"examples\":[]},{\"content\":\"xua cho bay lên\",\"kindId\":4,\"examples\":[]},{\"content\":\"[intransitive and transitive] if you flush a toilet, or if it flushes, you make water go through it to clean it\",\"kindId\":9,\"examples\":[{\"content\":\"She flushed the rest of her drink down the toilet.\"},{\"content\":\"Why do children never remember to flush the loo?\"}]},{\"content\":\"[singular] a red colour that appears on your face when you are angry or embarrassed\",\"kindId\":8,\"examples\":[{\"content\":\"His words brought a warm flush to her face.\"}]},{\"content\":\"tính chất xanh tươi; sức phát triển mạnh mẽ\",\"kindId\":2,\"examples\":[{\"content\":\"the flush of youth\"}]},{\"content\":\"giội nước cho sạch, xối nước\",\"kindId\":4,\"examples\":[]},{\"content\":\" if two surfaces are flush, they are at exactly the same level, so that the place where they meet is flat\",\"kindId\":7,\"examples\":[{\"content\":\"Make sure that the cupboard is flush with the wall.\"}]},{\"content\":\"[transitive] to force water through a pipe in order to clean it\",\"kindId\":9,\"examples\":[{\"content\":\"They flush clean water through the pipes once a day.\"}]},{\"content\":\"(từ Mỹ,nghĩa Mỹ) đứng thẳng\",\"kindId\":5,\"examples\":[]},{\"content\":\" a sudden feeling of anger, embarrassment etc\",\"kindId\":8,\"examples\":[{\"content\":\"She felt a sudden flush of anger.\"}]},{\"content\":\"flush something through something\",\"examples\":[{\"content\":\"They flush clean water through the pipes once a day.\"}],\"type\":\"gram\"},{\"content\":\"làm hừng sáng; làm ánh lên (màu); làm đỏ bừng (mặt)\",\"kindId\":4,\"examples\":[]},{\"content\":\" the beginning of a period of time when you are young etc\",\"kindId\":8,\"examples\":[{\"content\":\"a group of adolescent boys in the first flush of manhood\"}]},{\"content\":\" to make someone leave a place where they are hiding\",\"kindId\":9,\"examples\":[{\"content\":\"The government is determined to flush out the terrorists.\"}]},{\"content\":\"cơn nóng, cơn sốt\",\"kindId\":2,\"examples\":[]},{\"content\":\" to clean something by forcing water through it\",\"kindId\":9,\"examples\":[{\"content\":\"The heating system needs to be flushed out once a year.\"},{\"content\":\"Drinking water helps flush out toxins from the body.\"}]},{\"content\":\" a large number of things that happen or arrive at the same time\",\"kindId\":8,\"examples\":[{\"content\":\"The spring brings a flush of young animals to the farm.\"}]},{\"content\":\"đàn chim (xua cho bay lên một lúc)\",\"kindId\":2,\"examples\":[]},{\"content\":\"tràn ngập, tràn đầy (sông)\",\"kindId\":1,\"examples\":[]},{\"content\":\"[countable] a set of cards that someone has in a card game that are all of the same suit\",\"kindId\":8,\"examples\":[]},{\"content\":\"phun ra, toé ra\",\"kindId\":3,\"examples\":[]},{\"examples\":[{\"content\":\"Mrs Cooper flushed with indignation.\"}],\"type\":\"gram\"},{\"content\":\"(đánh bài) xấp bài cùng hoa; dãy bài cùng hoa\",\"kindId\":2,\"examples\":[{\"content\":\"royal flush\"}]},{\"content\":\"sự hừng sáng; ánh (của ánh sáng, màu sắc); sự đỏ bừng (mặt); sự ửng hồng\",\"kindId\":2,\"examples\":[]}],\"description\":\"flush\",\"meaningMap\":{},\"timeStamp\":1296035404108}','flush','/flʌʃ/','playSoundFromFlash(\'http://dictionary.cambridge.org/media/british/us_pron/f/flu/flush/flush.mp3\', this)',1296035404108),
